$movies = { 862 => Movie.new(862, "Toy Story (1995)", "https://image.tmdb.org/t/p/w500/uXDfjJbdP4ijW5hWSBrPrlKpxab.jpg", "Led by Woody, Andys toys live happily in his room until Andys birthday brings Buzz Lightyear onto the scene. Afraid of losing his place in Andys heart, Woody plots against Buzz. But when circumstances separate Buzz and Woody from their owner, the duo eventually learns to put aside their differences.", "8.0", ["Adventure", "Animation", "Children", "Comedy", "Fantasy"]),
           8844 => Movie.new(8844, "Jumanji (1995)", "https://image.tmdb.org/t/p/w500/z46R8oShx61gXMrAmd7ptpVqNI0.jpg", "When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult whos been trapped inside the game for 26 years -- into their living room. Alans only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.", "7.2", ["Adventure", "Children", "Fantasy"]),
           15602 => Movie.new(15602, "Grumpier Old Men (1995)", "https://image.tmdb.org/t/p/w500/1FSXpj5e8l4KH6nVFO5SPUeraOt.jpg", "A family wedding reignites the ancient feud between next-door neighbors and fishing buddies John and Max. Meanwhile, a sultry Italian divorc�e opens a restaurant at the local bait shop, alarming the locals who worry shell scare the fish away. But shes less interested in seafood than she is in cooking up a hot time with Max.", "6.5", ["Comedy", "Romance"]),
           31357 => Movie.new(31357, "Waiting to Exhale (1995)", "https://image.tmdb.org/t/p/w500/4wjGMwPsdlvi025ZqR4rXnFDvBz.jpg", 'Cheated on, mistreated and stepped on, the women are holding their breath, waiting for the elusive "good man" to break a string of less-than-stellar lovers. Friends and confidants Vannah, Bernie, Glo and Robin talk it all out, determined to find a better way to breathe.', "6.2", ["Comedy", "Drama", "Romance"]),
           11862 => Movie.new(11862, "Father of the Bride Part II (1995)", "https://image.tmdb.org/t/p/w500/rj4LBtwQ0uGrpBnCELr716Qo3mw.jpg", "Just when George Banks has recovered from his daughters wedding, he receives the news that shes pregnant ... and that Georges wife is expecting too. He was planning on selling their home, but thats a plan that�like George�will have to change with the arrival of both a grandchild and a kid of his own.", "6.2", ["Comedy"]),
           949 => Movie.new(949, "Heat (1995)", "https://image.tmdb.org/t/p/w500/obpPQskaVpSiC9RcJRB6iWDTCXS.jpg", "Obsessive master thief Neil McCauley leads a top-notch crew on various daring heists throughout Los Angeles while determined detective Vincent Hanna pursues him without rest. Each man recognizes and respects the ability and the dedication of the other even though they are aware their cat-and-mouse game may end in violence.", "7.9", ["Action", "Crime", "Thriller"]),
           11860 => Movie.new(11860, "Sabrina (1995)", "https://image.tmdb.org/t/p/w500/z1oNjotUI7D06J4LWQFQzdIuPnf.jpg", "An ugly duckling having undergone a remarkable change, still harbors feelings for her crush: a carefree playboy, but not before his business-focused brother has something to say about it.", "6.1", ["Comedy", "Romance"]),
           45325 => Movie.new(45325, "Tom and Huck (1995)", "https://image.tmdb.org/t/p/w500/vIG8hWOa7DyLMRiurzKwVAnIYoU.jpg", "A mischievous young boy, Tom Sawyer, witnesses a murder by the deadly Injun Joe. Tom becomes friends with Huckleberry Finn, a boy with no future and no family. Tom has to choose between honoring a friendship or honoring an oath because the town alcoholic is accused of the murder. Tom and Huck go through several adventures trying to retrieve evidence.", "5.3", ["Adventure", "Children"]),
           9091 => Movie.new(9091, "Sudden Death (1995)", "https://image.tmdb.org/t/p/w500/1pylO6YX5XdOA6QCc5IRxrrffkg.jpg", "When a mans daughter is suddenly taken during a championship hockey game � with the captors demanding a billion dollars by games end � he frantically sets a plan in motion to rescue her and abort an impending explosion before the final buzzer.", "5.9", ["Action"]),
           710 => Movie.new(710, "GoldenEye (1995)", "https://image.tmdb.org/t/p/w500/bFzjdy6ucvNlXmJwoSoYfufV6lP.jpg", "When a powerful Russian satellite weapon is hijacked by a mysterious crime syndicate, its up to James Bond, with the help of programmer Natalya Simonova, to find the culprits and save the world from disaster.", "6.9", ["Action", "Adventure", "Thriller"]),
           9087 => Movie.new(9087, "American President, The (1995)", "https://image.tmdb.org/t/p/w500/yObOAYFIHXHkFPQ3jhgkN2ezaD.jpg", "Widowed U.S. president Andrew Shepherd, one of the worlds most powerful men, can have anything he wants -- and what he covets most is Sydney Ellen Wade, a Washington lobbyist. But Shepherds attempts at courting her spark wild rumors and decimate his approval ratings.", "6.6", ["Comedy", "Drama", "Romance"]),
           12110 => Movie.new(12110, "Dracula: Dead and Loving It (1995)", "https://image.tmdb.org/t/p/w500/4rRfZz8YnHNRr16t3CFcJrPdXHi.jpg", "When a lawyer shows up at the vampires doorstep, he falls prey to his charms and joins him in his search for fresh blood. Enter Professor Van Helsing, who may be the only one able to vanquish the Count.", "6.0", ["Comedy", "Horror"]),
           21032 => Movie.new(21032, "Balto (1995)", "https://image.tmdb.org/t/p/w500/dCVcdb5oxDizqFLz0F7TE60NoC9.jpg", "An outcast half-wolf risks his life to prevent a deadly epidemic from ravaging Nome, Alaska.", "7.3", ["Adventure", "Animation", "Children"]),
           10858 => Movie.new(10858, "Nixon (1995)", "https://image.tmdb.org/t/p/w500/ORlTkdDwWU94O16MlwfIR4g5Hk.jpg", "A look at President Richard M. Nixon�a man carrying the fate of the world on his shoulders while battling the self-destructive demands from within�spanning his troubled boyhood in California to the shocking Watergate scandal that would end his Presidency.", "6.9", ["Drama"]),
           1408 => Movie.new(1408, "Cutthroat Island (1995)", "https://image.tmdb.org/t/p/w500/hYdeBZ4BFXivdouxLfQGWNE6zRx.jpg", "Morgan Adams and her slave, William Shaw, are on a quest to recover the three portions of a treasure map. Unfortunately, the final portion is held by her murderous uncle, Dawg. Her crew is skeptical of her leadership abilities, so she must complete her quest before they mutiny against her. This is made yet more difficult by the efforts of the British crown to end her pirate raids.", "5.8", ["Action", "Adventure", "Romance"]),
           524 => Movie.new(524, "Casino (1995)", "https://image.tmdb.org/t/p/w500/znekQtDwXQrll2XYZqXOxncCgLd.jpg", 'In early-1970s Las Vegas, low-level mobster Sam "Ace" Rothstein gets tapped by his bosses to head the Tangiers Casino. At first, hes a great success in the job, but over the years, problems with his loose-cannon enforcer Nicky Santoro, his ex-hustler wife Ginger, her con-artist ex Lester Diamond and a handful of corrupt politicians put Sam in ever-increasing danger.', "8.0", ["Crime", "Drama"]),
           4584 => Movie.new(4584, "Sense and Sensibility (1995)", "https://image.tmdb.org/t/p/w500/cBK2yL3HqhFvIVd7lLtazWlRZPR.jpg", "Rich Mr. Dashwood dies, leaving his second wife and her daughters poor by the rules of inheritance. Two daughters are the titular opposites.", "7.5", ["Drama", "Romance"]),
           5 => Movie.new(5, "Four Rooms (1995)", "https://image.tmdb.org/t/p/w500/75aHn1NOYXh4M7L5shoeQ6NGykP.jpg", "Its Ted the Bellhops first night on the job...and the hotels very unusual guests are about to place him in some outrageous predicaments. It seems that this evenings room service is serving up one unbelievable happening after another.", "5.7", ["Comedy"]),
           9273 => Movie.new(9273, "Ace Ventura: When Nature Calls (1995)", "https://image.tmdb.org/t/p/w500/wcinCf1ov2D6M3P7BBZkzQFOiIb.jpg", "Summoned from an ashram in Tibet, Ace finds himself on a perilous journey into the jungles of Africa to find Shikaka, the missing sacred animal of the friendly Wachati tribe. He must accomplish this before the wedding of the Wachatis Princess to the prince of the warrior Wachootoos. If Ace fails, the result will be a vicious tribal war.", "6.3", ["Comedy"]),
           11517 => Movie.new(11517, "Money Train (1995)", "https://image.tmdb.org/t/p/w500/jWBDz6Mf9aQVBiUS76JQsEhvoJl.jpg", "When a vengeful New York transit cop decides to steal a trainload of subway fares, his foster brother�a fellow cop�tries to protect him.", "5.8", ["Action", "Comedy", "Crime", "Drama", "Thriller"]),
           8012 => Movie.new(8012, "Get Shorty (1995)", "https://image.tmdb.org/t/p/w500/r82SdPhg4fnIcLt0ogIjQxqjdcO.jpg", 'Chili Palmer is a Miami mobster who gets sent by his boss, the psychopathic "Bones" Barboni, to collect a bad debt from Harry Zimm, a Hollywood producer who specializes in cheesy horror films. When Chili meets Harrys leading lady, the romantic sparks fly. After pitching his own life story as a movie idea, Chili learns that being a mobster and being a Hollywood producer really arent all that different.', "6.5", ["Comedy", "Crime", "Thriller"]),
           1710 => Movie.new(1710, "Copycat (1995)", "https://image.tmdb.org/t/p/w500/sch1NNy1q6O50qaUG0MqoU8z9GD.jpg", "An agoraphobic psychologist and a female detective must work together to take down a serial killer who copies serial killers from the past.", "6.5", ["Crime", "Drama", "Horror", "Mystery", "Thriller"]),
           9691 => Movie.new(9691, "Assassins (1995)", "https://image.tmdb.org/t/p/w500/wPmZYnaQpxwoHmwNwVhZ2IY0UbF.jpg", "Assassin Robert Rath arrives at a funeral to kill a prominent mobster, only to witness a rival hired gun complete the job for him -- with grisly results. Horrified by the murder of innocent bystanders, Rath decides to take one last job and then return to civilian life. But finding his way out of the world of contract killing grows ever more dangerous as Rath falls for his female target and becomes a marked man himself.", "6.4", ["Action", "Crime", "Thriller"]),
           12665 => Movie.new(12665, "Powder (1995)", "https://image.tmdb.org/t/p/w500/kImKATjY4EsK5MDgrmpJdGbQEbq.jpg", 'Harassed by classmates who wont accept his shocking appearance, a shy young man known as "Powder" struggles to fit in. But the cruel taunts stop when Powder displays a mysterious power that allows him to do incredible things. This phenomenon changes the lives of all those around him in ways they never could have imagined.', "6.9", ["Drama", "Sci-Fi"]),
           451 => Movie.new(451, "Leaving Las Vegas (1995)", "https://image.tmdb.org/t/p/w500/nqc2LaUWB4ePf6IqpJ6D8apBDvn.jpg", "Ben Sanderson, an alcoholic Hollywood screenwriter who lost everything because of his drinking, arrives in Las Vegas to drink himself to death. There, he meets and forms an uneasy friendship and non-interference pact with prostitute Sera.", "7.2", ["Drama", "Romance"]),
           16420 => Movie.new(16420, "Othello (1995)", "https://image.tmdb.org/t/p/w500/nNP3FDHUIyztw5eq5AejZKzqXbz.jpg", "The evil Iago pretends to be friend of Othello in order to manipulate him to serve his own end in the film version of this Shakespeare classic.", "6.6", ["Drama"]),
           9263 => Movie.new(9263, "Now and Then (1995)", "https://image.tmdb.org/t/p/w500/5nkAaadxFzzYfFyN3Q5j4VZKRsA.jpg", "Waxing nostalgic about the bittersweet passage from childhood to puberty in this tender coming-of-age tale, four childhood girlfriends -- Teeny, Chrissy, Samantha and Roberta -- recall the magical summer of 1970. During their walk down memory lane, they reconcile experiences with boys, secrets, bullies and more.", "6.9", ["Children", "Drama"]),
           17015 => Movie.new(17015, "Persuasion (1995)", "https://image.tmdb.org/t/p/w500/tYOFCtgLb4hfuwhXKBWwAobWhwS.jpg", "This film adaptation of Jane Austens last novel follows Anne Elliot, the daughter of a financially troubled aristocratic family, who is persuaded to break her engagement to Frederick Wentworth, a young sea captain of meager means. Years later, money troubles force Annes father to rent out the family estate to Admiral Croft, and Anne is again thrown into company with Frederick -- who is now rich, successful and perhaps still in love with Anne.", "7.2", ["Drama", "Romance"]),
           902 => Movie.new(902, "City of Lost Children, The (Cité des enfants perdus, La) (1995)", "https://image.tmdb.org/t/p/w500/whwT3Q9JxbAYzEc3t7uYYcCbTMf.jpg", "A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process.", "7.4", ["Adventure", "Drama", "Fantasy", "Mystery", "Sci-Fi"]),
           37557 => Movie.new(37557, "Shanghai Triad (Yao a yao yao dao waipo qiao) (1995)", "https://image.tmdb.org/t/p/w500/tzG1UxUSfPACREjgBrsPDRUvneH.jpg", "Shanghai, China, 1930. When young Shuisheng arrives from the countryside, his uncle Liushu puts him at the service of Bijou, the mistress of Laoda, supreme boss of the Tang Triad, constantly threatened by his enemies, both those he knows and those lurking in the shadows.", "6.7", ["Crime", "Drama"]),
           9909 => Movie.new(9909, "Dangerous Minds (1995)", "https://image.tmdb.org/t/p/w500/yWHWC8fJRp2kLgiFrEa8o3krOH9.jpg", "Former Marine Louanne Johnson lands a gig teaching in a pilot program for bright but underachieving teens at a notorious inner-city high school. After having a terrible first day, she decides she must throw decorum to the wind. When Johnson returns to the classroom, she does so armed with a no-nonsense attitude informed by her military training and a fearless determination to better the lives of her students -- no matter what the cost.", "6.9", ["Drama"]),
           63 => Movie.new(63, "Twelve Monkeys (a.k.a. 12 Monkeys) (1995)", "https://image.tmdb.org/t/p/w500/2F9KcDGZbEdaQN5jV9ziyRZYY7u.jpg", "In the year 2035, convict James Cole reluctantly volunteers to be sent back in time to discover the origin of a deadly virus that wiped out nearly all of the earths population and forced the survivors into underground communities. But when Cole is mistakenly sent to 1990 instead of 1996, hes arrested and locked up in a mental hospital. There he meets psychiatrist Dr. Kathryn Railly, and patient Jeffrey Goines, the son of a famous virus expert, who may hold the key to the mysterious rogue group, the Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.", "7.6", ["Mystery", "Sci-Fi", "Thriller"]),
           9598 => Movie.new(9598, "Babe (1995)", "https://image.tmdb.org/t/p/w500/zKuQMtnbVTz9DsOnOJmlW71v4qH.jpg", "Babe is a little pig who doesnt quite know his place in the world. With a bunch of odd friends, like Ferdinand the duck who thinks he is a rooster and Fly the dog he calls mum, Babe realises that he has the makings to become the greatest sheep pig of all time, and Farmer Hogget knows it. With the help of the sheep dogs, Babe learns that a pig can be anything that he wants to be.", "6.2", ["Children", "Drama"]),
           687 => Movie.new(687, "Dead Man Walking (1995)", "https://image.tmdb.org/t/p/w500/wQmmJi5ypfHH2boXrQBmsep7qb2.jpg", "A justice drama based on a true story about a man on death row who, in his last days, forms a strong relationship with a nun who teaches him forgiveness and gives him spirituality, as she accompanies him to his execution.", "7.4", ["Crime", "Drama"]),
           33689 => Movie.new(33689, "It Takes Two (1995)", "https://image.tmdb.org/t/p/w500/sdes5TrRbymELYLG85YIxmFb1OP.jpg", "Identical 9-year-olds from very different backgrounds: orphaned Amanda and wealthy Alyssa meet at summer camp and decide to switch places -- and play matchmaker between Alyssas dad, Roger, and the kind social worker who cares for Amanda.", "6.5", ["Children", "Comedy"]),
           9603 => Movie.new(9603, "Clueless (1995)", "https://image.tmdb.org/t/p/w500/71RW4lkES2Dt7vSLSXvekGYNskG.jpg", "Shallow, rich and socially successful Cher is at the top of her Beverly Hills high schools pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other. Emboldened by her success, she decides to give hopelessly klutzy new student Tai a makeover. When Tai becomes more popular than she is, Cher realizes that her disapproving ex-stepbrother was right about how misguided she was -- and falls for him.", "7.3", ["Comedy", "Romance"]),
           34615 => Movie.new(34615, "Cry, the Beloved Country (1995)", "https://image.tmdb.org/t/p/w500/kGPsBswFOCjiGzXq4OZwzEAAODa.jpg", "A South-African preacher goes to search for his wayward son who has committed a crime in the big city.", "6.6", ["Drama"]),
           31174 => Movie.new(31174, "Richard III (1995)", "https://image.tmdb.org/t/p/w500/aN2BcIH6rvGbYiRQCS8lxOdeeVQ.jpg", "A murderous lust for the British throne sees Richard III descend into madness. Though the setting is transposed to the 1930s, England is torn by civil war, split between the rivaling houses of York and Lancaster. Richard aspires to a fascist dictatorship, but must first remove the obstacles to his ascension�among them his brother, his nephews and his brothers wife. When the Duke of Buckingham deserts him, Richards plans are compromised.", "6.8", ["Drama", "War"]),
           11443 => Movie.new(11443, "Dead Presidents (1995)", "https://image.tmdb.org/t/p/w500/eGfsSXizR11tTHVo0kuOOFPAxZt.jpg", "On the streets they call cash dead presidents. And thats just what a Vietnam veteran is after when he returns home from the war only to find himself drawn into a life of crime. With the aid of his fellow vets he plans the ultimate heist -- a daring robbery of an armored car filled with unmarked U.S. currency!", "6.6", ["Action", "Crime", "Drama"]),
           35196 => Movie.new(35196, "Restoration (1995)", "https://image.tmdb.org/t/p/w500/z1YM3WFZnF2NwHT5IRGYUcvZBSl.jpg", "An aspiring young physician, Robert Merivel found himself in the service of King Charles II and saves the life of someone close to the King. Merivel joins the Kings court and lives the high life provided to someone of his position. Merivel is ordered to marry his Kings mistress in order to divert the queens suspicions. He is given one order by the king and that is not to fall in love. The situation worsens when Merivel finds himself in love with his new wife. Eventually, the King finds out and relieves Merivel of his position and wealth. His fall from grace leaves Merivel where he first started. And through his travels and reunions with an old friend, he rediscovers his love for true medicine and what it really means to be a physician.", "6.3", ["Drama"]),
           9312 => Movie.new(9312, "Mortal Kombat (1995)", "https://image.tmdb.org/t/p/w500/fcK7tzSSXMYiMN8E9KlZJL1BYyp.jpg", "For nine generations an evil sorcerer has been victorious in hand-to-hand battle against his mortal enemies. If he wins a tenth Mortal Kombat tournament, desolation and evil will reign over the multiverse forever. To save Earth, three warriors must overcome seemingly insurmountable odds, their own inner demons, and superhuman foes in this action/adventure movie based on one of the most popular video games of all time.", "5.8", ["Action", "Adventure", "Fantasy"]),
           577 => Movie.new(577, "To Die For (1995)", "https://image.tmdb.org/t/p/w500/aedhsShrlJVhLlwhtlmFJgR4Szs.jpg", "Suzanne Stone wants to be a world-famous news anchor and she is willing to do anything to get what she wants. What she lacks in intelligence, she makes up for in cold determination and diabolical wiles. As she pursues her goal with relentless focus, she is forced to destroy anything and anyone that may stand in her way, regardless of the ultimate cost or means necessary.", "6.6", ["Comedy", "Drama", "Thriller"]),
           11861 => Movie.new(11861, "How to Make an American Quilt (1995)", "https://image.tmdb.org/t/p/w500/vwYRaERccwXWCYrTzeWRZRarJOo.jpg", "Soon-to-be-wed graduate student Finn Dodd develops cold feet when she suspects her fianc� is cheating on her. In order to clear her head, Finn visits her grandmother, Hy, and great aunt, Glady Joe Cleary, in Grasse, Calif. There, Finn learns that Hy and Glady Joe are members of a group of passionate quilters, and over the course of her visit she is regaled with tales of love and life by women who have collected rich experiences and much wisdom.", "6.4", ["Drama", "Romance"]),
           807 => Movie.new(807, "Seven (a.k.a. Se7en) (1995)", "https://image.tmdb.org/t/p/w500/69Sns8WoET6CfaYlIkHbla4l7nC.jpg", 'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the "seven deadly sins" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killers mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.', "8.3", ["Mystery", "Thriller"]),
           10530 => Movie.new(10530, "Pocahontas (1995)", "https://image.tmdb.org/t/p/w500/kZ1ft0QZ4e3zDUPMBftEkwI9ftd.jpg", "Pocahontas, daughter of a Native American tribe chief, falls in love with an English soldier as colonists invade 17th century Virginia.", "6.9", ["Animation", "Children", "Drama", "Musical", "Romance"]),
           8391 => Movie.new(8391, "When Night Is Falling (1995)", "https://image.tmdb.org/t/p/w500/f9edMkT6bLXVvZICn47ARnQ1Iu5.jpg", "A prudish woman working on tenure as a literacy professor at a large urban university finds herself attracted to a free-spirited, liberal woman who works at a local carnival.", "6.2", ["Drama", "Romance"]),
           629 => Movie.new(629, "Usual Suspects, The (1995)", "https://image.tmdb.org/t/p/w500/bUPmtQzrRhzqYySeiMpv7GurAfm.jpg", "Held in an L.A. interrogation room, Verbal Kint attempts to convince the feds that a mythic crime lord, Keyser Soze, not only exists, but was also responsible for drawing him and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro harbor � leaving few survivors. Verbal lures his interrogators with an incredible story of the crime lords almost supernatural prowess.", "8.2", ["Crime", "Mystery", "Thriller"]),
           11448 => Movie.new(11448, "Mighty Aphrodite (1995)", "https://image.tmdb.org/t/p/w500/cm0oPKizOQlsXpGYvrHvpELfxdi.jpg", "When Lenny and his wife, Amanda, adopt a baby, Lenny realizes that his son is a genius and becomes obsessed with finding the boys biological mother in hopes that she will be brilliant too. But when he learns that Maxs mother is Linda Ash, a kindhearted prostitute and porn star, Lenny is determined to reform her immoral lifestyle. A Greek chorus chimes in to relate the plot to Greek mythology in this quirky comedy.", "6.8", ["Comedy", "Drama", "Romance"]),
           49133 => Movie.new(49133, "Lamerica (1994)", "https://image.tmdb.org/t/p/w500/nnLpA4mqb3gvhNJQZ00cOyBmeq3.jpg", "Fiore, an Italian conman, arrives in post Communist Albania with Gino, his young apprentice, to set up a shoe factory that will never open. The con requires a native Albanian, so they designate Spiro, an impoverished and confused former political prisoner as chairman of the board. When Fiore returns to Italy to get government funds for the project, Spiro unexpectedly disappears and Gino sets out on a journey to find him. The search leads him to discover Spiros tragic personal history and witness Albanian poverty firsthand.", "7.3", ["Adventure", "Drama"]),
           26441 => Movie.new(26441, "Big Green, The (1995)", "https://image.tmdb.org/t/p/w500/nVHqIuBTcTLmAIrML7T704UwfNI.jpg", "In a depressed Texas town, British foreign exchange teacher Anna attempts to inject some life into her hopeless kids by introducing them to soccer. Theyre terrible at first, but Anna and her football-hero assistant whip them into shape. As they work overtime, the pair help kids build their self-esteem and also get involved in solving family squabbles.", "5.6", ["Children", "Comedy"]),
           97406 => Movie.new(97406, "Georgia (1995)", "https://image.tmdb.org/t/p/w500/uXjfK404xo7SiVlFcAoRyaFqXR4.jpg", "Sadie looks up to her older sister Georgia, a successful folk singer whos happily married with children, but cant break out of the bar-band circuit and hit the big time she desperately covets. Its in part due to her attraction to drugs and booze, and also to her own unwise choice in men. Finally, though, Sadies Achilles heel is a rough, unlovely voice very different than her sisters crowd-pleasing singing.", "5.9", ["Drama"]),
           9089 => Movie.new(9089, "Home for the Holidays (1995)", "https://image.tmdb.org/t/p/w500/a8MslR6deQQVe8JR542XDSwHiPB.jpg", "After losing her job, making out with her soon to be ex-boss, and finding out that her daughter plans to spend Thanksgiving with her boyfriend, Claudia Larson has to face spending the holiday with her family. She wonders if she can survive their crazy antics.", "6.3", ["Drama"]),
           11010 => Movie.new(11010, "Postman, The (Postino, Il) (1994)", "https://image.tmdb.org/t/p/w500/cUaCpjVDefYShKyLmkcDsiPaBHn.jpg", "Simple Italian postman learns to love poetry while delivering mail to a famous poet; he uses this to woo local beauty Beatrice.", "8.0", ["Comedy", "Drama", "Romance"]),
           11359 => Movie.new(11359, "Indian in the Cupboard, The (1995)", "https://image.tmdb.org/t/p/w500/ozQAmW85tTJu2dhRe3evzyY03Nb.jpg", "A nine-year-old boy gets a plastic Indian and a cupboard for his birthday and finds himself involved in adventure when the Indian comes to life and befriends him.", "6.4", ["Adventure", "Children", "Fantasy"]),
           17182 => Movie.new(17182, "Eye for an Eye (1996)", "https://image.tmdb.org/t/p/w500/y2lZSdJ1o0VvLegTw3ad6KFtxra.jpg", "Its fire and brimstone time as grieving mother Karen McCann takes justice into her own hands when a kangaroo court in Los Angeles fails to convict Robert Doob, the monster who raped and murdered her 17-year-old daughter.", "6.1", ["Drama", "Thriller"]),
           2054 => Movie.new(2054, "Mr. Hollands Opus (1995)", "https://image.tmdb.org/t/p/w500/kBmwWeSN3ajnYHZ3dSybEobxEPI.jpg", "In 1965, passionate musician Glenn Holland takes a day job as a high school music teacher, convinced its just a small obstacle on the road to his true calling: writing a historic opus. As the decades roll by with the composition unwritten but generations of students inspired through his teaching, Holland must redefine his lifes purpose.", "7.0", ["Drama"]),
           10607 => Movie.new(10607, "Dont Be a Menace to South Central While Drinking Your Juice in the Hood (1996)", "https://image.tmdb.org/t/p/w500/HZQBF7JDd2e9p4rPSbSHuWHaCC.jpg", "When Ashtray (Shawn Wayans) moves to South Central L.A. to live with his father (who appears to be the same age he is) and grandmother (who likes to talk tough and smoke reefer), he falls in with his gang-banging cousin Loc Dog (Marlon Wayans), who along with the requisite pistols and Uzi carries a thermo-nuclear warhead for self-defense. Will Ashtray be able to keep living the straight life?", "6.9", ["Comedy", "Crime"]),
           19760 => Movie.new(19760, "Two if by Sea (1996)", "https://image.tmdb.org/t/p/w500/xSfqAMYqrTtDeAjPtYo0S8nc5Zz.jpg", "Frank OBrien, a petty thief, and his 7-year-long girlfriend Roz want to put an end to their unsteady lifestyle and just do that last job, which involves stealing a valuable painting. Frank takes Roz to an island on the coast of New England, where he wants to sell the painting and also hopes that their sagging relationship will get a positive push back up. Not everything goes as planned.", "4.9", ["Comedy", "Romance"]),
           9536 => Movie.new(9536, "Bio-Dome (1996)", "https://image.tmdb.org/t/p/w500/pjSkGZAvksrbO6tGain8PJ3rfC7.jpg", 'Bud and Doyle are two losers who are doing nothing with their lives. Both of their girlfriends are actively involved in saving the environment, but the two friends couldnt care less about saving the Earth. One day, when a group of scientists begin a mission to live inside a "Bio-Dome" for a year without outside contact, Bud and Doyle mistakenly become part of the project themselves.', "4.5", ["Comedy"]),
           11525 => Movie.new(11525, "Lawnmower Man 2: Beyond Cyberspace (1996)", "https://image.tmdb.org/t/p/w500/nsKDpcdC62krEPlCKKjLSHuMwwu.jpg", "Jobe is resuscitated by Jonathan Walker. He wants Jobe to create a special computer chip that would connect all the computers in the world into one network, which Walker would control and use. But what Walker doesnt realize is a group of teenage hackers are on to him and out to stop his plan.", "2.9", ["Action", "Sci-Fi", "Thriller"]),
           4482 => Movie.new(4482, "French Twist (Gazon maudit) (1995)", "https://image.tmdb.org/t/p/w500/6yJNScj2ypxqCOCfpSPR3xX4J4E.jpg", "After learning of her husbands infidelities, a housewife invites an itinerant lesbian to move in with them. None of their lives will ever be the same again.", "6.0", ["Comedy", "Romance"]),
           10634 => Movie.new(10634, "Friday (1995)", "https://image.tmdb.org/t/p/w500/2lReF53F8trkC68piGSfk0JVwWU.jpg", "Craig and Smokey are two guys in Los Angeles hanging out on their porch on a Friday afternoon, smoking and drinking, looking for something to do.", "7.1", ["Comedy"]),
           755 => Movie.new(755, "From Dusk Till Dawn (1996)", "https://image.tmdb.org/t/p/w500/sV3kIAmvJ9tPz4Lq5fuf9LLMxte.jpg", "Seth Gecko and his younger brother Richard are on the run after a bloody bank robbery in Texas. They escape across the border into Mexico and will be home-free the next morning, when they pay off the local kingpin. They just have to survive from dusk till dawn at the rendezvous point, which turns out to be a Hell of a strip joint.", "7.0", ["Action", "Comedy", "Horror", "Thriller"]),
           11859 => Movie.new(11859, "Fair Game (1995)", "https://image.tmdb.org/t/p/w500/qcxsWOzBaF7MZNNThtRQWQ9Wrdk.jpg", "Max Kirkpatrick is a cop who protects Kate McQuean, a civil law attorney, from a renegade KGB team out to terminate her", "4.9", ["Action"]),
           28387 => Movie.new(28387, "Kicking and Screaming (1995)", "https://image.tmdb.org/t/p/w500/186brkmaBmopqcM0dPs71tj9BfM.jpg", "After college graduation, Grovers girlfriend Jane tells him shes moving to Prague to study writing. Grover declines to accompany her, deciding instead to move in with several friends, all of whom cant quite work up the inertia to escape their universitys pull. Nobody wants to make any big decisions that would radically alter his life, yet none of them wants to end up like Chet, the professional student who tends bar and is in his tenth year of university studies.", "6.3", ["Comedy", "Drama"]),
           48750 => Movie.new(48750, "Misérables, Les (1995)", "https://image.tmdb.org/t/p/w500/ct1T56BbeE60CsoFhUB4Qmq8kkf.jpg", "In France during World War II, a poor and illiterate man, Henri Fortin (Jean-Paul Belmondo), is introduced to Victor Hugos classic novel Les Mis�rables and begins to see parallels between the book and his own life.", "7.0", ["Drama", "War"]),
           20927 => Movie.new(20927, "Bed of Roses (1996)", "https://image.tmdb.org/t/p/w500/nLRio5v1QHW0Dw4VLmMhC1FZEJc.jpg", "The seeds of love are planted when Lisa, a high-powered investment banker, receives flowers from a secret admirer. But when his fairy-tale fantasies clash with her workaholic ways, they soon find out that sometimes, its harder than it seems for love to conquer all.", "6.0", ["Drama", "Romance"]),
           36929 => Movie.new(36929, "Big Bully (1996)", "https://image.tmdb.org/t/p/w500/dws3JR4Yi325Tz33XnuXEB6XjGr.jpg", "A writer returns to his hometown where he faces the childhood nemesis whose life he ultimately ruined, only the bully wants to relive their painful past by torturing him once again.", "4.3", ["Comedy", "Drama"]),
           9102 => Movie.new(9102, "Screamers (1995)", "https://image.tmdb.org/t/p/w500/oDGJGbzBkNXhCZfZMR6gjtKkKkI.jpg", "SIRIUS 6B, Year 2078. On a distant mining planet ravaged by a decade of war, scientists have created the perfect weapon: a blade-wielding, self-replicating race of killing devices known as Screamers designed for one purpose only -- to hunt down and destroy all enemy life forms.", "6.2", ["Action", "Sci-Fi", "Thriller"]),
           124626 => Movie.new(124626, "Nico Icon (1995)", "https://image.tmdb.org/t/p/w500/4qO219U8z1XeHLni800jCsbpSs0.jpg", "A look into the many lives of Christa P�ffgen, otherwise known as Nico; from cutie German m�dchen to the first of the supermodels, to glamorous diva of the Velvet Underground, to cult item, junkie and hag. Many faces for the same woman, whom, you realize, just couldnt bring herself to care enough to live.", "7.1", ["Documentary"]),
           27526 => Movie.new(27526, "Crossing Guard, The (1995)", "https://image.tmdb.org/t/p/w500/kogaCIIylHmWQo2gJrrdq8Br8b8.jpg", "After his daughter died in a hit and run, Freddy Gale has waited six years for John Booth, the man responsible, to be released from prison. On the day of release, Gale visits Booth and announces that he will kill him in one week. Booth uses his time to try and make peace with himself and his entourage, and even finds romance. Gale, whose life is spiraling down because of his obsession towards Booth, will bring himself on the very edge of sanity. At he end of the week, both men will find themselves on a collision course with each other.", "6.0", ["Action", "Crime", "Drama", "Thriller"]),
           9623 => Movie.new(9623, "Juror, The (1996)", "https://image.tmdb.org/t/p/w500/i1EXzLNc4c9Xd0xjCmGavb0Hz9k.jpg", 'With his gangster boss on trial for murder, a mob thug known as "the Teacher" tells Annie Laird she must talk her fellow jurors into a not-guilty verdict, implying that hell kill her son Oliver if she fails. She manages to do this, but, when it becomes clear that the mobsters might want to silence her for good, she sends Oliver abroad and tries to gather evidence of the plot against her, setting up a final showdown.', "5.5", ["Drama", "Thriller"]),
           46785 => Movie.new(46785, "White Balloon, The (Badkonake sefid) (1995)", "https://image.tmdb.org/t/p/w500/u6jrlgZZx3zSFPDPTVOYpueljgH.jpg", "Several people try to take advantage of a little girls innocence to hustle money her mom gave to her to buy a goldfish with.", "7.7", ["Children", "Drama"]),
           400 => Movie.new(400, "Things to Do in Denver When Youre Dead (1995)", "https://image.tmdb.org/t/p/w500/oPp6Gbrasox66WyMvPS0k8OakQf.jpg", "Five different criminals face imminent death after botching a job quite badly.", "6.6", ["Crime", "Drama", "Romance"]),
           880 => Movie.new(880, "Antonias Line (Antonia) (1995)", "https://image.tmdb.org/t/p/w500/nUCVi6bBIL7LGC61nYaCqikAhIA.jpg", "After World War II, Antonia and her daughter, Danielle, go back to their Dutch hometown, where Antonias late mother has bestowed a small farm upon her. There, Antonia settles down and joins a tightly-knit but unusual community. Those around her include quirky friend Crooked Finger, would-be suitor Bas and, eventually for Antonia, a granddaughter and great-granddaughter who help create a strong family of empowered women.", "6.9", ["Comedy", "Drama"]),
           146599 => Movie.new(146599, "Once Upon a Time... When We Were Colored (1995)", "https://image.tmdb.org/t/p/w500/45xucuNlia6vEPWYrYu2QlnwgpO.jpg", "This film relates the story of a tightly connected Afro-American community informally called Colored Town where the inhabitants live and depend on each other in a world where racist oppression is everywhere, as told by a boy called Cliff who spent his childhood there. Despite this, we see the life of the community in all its joys and sorrows, of those that live there while others decide to leave for a better life north. For those remaining, things come to a serious situation when one prominent businessman is being muscled out by a white competitor using racist intimidation. In response, the community must make the decision of whether to submit meekly like they always have, or finally fight for their rights.", "5.3", ["Drama", "Romance"]),
           8447 => Movie.new(8447, "Angels and Insects (1995)", "https://image.tmdb.org/t/p/w500/w1i5JdddoLuzSmnKo5ORDoKdMm2.jpg", "In Victorian England, wealthy patriarch Sir Harald Alabaster invites an impoverished biologist, William Adamson, into his home. There, William tries to continue his work, but is distracted by Alabasters seductive daughter, Eugenia. William and Eugenia begin a torrid romance, but as the couple become closer, the young scientist begins to realize that dark, disturbing things are happening behind the closed doors of the Alabaster manor.", "6.6", ["Drama", "Romance"]),
           10534 => Movie.new(10534, "White Squall (1996)", "https://image.tmdb.org/t/p/w500/5xF4qy44Lvv68glS7eHWH7laTqt.jpg", "In 1960, a hardy group of prep school students boards an old-fashioned sailing ship. With Capt. Christopher Sheldon at the helm, the oceangoing voyage is intended to teach the boys fortitude and discipline. But the youthful crew are about to get some unexpected instruction in survival when they get caught in the clutches of a white squall storm.", "6.3", ["Action", "Adventure", "Drama"]),
           17414 => Movie.new(17414, "Dunston Checks In (1996)", "https://image.tmdb.org/t/p/w500/xR2cWC04kWNr7TBeXNOf4uOqn00.jpg", "Hotel manager Robert Grant is forced by his boss to postpone his family vacation when a hotel critic checks in. Trouble is, the critic is really a villainous jewel thief with an orangutan assistant named Dunston. When Dunston gets loose and tries to escape a life of crime -- aided by Roberts sons -- havoc, hijinks and lots of laughs abound!", "5.3", ["Children", "Comedy"]),
           13997 => Movie.new(13997, "Black Sheep (1996)", "https://image.tmdb.org/t/p/w500/bV9SCk4QXCi9p1kdDBiYejcMQwK.jpg", "When dignified Albert Donnelly runs for Governor, his team moves to keep his slow-witted and klutzy younger brother, Mike, out of the eye of the media. To baby-sit Mike, the campaign assigns sarcastic Steve, who gets the experience of a lifetime when he tries to take Mike out of town during the election.", "6.0", ["Comedy"]),
           2086 => Movie.new(2086, "Nick of Time (1995)", "https://image.tmdb.org/t/p/w500/A1FJwUVg84sQSjHVz5jVMXQvifJ.jpg", "An unimpressive, every-day man is forced into a situation where he is told to kill a politician to save his kidnapped daughter.", "6.2", ["Action", "Thriller"]),
           9095 => Movie.new(9095, "Mary Reilly (1996)", "https://image.tmdb.org/t/p/w500/eAOPWQdwytdRaLK3VXi7JFJFqmj.jpg", "A housemaid falls in love with Dr. Jekyll and his darkly mysterious counterpart, Mr. Hyde.", "5.9", ["Drama", "Horror", "Thriller"]),
           12158 => Movie.new(12158, "Vampire in Brooklyn (1995)", "https://image.tmdb.org/t/p/w500/i8ZD5LsBjwF45MsZ1nCClpvaOcn.jpg", "Maximillian, the lone survivor of a race of vampires, comes to Brooklyn in search of a way to live past the next full moon. His ticket to survival is Rita, a NYPD detective who doesnt know shes half vampire -- and Maximillian will do whatevers necessary to put her under his spell.", "5.0", ["Comedy", "Horror", "Romance"]),
           9283 => Movie.new(9283, "Beautiful Girls (1996)", "https://image.tmdb.org/t/p/w500/sHcx1fBmrtZYvFmUywU0d5cvIFd.jpg", "During a snowy winter in the small fictional town of Knights Ridge, Massachusetts, a group of lifelong buddies hang out, drink and struggle to connect with the women who affect their decisions, dreams and desires.", "6.7", ["Comedy", "Drama", "Romance"]),
           9208 => Movie.new(9208, "Broken Arrow (1996)", "https://image.tmdb.org/t/p/w500/iBPMwYYJFvdCBkXrwV75peo5Lz2.jpg", "When rogue stealth-fighter pilot Vic Deakins deliberately drops off the radar while on maneuvers, the Air Force ends up with two stolen nuclear warheads -- and Deakinss co-pilot, Riley Hale, is the militarys only hope for getting them back. Traversing the deserted canyons of Utah, Hale teams with park ranger Terry Carmichael to put Deakins back in his box.", "6.0", ["Action", "Adventure", "Thriller"]),
           40154 => Movie.new(40154, "In the Bleak Midwinter (1995)", "https://image.tmdb.org/t/p/w500/cl5WtKNYL7porHGCroRTAKCGlTM.jpg", "Out of work actor Joe volunteers to help try and save his sisters local church for the community by putting on a Christmas production of Hamlet, somewhat against the advice of his agent Margaretta. As the cast he assembles are still available even at Christmas and are prepared to do it on a profit sharing basis (that is, they may not get paid anything) he cannot expect - and does not get - the cream of the cream. But although they all bring their own problems and foibles along, something bigger starts to emerge in the perhaps aptly named village of Hope.", "7.3", ["Comedy", "Drama"]),
           406 => Movie.new(406, "Hate (Haine, La) (1995)", "https://image.tmdb.org/t/p/w500/bW4tXG8kZ89ZCurPnzDDSzJbeF5.jpg", "After a chaotic night of rioting in a marginal suburb of Paris, three young friends, Vinz, Hubert and Sa�d, wander around unoccupied waiting for news about the state of health of a mutual friend who has been seriously injured when confronting the police.", "8.1", ["Crime", "Drama"]),
           63076 => Movie.new(63076, "Heidi Fleiss: Hollywood Madam (1995)", "https://image.tmdb.org/t/p/w500/laPSb9I8TuYslOh1OcgaTByWKnw.jpg", 'A documentary crew from the BBC arrives in L.A. intent on interviewing Heidi Fleiss, a year after her arrest for running a brothel but before her trial. Several months elapse before the interview, so the crew searches for anyone wholl talk about the young woman. Two people have a lot to say to the camera: a retired madam named Alex for whom Fleiss once worked and Fleisss one-time boyfriend, Ivan Nagy, who introduced her to Alex. Alex and Nagy dont like each other, so the crew shuttles between them with "she said" and "he said." When they finally interview Fleiss, they spend their time reciting what Alex and Nagy have had to say and asking her reaction.', "6.5", ["Documentary"]),
           11062 => Movie.new(11062, "City Hall (1996)", "https://image.tmdb.org/t/p/w500/g6JjdkmdElHIoNVaEso0BmjRDQT.jpg", "The accidental shooting of a boy in New York leads to an investigation by the Deputy Mayor, and unexpectedly far-reaching consequences.", "6.0", ["Drama", "Thriller"]),
           13685 => Movie.new(13685, "Bottle Rocket (1996)", "https://image.tmdb.org/t/p/w500/6E7mJ5wpzTFbYFbJvTzzZ8Til9C.jpg", "Upon his release from a mental hospital following a nervous breakdown, the directionless Anthony joins his friend Dignan, who seems far less sane than the former. Dignan has hatched a hair-brained scheme for an as-yet-unspecified crime spree that somehow involves his former boss, the (supposedly) legendary Mr. Henry.", "6.7", ["Adventure", "Comedy", "Crime", "Romance"]),
           47475 => Movie.new(47475, "Mr. Wrong (1996)", "https://image.tmdb.org/t/p/w500/yGbPzJ5hib2TFi0Rkb6JH8webaL.jpg", "A single and lonely woman finds the seemingly perfect man to date, but soon regrets it when his deranged and possessive other personality emerges and worst still, she cannot convince anyone else of his Jekyll/Hyde true nature.", "3.9", ["Comedy"]),
           2045 => Movie.new(2045, "Unforgettable (1996)", "https://image.tmdb.org/t/p/w500/500Ne3EDn3HHpuCQWwGKR74r0cB.jpg", "Ray Liotta stars as David Krane, a medical examiner who has been acquitted for his wifes murder. Obsessed with finding the real killer, a possible solution presents itself in an experimental serum designed by a neurobiology professor (Linda Fiorentino), which has the ability to transfer memories from one person to another, but with potentially fatal consequences.", "5.6", ["Mystery", "Sci-Fi", "Thriller"]),
           9614 => Movie.new(9614, "Happy Gilmore (1996)", "https://image.tmdb.org/t/p/w500/4RnCeRzvI1xk5tuNWjpDKzSnJDk.jpg", "Failed hockey player-turned-golf whiz Happy Gilmore -- whose unconventional approach and antics on the grass courts the ire of rival Shooter McGavin -- is determined to win a PGA tournament so he can save his grannys house with the prize money. Meanwhile, an attractive tour publicist tries to soften Happys image.", "6.6", ["Comedy"]),
           688 => Movie.new(688, "Bridges of Madison County, The (1995)", "https://image.tmdb.org/t/p/w500/8TfLAfIh5Qxp2J4ZjOafHYhWtDb.jpg", "Photographer Robert Kincaid wanders into the life of housewife Francesca Johnson for four days in the 1960s.", "7.7", ["Drama", "Romance"]),
           11907 => Movie.new(11907, "Nobody Loves Me (Keiner liebt mich) (1994)", "https://image.tmdb.org/t/p/w500/bIUC0c0cnIULgQrExGfoAZgKF5v.jpg", "No overview found.", "6.1", ["Comedy", "Drama"]),
           10874 => Movie.new(10874, "Muppet Treasure Island (1996)", "https://image.tmdb.org/t/p/w500/k4KW2CUkzDKaCy4H4cS02cO8gvV.jpg", "After telling the story of Flints last journey to young Jim Hawkins, Billy Bones has a heart attack and dies just as Jim and his friends are attacked by pirates. The gang escapes into the town where they hire out a boat and crew to find the hidden treasure, which was revealed by Bones before he died. On their voyage across the seas, they soon find out that not everyone on board can be trusted.", "6.6", ["Adventure", "Children", "Comedy", "Musical"]),
           89333 => Movie.new(89333, "Catwalk (1996)", "https://image.tmdb.org/t/p/w500/sQ2dk0qd3rhfT1776GcFnLj4s1U.jpg", "A documentary following Christy Turlington and other models during spring fashion week in Milan, Paris and New York.", "7.4", ["Documentary"]),
           197 => Movie.new(197, "Braveheart (1995)", "https://image.tmdb.org/t/p/w500/or1gBugydmjToAEq7OZY0owwFk.jpg", "Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lords soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.", "7.9", ["Action", "Drama", "War"]),
           103 => Movie.new(103, "Taxi Driver (1976)", "https://image.tmdb.org/t/p/w500/ekstpH614fwDX8DUln1a2Opz0N8.jpg", "A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action, attempting to save a preadolescent prostitute in the process.", "8.2", ["Crime", "Drama", "Thriller"]),
           33542 => Movie.new(33542, "Rumble in the Bronx (Hont faan kui) (1995)", "https://image.tmdb.org/t/p/w500/1nAfchiXHQB3iyhK8fCJJEnNs5A.jpg", "Keong comes from Hong Kong to visit New York for his uncles wedding. His uncle runs a market in the Bronx and Keong offers to help out while Uncle is on his honeymoon. During his stay in the Bronx, Keong befriends a neighbor kid and beats up some neighborhood thugs who cause problems at the market. One of those petty thugs in the local gang stumbles into a criminal situation way over his head.", "6.8", ["Action", "Adventure", "Comedy", "Crime"]),
           43566 => Movie.new(43566, "Before and After (1996)", "https://image.tmdb.org/t/p/w500/oK8UKDrjFS14OFoihaQPfmmMOyI.jpg", "Two parents deal with the effects when their son is accused of murdering his girlfriend.", "6.1", ["Drama", "Mystery"]),
           51352 => Movie.new(51352, "Anne Frank Remembered (1995)", "https://image.tmdb.org/t/p/w500/6nyhzrSGimCbdxiY8DEO7kI7xx4.jpg", "Using previously unreleased archival material in addition to contemporary interviews, this academy award-winning documentary tells the story of the Frank family and presents the first fully-rounded portrait of their brash and free-spirited daughter Anne, perhaps the worlds most famous victim of the Holocaust. Written by Dawn M. Barclift", "7.9", ["Documentary"]),
           16934 => Movie.new(16934, "Young Poisoners Handbook, The (1995)", "https://image.tmdb.org/t/p/w500/d3Lakfy0K1eRHUbay9kMeWdt7y6.jpg", "A sinister tale of genius gone wrong, The Young Poisoners Handbook chronicles a young mans descent into madness against the absurd backdrop of suburban English life. Hugh OConor plays Graham Young, a schoolboy from the London suburbs whose deadly obsession with toxic substances causes him to dabble in experimental murder.", "6.7", ["Crime", "Drama"]),
           10324 => Movie.new(10324, "If Lucy Fell (1996)", "https://image.tmdb.org/t/p/w500/ig5LhLEnlt7QCyYjgui082fO4ih.jpg", "Joe and Lucy are roommates and best friends. Lucy, whose love life is embarrassingly dull, convinces Joe, who is infatuated with a neighbor hes never met, that if they dont have stable romances within a month, they must jump off the Brooklyn Bridge.", "5.2", ["Comedy", "Romance"]),
           78406 => Movie.new(78406, "Steal Big, Steal Little (1995)", "https://image.tmdb.org/t/p/w500/83TvBaWt8wZHUZo8MKwE2cLRBiT.jpg", "Ruben and Robby are twin brothers, adopted by Mona, one of the wealthiest - and most eccentric - women in Santa Barbara. Ruben is devoted to Mona, but Robby is more devoted to her money. So when Mona leaves her fortune and estate to Ruben it starts a battle between brothers that soon leads to madness, mayhem, and even attempted murder. On Rubens side is Lou Perilli an ex-Chicago cop and used car dealer who knows the law - and how to get around it. On Robbys side is ruthless businessman Reed Tyler, who is out to turn a swift profit on Monas property. Walking a shifty line between them is Eddie Agopian, the family lawyer, who doesnt care which side wins as long as hes on the winners side. But whether theyre stealing big or stealing little, theyre all stealing in this hilarious comedy about greed, power... and brotherly love.", "4.4", ["Comedy"]),
           32119 => Movie.new(32119, "Boys of St. Vincent, The (1992)", "https://image.tmdb.org/t/p/w500/3jVid7Zjte2iDTa9I3e4LrRoaD1.jpg", "The true story of boys being sexually abused at their orphanage, run by a religious community in Newfoundland.", "7.3", ["Drama"]),
           11066 => Movie.new(11066, "Boomerang (1992)", "https://image.tmdb.org/t/p/w500/cc9YAZq5NXiIEJsHjW7p2FaHQkp.jpg", "Marcus is a successful advertising executive who woos and beds women almost at will. After a company merger he finds that his new boss, the ravishing Jacqueline, is treating him in exactly the same way. Completely traumatised by this, his work goes badly downhill.", "5.6", ["Comedy", "Romance"]),
           11104 => Movie.new(11104, "Chungking Express (Chung Hing sam lam) (1994)", "https://image.tmdb.org/t/p/w500/43I9DcNoCzpyzK8JCkJYpHqHqGG.jpg", "Two melancholic Hong Kong policemen fall in love: one with a mysterious underworld figure, the other with a beautiful and ethereal server at a late-night restaurant he frequents.", "8.0", ["Drama", "Mystery", "Romance"]),
           2074 => Movie.new(2074, "Flirting With Disaster (1996)", "https://image.tmdb.org/t/p/w500/sRRdVLuxk8OLCDRd4u4xDrDdwv7.jpg", "Adopted as a child, new father Mel Colpin decides he cannot name his son until he knows his birth parents, and determines to make a cross-country quest to find them. Accompanied by his wife, Nancy, and an inept yet gorgeous adoption agent, Tina, he departs on an epic road trip that quickly devolves into a farce of mistaken identities, wrong turns, and overzealous and love-struck ATF agents.", "6.2", ["Comedy"]),
           27793 => Movie.new(27793, "NeverEnding Story III, The (1994)", "https://image.tmdb.org/t/p/w500/o75HHfr23sgeqIeUPwjKY0V9Ppi.jpg", "A young boy must restore order when a group of bullies steal the magical book that acts as a portal between Earth and the imaginary world of Fantasia.", "4.4", ["Adventure", "Children", "Fantasy"]),
           290157 => Movie.new(290157, "Jupiters Wife (1994)", "", "Michel Negroponte, a documentary filmmaker, meets Maggie one day in Central Park. Maggie claims to be married to the god Jupiter and the daughter of actor Robert Ryan. Michel gets to know Maggie over the next couple of years, and attempts to use her often outlandish stories as clues to reconstruct her past.
 - Written by James Meek", "7.2", ["Documentary"]),
           110972 => Movie.new(110972, "Pie in the Sky (1996)", "https://image.tmdb.org/t/p/w500/iZs2BzP1nbrcHCDX3QEHa3Nn0y4.jpg", "Pie in the Sky is a 1996 American romantic comedy film about a young man obsessed with traffic gridlock who falls in love with an avant-garde dancer.", "6.6", ["Comedy", "Romance"]),
           11863 => Movie.new(11863, "Jade (1995)", "https://image.tmdb.org/t/p/w500/lPkDrz6e5DWkKailsx3mIjtq0GF.jpg", "Someone does a nasty hatchet job on a San Francisco big shot and the Assistant D.A. takes charge of the investigation. Through a web of blackmail and prostitution involving the Governor, an old lover of the law man emerges as a prime suspect and he has to deal with his personal feelings as well as the case.", "5.4", ["Thriller"]),
           9101 => Movie.new(9101, "Down Periscope (1996)", "https://image.tmdb.org/t/p/w500/tYdGWz9oncuhqxn5eAK5CpjCiYo.jpg", "Bumbling Navy lieutenant Tom Dodge has been given one last chance to clean up his record. But Admiral Graham, his nemesis, assigns Dodge to the Stingray, a submarine that can barely keep afloat. To add insult to injury, the Stingray is to be the enemy flagship in the upcoming war games � and to make matters even worse, Dodges crew is a band of idiots even more incompetent that he is!", "6.1", ["Comedy"]),
           5757 => Movie.new(5757, "Man of the Year (1995)", "https://image.tmdb.org/t/p/w500/jVO3Gvsdqe5C9Jr7cE1fSOtW2Op.jpg", 'First-time director Dirk Shafer also penned this raucous "mockumentary," a blend of fact and fiction that re-creates his 1992 reign as Playgirl magazines Centerfold of the Year. When Shafer chooses to keep the fact that hes gay a secret from the magazines editors, he finds himself living the ultimate lie -- and incapable of giving female readers what they really want. Will he succumb to his lovers pressures to come out of the closet?', "2.6", ["Documentary"]),
           9302 => Movie.new(9302, "Up Close and Personal (1996)", "https://image.tmdb.org/t/p/w500/2yf1pCiQk6JMy4k5zxf39YXQxGB.jpg", "Tally Atwater has a dream: to be a prime-time network newscaster. She pursues this dream with nothing but ambition, raw talent and a homemade demo tape. Warren Justice is a brilliant, hard edged, veteran newsman. He sees Tally has talent and becomes her mentor. Tally�s career takes a meteoric rise and she and Warren fall in love. The romance that results is as intense and revealing as television news itself. Yet, each breaking story, every videotaped crisis that brings them together, also threatens to drive them apart...", "6.4", ["Drama", "Romance"]),
           11000 => Movie.new(11000, "Birdcage, The (1996)", "https://image.tmdb.org/t/p/w500/bEyK1K1EgWapeKgkcOLC1ejl9nj.jpg", "A gay cabaret owner and his drag queen companion agree to put up a false straight front so that their son can introduce them to his fianc�s conservative moralistic parents.", "7.1", ["Comedy"]),
           16388 => Movie.new(16388, "Brothers McMullen, The (1995)", "https://image.tmdb.org/t/p/w500/6oWsOJP0ed5gs8n2UywcailoxFN.jpg", "Deals with the lives of the three Irish Catholic McMullen brothers from Long Island, New York, over three months, as they grapple with basic ideas and values � love, sex, marriage, religion and family � in the 1990s. Directed, written, produced by and starring Edward Burns.", "6.0", ["Comedy"]),
           9737 => Movie.new(9737, "Bad Boys (1995)", "https://image.tmdb.org/t/p/w500/x1ygBecKHfXX4M2kRhmFKWfWbJc.jpg", "Marcus Burnett is a hen-pecked family man. Mike Lowry is a foot-loose and fancy free ladies man. Both are Miami policemen, and both have 72 hours to reclaim a consignment of drugs stolen from under their stations nose. To complicate matters, in order to get the assistance of the sole witness to a murder, they have to pretend to be each other.", "6.8", ["Action", "Comedy", "Crime", "Drama", "Thriller"]),
           30765 => Movie.new(30765, "Amazing Panda Adventure, The (1995)", "https://image.tmdb.org/t/p/w500/tIK40vCE9i8g4VhyJ3LLr5y1ROJ.jpg", "Far from home in the lush bamboo forests of China, ten-year-old Ryan Tyler, with the help of a young girl, goes on a wonderful journey to rescue a baby panda taken by poachers.", "5.8", ["Adventure", "Children"]),
           10474 => Movie.new(10474, "Basketball Diaries, The (1995)", "https://image.tmdb.org/t/p/w500/AhvO1GGDPIgN0hOqZEgaFCbswMK.jpg", "A high school basketball player�s life turns upside down after free-falling into the harrowing world of drug addiction.", "7.4", ["Drama"]),
           22279 => Movie.new(22279, "Awfully Big Adventure, An (1995)", "https://image.tmdb.org/t/p/w500/tfXBuRBMbyu9IF9KCFz3kXeWQDT.jpg", "Liverpool. 1947. Right after World War II, a star struck naive teenage girl joins a shabby theatre troupe in Liverpool. During a winter production of Peter Pan, the play quickly turns into a dark metaphor for youth as she becomes drawn into a web of sexual politics and intrigue and learns about the grown-up world of the theater", "6.7", ["Drama"]),
           30157 => Movie.new(30157, "Amateur (1994)", "https://image.tmdb.org/t/p/w500/b9MEES9I2WNjEWULdKsqiHIGQlC.jpg", "A man wakes up in an alley, bleeding and with no memory of who he is. He stumbles into a coffee shop and is befriended by a charitable ex-nun who is failing in her attempts to write marketable pornography.", "6.7", ["Crime", "Drama", "Thriller"]),
           568 => Movie.new(568, "Apollo 13 (1995)", "https://image.tmdb.org/t/p/w500/oYUZHYMwNKnE1ef4WE5Hw2a9OAY.jpg", "The true story of technical troubles that scuttle the Apollo 13 lunar mission in 1970, risking the lives of astronaut Jim Lovell and his crew, with the failed journey turning into a thrilling saga of heroism. Drifting more than 200,000 miles from Earth, the astronauts work furiously with the ground crew to avert tragedy.", "7.4", ["Adventure", "Drama", "IMAX"]),
           11780 => Movie.new(11780, "Rob Roy (1995)", "https://image.tmdb.org/t/p/w500/4QuypgbNYmPECAAHnV3QY8qEpOz.jpg", "In the highlands of Scotland in the 1700s, Rob Roy tries to lead his small town to a better future, by borrowing money from the local nobility to buy cattle to herd to market. When the money is stolen, Rob is forced into a Robin Hood lifestyle to defend his family and honour.", "6.7", ["Action", "Drama", "Romance", "War"]),
           34996 => Movie.new(34996, "Addiction, The (1995)", "https://image.tmdb.org/t/p/w500/1Yy8H2tKQ16mffLFRfxcBHKBdyF.jpg", "A vampiric doctoral student tries to follow the philosophy of a nocturnal comrade and control her thirst for blood.", "6.5", ["Drama", "Horror"]),
           414 => Movie.new(414, "Batman Forever (1995)", "https://image.tmdb.org/t/p/w500/klm0mzHyOdYrLKXoRKD0ODCdvDG.jpg", "Batman must battle a disfigured district attorney and a disgruntled former employee with help from an amorous psychologist and a young circus acrobat.", "5.4", ["Action", "Adventure", "Comedy", "Crime"]),
           649 => Movie.new(649, "Beauty of the Day (Belle de jour) (1967)", "https://image.tmdb.org/t/p/w500/iUAFECovwPA0cVV9bo4uNGLJSGL.jpg", "Beautiful young housewife S�verine Serizy cannot reconcile her masochistic fantasies with her everyday life alongside dutiful husband Pierre. When her lovestruck friend Henri mentions a secretive high-class brothel run by Madame Anais, S�verine begins to work there during the day under the name Belle de Jour. But when one of her clients grows possessive, she must try to go back to her normal life.", "7.4", ["Drama"]),
           1873 => Movie.new(1873, "Beyond Rangoon (1995)", "https://image.tmdb.org/t/p/w500/xTiy5kSP3Hetig7xB4E8INq5ron.jpg", "Dr. Laura Bowman is a young widow whos unwittingly drawn into political turmoil while vacationing in Burma in the late 1980s. Bowman initially left San Francisco with her sister in an attempt to escape painful memories of her husband and sons violent deaths. But her fight to escape to Thailand could prove just as harrowing.", "6.7", ["Adventure", "Drama", "War"]),
           5894 => Movie.new(5894, "Blue in the Face (1995)", "https://image.tmdb.org/t/p/w500/yBFNJA95MNiasdNUPCU6otdtJE8.jpg", "Auggie runs a small tobacco shop in Brooklyn, New York. The whole neighborhood comes to visit him to buy cigarettes and have some small talk. During the movie Lou Reed tries to explain why he has to have a cut on his health insurance bill if he keeps smoking and Madonna acts as a Singing Telegram.", "6.6", ["Comedy", "Drama"]),
           1775 => Movie.new(1775, "Canadian Bacon (1995)", "https://image.tmdb.org/t/p/w500/bzK2aQ8xUB67kwCR5LHTSY99HtT.jpg", "The U.S. President, low in the opinion polls, gets talked into raising his popularity by trying to start a cold war with Canada.", "5.8", ["Comedy", "War"]),
           8839 => Movie.new(8839, "Casper (1995)", "https://image.tmdb.org/t/p/w500/2ah8fNJFZVU3vcXhU5xfAYi2eym.jpg", "Casper is a kind young ghost who peacefully haunts a mansion in Maine. When specialist James Harvey arrives to communicate with Casper and his fellow spirits, he brings along his teenage daughter, Kat. Casper quickly falls in love with Kat, but their budding relationship is complicated not only by his transparent state, but also by his troublemaking apparition uncles and their mischievous antics.", "6.3", ["Adventure", "Children"]),
           20649 => Movie.new(20649, "Clockers (1995)", "https://image.tmdb.org/t/p/w500/c79uqLJleho2a7OQayfrW5Ypphf.jpg", "Strike is a young city drug pusher under the tutelage of drug lord Rodney Little. When a night manager at a fast-food restaurant is found with four bullets in his body, Strike�s older brother turns himself in as the killer. Det. Rocco Klein doesn�t buy the story, however, setting out to find the truth, and it seems that all the fingers point toward Strike & Rodney.", "6.9", ["Crime", "Drama", "Mystery"]),
           10329 => Movie.new(10329, "Congo (1995)", "https://image.tmdb.org/t/p/w500/9mqMitlulCpsttWr2fVzXFlbPKm.jpg", "Eight people embark on an expedition into the Congo, a mysterious expanse of unexplored Africa where human greed and the laws of nature have gone berserk. When the thrill-seekers -- some with ulterior motives -- stumble across a race of killer apes.", "5.5", ["Action", "Adventure", "Mystery", "Sci-Fi"]),
           8963 => Movie.new(8963, "Crimson Tide (1995)", "https://image.tmdb.org/t/p/w500/21nqRJ6ofEgVvEl68J4O9V26Xzy.jpg", "On a US nuclear missile sub, a young first officer stages a mutiny to prevent his trigger happy captain from launching his missiles before confirming his orders to do so.", "7.2", ["Drama", "Thriller", "War"]),
           26564 => Movie.new(26564, "Crumb (1994)", "https://image.tmdb.org/t/p/w500/oJWGWzaYdYG4mkQK6sbus5Tenho.jpg", "This movie chronicles the life and times of R. Crumb. Robert Crumb is the cartoonist/artist who drew Keep On Truckin, Fritz the Cat, and played a major pioneering role in the genesis of underground comix. Through interviews with his mother, two brothers, wife, and ex-girlfriends, as well as selections from his vast quantity of graphic art, we are treated to a darkly comic ride through one mans subconscious mind.", "7.6", ["Documentary"]),
           8068 => Movie.new(8068, "Desperado (1995)", "https://image.tmdb.org/t/p/w500/e3gwpBeXpvGZsxUya9zNym5QXrw.jpg", "Mariachi plunges headfirst into the dark border underworld when he follows a trail of blood to the last of the infamous Mexican drug lords, Bucho, for an action-packed, bullet-riddled showdown. With the help of his best friend and a beautiful bookstore owner, the Mariachi tracks Bucho, takes on his army of desperados, and leaves a trail of blood of his own.", "6.9", ["Action", "Romance", "Western"]),
           8512 => Movie.new(8512, "Devil in a Blue Dress (1995)", "https://image.tmdb.org/t/p/w500/v6WdensY8fijpPwBqLeX0B3llzJ.jpg", "In late 1940s Los Angeles, Easy Rawlins is an unemployed black World War II veteran with few job prospects. At a bar, Easy meets DeWitt Albright, a mysterious white man looking for someone to investigate the disappearance of a missing white woman named Daphne Monet, who he suspects is hiding out in one of the citys black jazz clubs. Strapped for money and facing house payments, Easy takes the job, but soon finds himself in over his head.", "6.3", ["Crime", "Film-Noir", "Mystery", "Thriller"]),
           1572 => Movie.new(1572, "Die Hard: With a Vengeance (1995)", "https://image.tmdb.org/t/p/w500/amwo4CjYKynZ2yKvKMxoiRSsaE1.jpg", 'New York detective John McClane is back and kicking bad-guy butt in the third installment of this action-packed series, which finds him teaming with civilian Zeus Carver to prevent the loss of innocent lives. McClane thought hed seen it all, until a genius named Simon engages McClane, his new "partner" -- and his beloved city -- in a deadly game that demands their concentration.', "7.2", ["Action", "Crime", "Thriller"]),
           13552 => Movie.new(13552, "Doom Generation, The (1995)", "https://image.tmdb.org/t/p/w500/mcISIatRSaP30WZQh1G4ZqLVWQA.jpg", "Jordan White and Amy Blue, two troubled teens, pick up an adolescent drifter, Xavier Red. Together, the threesome embarks on a sex and violence-filled journey through an United States of psychos and quickie marts.", "6.3", ["Comedy", "Crime", "Drama"]),
           6520 => Movie.new(6520, "First Knight (1995)", "https://image.tmdb.org/t/p/w500/xuXkCcrvUTkehVXuTGpnfySsx0Z.jpg", "The timeless tale of King Arthur and the legend of Camelot are retold in this passionate period drama. Arthur is reluctant to hand the crown to Lancelot, and Guinevere is torn between her loyalty to her husband and her growing love for his rival. But Lancelot must balance his loyalty to the throne with the rewards of true love.", "6.0", ["Action", "Drama", "Romance"]),
           9073 => Movie.new(9073, "Free Willy 2: The Adventure Home (1995)", "https://image.tmdb.org/t/p/w500/3wpug3W5rYBdqeAnhc1UeXLE5ZF.jpg", "Jesse becomes reunited with Willy three years after the whales jump to freedom as the teenager tries to rescue the killer whale and other orcas from an oil spill.", "5.9", ["Adventure", "Children", "Drama"]),
           10428 => Movie.new(10428, "Hackers (1995)", "https://image.tmdb.org/t/p/w500/qfx2EENW1sOpKNVKLzr7VOhlxkt.jpg", "Along with his new friends, a teenager who was arrested by the US Secret Service and banned from using a computer for writing a computer virus discovers a plot by a nefarious hacker, but they must use their computer skills to find the evidence while being pursued by the Secret Service and the evil computer genius behind the virus.", "6.3", ["Action", "Adventure", "Crime", "Thriller"]),
           17447 => Movie.new(17447, "Jeffrey (1995)", "https://image.tmdb.org/t/p/w500/tHcKImp3QqG7UWdv3PzEHZX8oHT.jpg", "Jeffrey, a gay man living in New York City with an overwhelming fear of contracting AIDS, concludes that being celibate is the only option to protect himself. As fate would have it, shortly after his declaration of a sex-free existence, he meets the handsome Steve Howard, his dream man -- except for his HIV-positive status. Facing this dilemma, Jeffrey turns to his best friend and an outrageous priest for guidance.", "6.8", ["Comedy", "Drama"]),
           9886 => Movie.new(9886, "Johnny Mnemonic (1995)", "https://image.tmdb.org/t/p/w500/iH8Jgi8qvb7pnBfI8fVGaUbyRna.jpg", "In a dystopian 2021, Johnny is a data trafficker who has an implant that allows him to securely store data too sensitive for regular computer networks. On one delivery run, he accepts a package that not only exceeds the implants safety limits�and will kill him if the data is not removed in time�but also contains information far more important and valuable than he had ever imagined. On a race against time, he must avoid the assassins sent to kill him and remove the data before it, too, ends his life.", "5.7", ["Action", "Sci-Fi", "Thriller"]),
           9482 => Movie.new(9482, "Judge Dredd (1995)", "https://image.tmdb.org/t/p/w500/aja6BILb8Efe4eJksiPs5pHd5ai.jpg", "In a dystopian future, Dredd, the most famous judge (a cop with instant field judiciary powers) is convicted for a crime he did not commit while his murderous counterpart escapes.", "5.7", ["Action", "Crime", "Sci-Fi"]),
           19326 => Movie.new(19326, "Jury Duty (1995)", "https://image.tmdb.org/t/p/w500/DbKQDPqBE4kCaePj4CHu6r3ZAb.jpg", "When jobless Tommy Collins discovers that sequestered jurors earn free room and board as well as $5-a-day, he gets himself assigned to a jury in a murder trial. Once there, he does everything he can to prolong the trial and deliberations and make the sequestration more comfortable for himself.", "4.5", ["Comedy"]),
           9344 => Movie.new(9344, "Kids (1995)", "https://image.tmdb.org/t/p/w500/8qV8hUVCUnFIQKewzlhaFWhdszK.jpg", 'Telly makes it his goal to have sex with as many different girls as he can. Jenny, a girl who has had sex only once, with Telly, tests positive for HIV. When Jenny discovers that Tellys idea of "safe sex" is to only have sex with virgins, and is continuing to pass the disease onto other unsuspecting girls, Jenny makes it her business to try to stop him.', "6.9", ["Drama"]),
           9071 => Movie.new(9071, "Living in Oblivion (1995)", "https://image.tmdb.org/t/p/w500/b54xDk98oWtEtAso9sj1wjaZDDH.jpg", "Nick is the director of a low-budget indie film. He tries to keep everything together as his production is plagued with an insecure actress, a megalomaniac star, a pretentious, beret-wearing director of photography, and lousy catering.", "7.2", ["Comedy"]),
           8973 => Movie.new(8973, "Lord of Illusions (1995)", "https://image.tmdb.org/t/p/w500/miQREwapDUNwfInokjeVLt8BiNM.jpg", "During a routine case in L.A., NY private investigator Harry DAmour stumbles over members of a fanatic cult who are preparing for the resurrection of their leader Nix, a powerful magician who was killed 13 years earlier.", "6.0", ["Horror"]),
           15730 => Movie.new(15730, "Love & Human Remains (1993)", "https://image.tmdb.org/t/p/w500/bSv099xlLVjvccWtTbevJafHgrs.jpg", "Dreary urban landscape of an anonymous Canadian city. Dark comedy about a group of twentysomethings looking for love and meaning in the 90s. The film focuses on roommates David, a gay waiter who has has given up on his acting career, and Candy, a book reviewer who is also Davids ex-lover. David and Candys lives are entangled with those of Davids friends and Candys dates.", "5.8", ["Comedy", "Drama"]),
           47608 => Movie.new(47608, "Mad Love (1995)", "https://image.tmdb.org/t/p/w500/glhctWoYw1jg8z0FUSwFD4UTNi4.jpg", 'Matt falls for Casey, the new girl in school. Shes fun-loving and eccentric, but theres a darkness to her whimsy that Matt cant begin to comprehend. When Casey attempts to commit suicide, her parents place her in a mental institution. Matt springs her out, and together the young lovers head on a road trip. They believe their love can "cure" Caseys problems. Matt starts to wonder, though, if are they inspired or misguided.', "5.3", ["Drama", "Romance"]),
           2293 => Movie.new(2293, "Mallrats (1995)", "https://image.tmdb.org/t/p/w500/q5xdLX9qZmKgrKFIjVsaTlfVQbC.jpg", "Both dumped by their girlfriends, two best friends seek refuge in the local mall.", "6.8", ["Comedy", "Romance"]),
           9070 => Movie.new(9070, "Mighty Morphin Power Rangers: The Movie (1995)", "https://image.tmdb.org/t/p/w500/h18blchYYeoAfQHsEMGYUNbht0C.jpg", "Power up with six incredible teens who out-maneuver and defeat evil everywhere as the Mighty Morphin Power Ranger, But this time the Power Rangers may have met their match, when they face off with the most sinister monster the galaxy has ever seen.", "5.8", ["Action", "Children"]),
           48787 => Movie.new(48787, "Mute Witness (1994)", "https://image.tmdb.org/t/p/w500/iINFao9V9XLytpPfLorhjU2V9mb.jpg", "Billy is mute, but it hasnt kept her from becoming a successful makeup artist. While in Russia, working on a film directed by her sisters boyfriend, Andy, Billy finds herself trapped in the studio one night and is horrified to see a snuff film being made. Billy escapes and, with the help of her sister, Kate, alerts authorities about what she saw. Unfortunately, in doing so, she makes an enemy of the Russian mafia, who funded the snuff film.", "6.4", ["Comedy", "Horror", "Thriller"]),
           34574 => Movie.new(34574, "Nadja (1994)", "https://image.tmdb.org/t/p/w500/sIZl6Oy5nn4kHKHamX50tSPF4Ob.jpg", "This ultra-hip, post-modern vampire tale is set in contemporary New York City. Members of a dysfunctional family of vampires are trying to come to terms with each other, in the wake of their fathers death. Meanwhile, they are being hunted by Dr. Van Helsing and his hapless nephew. As in all good vampire movies, forces of love are pitted against forces of destruction.", "5.5", ["Drama"]),
           1642 => Movie.new(1642, "Net, The (1995)", "https://image.tmdb.org/t/p/w500/dtupntUFMD5iXBo8HLfALt2ET4R.jpg", "Angela Bennett is a freelance software engineer who lives in a world of computer technology. When a cyber friend asks Bennett to debug a new game, she inadvertently becomes involved in a conspiracy that will soon turn her life upside down and make her the target of an assassination.", "5.9", ["Action", "Crime", "Thriller"]),
           11472 => Movie.new(11472, "Nine Months (1995)", "https://image.tmdb.org/t/p/w500/z1nzYuoeTbGBrSicDxJEhJhEQz8.jpg", "When he finds out his longtime girlfriend is pregnant, a commitment-phobe realizes he might have to change his lifestyle for better or much, much worse.", "5.7", ["Comedy", "Romance"]),
           36196 => Movie.new(36196, "Party Girl (1995)", "https://image.tmdb.org/t/p/w500/cfGEUftQVjvJHTTc3OKbzfsBamT.jpg", "Although Mary has little income, she still finds ways to spend her nights at clubs. After being arrested for throwing an illegal rave, she asks her aunt Judy for bail money. Judy then finds Mary a job at her library so that Mary can repay her. Initially, Mary finds the job as a clerk boring and stifling, and prefers to get to know a street food vendor whom she likes. However, Mary must refocus her life once she loses her job and apartment.", "6.2", ["Comedy"]),
           11980 => Movie.new(11980, "Prophecy, The (1995)", "https://image.tmdb.org/t/p/w500/4ZWFhQipzBHJze2llzCzhrSIZsn.jpg", "The angel Gabriel comes to Earth to collect a soul which will end the stalemated war in Heaven, and only a former priest and a little girl can stop him.", "6.5", ["Fantasy", "Horror", "Mystery"]),
           58372 => Movie.new(58372, "Reckless (1995)", "https://image.tmdb.org/t/p/w500/edNTtl2UuKcU8vXEaYgu76vISXw.jpg", "On Christmas Eve, a relentlessly cheerful woman escapes from the killers hired by her husband, and embarks on a series of strange encounters.", "8.0", ["Comedy", "Fantasy"]),
           32646 => Movie.new(32646, "Safe (1995)", "https://image.tmdb.org/t/p/w500/2O71QsBkbqdLqQdx2yuNpJ4pFPq.jpg", 'Carol, a typical upper middle-class housewife, begins to complain of vague symptoms of illness. She "doesnt feel right," has unexplained headaches, congestion, a dry cough, nosebleeds, vomiting, and trouble breathing. Her family doctor treats her concerns dismissively and suggests a psychiatrist. Eventually, an allergist tells her that she has Environmental Illness.', "7.0", ["Thriller"]),
           10533 => Movie.new(10533, "Scarlet Letter, The (1995)", "https://image.tmdb.org/t/p/w500/8gIU7O3oV6NyWUjlL6ppbpnIZLW.jpg", 'Set in puritanical Boston in the mid 1600s, the story of seamstress Hester Prynne, who is outcast after she becomes pregnant by a respected reverend. She refuses to divulge the name of the father, is "convicted" of adultery and forced to wear a scarlet "A" until an Indian attack unites the Puritans and leads to a reevaluation of their laws and morals.', "6.0", ["Drama", "Romance"]),
           10802 => Movie.new(10802, "Showgirls (1995)", "https://image.tmdb.org/t/p/w500/wIHiWN7kCELUZzbCMpMcxNC8HlS.jpg", "A young drifter named Nomi arrives in Las Vegas to become a dancer and soon sets about clawing and pushing her way to become a top showgirl.", "5.5", ["Drama"]),
           10149 => Movie.new(10149, "Smoke (1995)", "https://image.tmdb.org/t/p/w500/phvnN7OPEnlHoAZe8nsSqPDD8B0.jpg", "Writer Paul Benjamin is nearly hit by a bus when he leaves Auggie Wrens smoke shop. Stranger Rashid Cole  saves his life, and soon middle-aged Paul tells homeless Rashid that he wouldnt mind a short-term housemate. Still grieving over his wifes murder, Paul is moved by both Rashids quest to reconnect with his father and Auggies discovery that a woman who might be his daughter is about to give birth.", "7.2", ["Comedy", "Drama"]),
           18402 => Movie.new(18402, "Something to Talk About (1995)", "https://image.tmdb.org/t/p/w500/a52KpsmvLNdTdmDzw1fUrJONpfH.jpg", "Grace Bichon, who is managing her fathers riding-stable, discovers that her husband Eddie is deceiving her with another woman. After confronting him in the middle of the night on the streets of their small home town, she decides to stay at her sister Emma Raes house for a while to make up her mind. Breaking out of her everyday life, she starts to question the authority of everyone.", "5.6", ["Comedy", "Drama", "Romance"]),
           9348 => Movie.new(9348, "Species (1995)", "https://image.tmdb.org/t/p/w500/yEAEULEn5rraRIpymMACticTfBD.jpg", "In 1993, the Search for Extra Terrestrial Intelligence Project receives a transmission detailing an alien DNA structure, along with instructions on how to splice it with human DNA. The result is Sil, a sensual but deadly creature who can change from a beautiful woman to an armour-plated killing machine in the blink of an eye.", "5.9", ["Horror", "Sci-Fi"]),
           281 => Movie.new(281, "Strange Days (1995)", "https://image.tmdb.org/t/p/w500/rY5BrDRcYAKE0BYmmT66YG6Uy5Q.jpg", "Set in the year 1999 during the last days of the old millennium, the movie tells the story of Lenny Nero, an ex-cop who now deals with data-discs containing recorded memories and emotions. One day he receives a disc which contains the memories of a murderer killing a prostitute. Lenny investigates and is pulled deeper and deeper in a whirl of blackmail, murder and rape. Will he survive and solve the case?", "7.0", ["Action", "Crime", "Drama", "Mystery", "Sci-Fi", "Thriller"]),
           5967 => Movie.new(5967, "Umbrellas of Cherbourg, The (Parapluies de Cherbourg, Les) (1964)", "https://image.tmdb.org/t/p/w500/jgB88XoKb3uOPPvGKNuE9wuaxDE.jpg", "This simple romantic tragedy begins in 1957. Guy Foucher, a 20-year-old French auto mechanic, has fallen in love with 17-year-old Genevi�ve Emery, an employee in her widowed mothers chic but financially embattled umbrella shop. On the evening before Guy is to leave for a two-year tour of combat in Algeria, he and Genevi�ve make love. She becomes pregnant and must choose between waiting for Guys return or accepting an offer of marriage from a wealthy diamond merchant.", "7.4", ["Drama", "Musical", "Romance"]),
           47939 => Movie.new(47939, "Three Wishes (1995)", "https://image.tmdb.org/t/p/w500/5RjnorXfyCXPj6fnuXgdcFrb4gv.jpg", "While Jane Holman is driving with her two sons, she accidentally runs into a drifter, Jack McCloud, who breaks his leg. Being responsible, Jane invites Jack, and his dog, to stay at her home until his leg has healed. Jack struggles to adapt their lifestyle, and finds himself loved by the family.", "6.1", ["Drama", "Fantasy"]),
           36834 => Movie.new(36834, "Total Eclipse (1995)", "https://image.tmdb.org/t/p/w500/e0j1zDF3ITeTbGTXFGamosCxT4z.jpg", "Young, wild poet Arthur Rimbaud and his mentor Paul Verlaine engage in a fierce, forbidden romance while feeling the effects of a hellish artistic lifestyle.", "6.4", ["Drama", "Romance"]),
           9090 => Movie.new(9090, "To Wong Foo, Thanks for Everything! Julie Newmar (1995)", "https://image.tmdb.org/t/p/w500/8bkJiI6N8wDxAtQ49bLUt0qCBII.jpg", "Three New York drag queens on their way to Hollywood for a beauty pageant get stranded in a small Midwestern town for the entire weekend when their car breaks down. While waiting for parts for their Cadillac convertible, the flamboyant trio shows the local homophobic rednecks that appearing different doesnt mean they dont have humanity in common.", "7.3", ["Comedy"]),
           3512 => Movie.new(3512, "Under Siege 2: Dark Territory (1995)", "https://image.tmdb.org/t/p/w500/gElwFCQTbSK5hdK0PVyia547nst.jpg", "A passenger train has been hijacked by an electronics expert and turned into an untraceable command center for a weapons satellite. He has planned to blow up Washington DC and only one man can stop him, former Navy SEAL Casey Ryback.", "5.8", ["Action"]),
           52856 => Movie.new(52856, "Unstrung Heroes (1995)", "https://image.tmdb.org/t/p/w500/cFgF5so3GFsOg2HzrEXMZxLohHK.jpg", "Steven Lidz, unhappy with his home life since his mother became sick, moves in with his two eccentric uncles. As Steven grows closer to his uncles, he learns how to cope with his emotions and to value his own uniqueness.", "5.9", ["Comedy", "Drama"]),
           77350 => Movie.new(77350, "Unzipped (1995)", "https://image.tmdb.org/t/p/w500/dnIzv4rXr9FXkqW880E3rStYQA7.jpg", "Isaac Mizrahi, one of the most successful designers in high fashion, plans his fall 1994 collection.", "5.6", ["Documentary"]),
           9560 => Movie.new(9560, "Walk in the Clouds, A (1995)", "https://image.tmdb.org/t/p/w500/xencQzZnUWDRAOUydjf9PWet8Ae.jpg", "World War II vet Paul Sutton falls for a pregnant and unwed woman who persuades him -- during their first encounter -- to pose as her husband so she can face her family.", "7.2", ["Drama", "Romance"]),
           9804 => Movie.new(9804, "Waterworld (1995)", "https://image.tmdb.org/t/p/w500/f4Q6BKm1lv9u5xoffbIIwrOYf6z.jpg", "In a futuristic world where the polar ice caps have melted and made Earth a liquid planet, a beautiful barmaid rescues a mutant seafarer from a floating island prison. They escape, along with her young charge, Enola, and sail off aboard his ship.", "6.1", ["Action", "Adventure", "Sci-Fi"]),
           31611 => Movie.new(31611, "White Mans Burden (1995)", "https://image.tmdb.org/t/p/w500/pIgCFucYI0YvnMR35zV12YY0NHc.jpg", "The story takes place in alternative America where the blacks are members of social elite, and whites are inhabitants of inner city ghettos. Louis Pinnock is a white worker in a chocolate factory, loving husband and father of two children. While delivering a package for black CEO Thaddeus Thomas, he is mistaken for a voyeur and, as a result, loses his job, gets beaten by black cops and his family gets evicted from their home. Desperate Pinnock takes a gun and kidnaps Thomas, demanding justice.", "5.1", ["Drama"]),
           65796 => Movie.new(65796, "Wild Bill (1995)", "https://image.tmdb.org/t/p/w500/g5sQTDwc4BcvRCBAhnujhBPIEO1.jpg", "Biopic about famous gunslinger Wild Bill Hickock. The early career of legendary lawman is telescoped and culminates in his relocation in Deadwood and a reunion with Calamity Jane.", "5.8", ["Western"]),
           49805 => Movie.new(49805, "Browning Version, The (1994)", "https://image.tmdb.org/t/p/w500/8My9Wnzu1zasVVzGdDj5y2dItuM.jpg", "Andrew Crocker-Harris is an embittered and disliked teacher of Greek and Latin at a British prep school. After nearly 20 years of service, he is being forced to retire for health reasons, and perhaps may not even be given a pension. The boys regard him as a Hitler, with some justification. His unfaithful wife Laura tries to hurt him in any way she can. Andrew must come to terms with his failed life and at least regain his own self-esteem.", "6.3", ["Drama"]),
           26258 => Movie.new(26258, "Bushwhacked (1995)", "https://image.tmdb.org/t/p/w500/j3H0POtvl0Tt4Meesvp7HX6JxAv.jpg", "A inept courier realises he has been used by criminals to deliver money. On the run from both the criminals and police, he poses as a Scout leader and leads a scout group on a hike through the mountains.", "5.3", ["Adventure", "Comedy", "Crime", "Mystery"]),
           50797 => Movie.new(50797, "Burnt by the Sun (Utomlyonnye solntsem) (1994)", "https://image.tmdb.org/t/p/w500/4zsq30Zj9iAeqejEkkmclL7VnwV.jpg", "Russia, 1936: revolutionary hero Colonel Kotov is spending an idyllic summer in his dacha with his young wife and six-year-old daughter Nadia and other assorted family and friends. Things change dramatically with the unheralded arrival of Cousin Dmitri from Moscow, who charms the women and little Nadia with his games and pianistic bravura. But Kotov isnt fooled: this is the time of Stalins repression, with telephone calls in the middle of the night spelling doom - and he knows that Dmitri isnt paying a social call...", "7.1", ["Drama"]),
           19155 => Movie.new(19155, "Before the Rain (Pred dozhdot) (1994)", "https://image.tmdb.org/t/p/w500/e3oPylXb2nnoE5fVLaehi1Jaxsa.jpg", "The circularity of violence seen in a story that circles on itself. In Macedonia, during war in Bosnia, Christians hunt an ethnic Albanian girl who may have murdered one of their own. A young monk whos taken a vow of silence offers her protection. In London, a photographic editor whos pregnant needs to talk it out with her estranged husband and chooses a toney restaurant.", "7.4", ["Drama", "War"]),
           76 => Movie.new(76, "Before Sunrise (1995)", "https://image.tmdb.org/t/p/w500/khKJwHxgXSpDl3iKGJ5S15I8ABI.jpg", "On his way to Vienna, American Jesse meets C�line, a student returning to Paris. After long conversations forge a surprising connection between them, Jesse convinces Celine to get off the train with him in Vienna. Since his flight to the U.S. departs the next morning and he has no money for lodging, they wander the city together, taking in the experiences of Vienna and each other.", "7.9", ["Drama", "Romance"]),
           11017 => Movie.new(11017, "Billy Madison (1995)", "https://image.tmdb.org/t/p/w500/1XV42Zu9taxluIKXMeV9OSpYCSq.jpg", "Billy Madison is the 27 year-old son of Bryan Madison, a very rich man who has made his living in the hotel industry. Billy stands to inherit his fathers empire, but only if he can make it through all 12 grades, 2 weeks per grade, to prove that he has what it takes to run the family business.", "6.2", ["Comedy"]),
           37141 => Movie.new(37141, "Babysitter, The (1995)", "https://image.tmdb.org/t/p/w500/wOv6HKiKTcDiyZRXPOsjm2JhVZV.jpg", "Jennifer (Alicia Silverstone) is a lovely teen who has been hired to baby-sit the kids of Harry Tucker (J.T. Walsh) and his wife, Dolly (Lee Garlington). The Tuckers go to a party and proceed to get inebriated, with Mr. Tucker fantasizing about his beautiful baby sitter. Meanwhile, Jack (Jeremy London), her boyfriend, and Mark (Nicky Katt), another guy interested in her, decide to spy on Jennifer at the Tucker house, with each young man also fixated on her.", "5.2", ["Drama", "Thriller"]),
           9382 => Movie.new(9382, "Boys on the Side (1995)", "https://image.tmdb.org/t/p/w500/2dhZnfBjiza5TupvOupRU4hFAcJ.jpg", "After breaking up with her girlfriend, a nightclub singer, Jane, answers a personal ad from Robin, a real estate agent with AIDS, seeking a cross-country travel partner. On their journey from New York City to Los Angeles, the two stop by Pittsburgh to pick up Robins friend Holly, who is trying to escape an abusive relationship. With three distinct personalities, the women must overcome their differences to help one another.", "6.3", ["Comedy", "Drama"]),
           6715 => Movie.new(6715, "Cure, The (1995)", "https://image.tmdb.org/t/p/w500/3WN1H5NzLOjhY9AP848v8WPc9uu.jpg", "Erik, a loner, finds a friend in Dexter, an eleven-year-old boy with AIDS. They vow to find a cure for AIDS together and save Dexters life in an eventful summer.", "7.9", ["Drama"]),
           18256 => Movie.new(18256, "Castle Freak (1995)", "https://image.tmdb.org/t/p/w500/rZv3aUkNngyZeiCgAjOEF5n0tve.jpg", "John has inherited a castle in Italy and he moves there with his wife Susan and their blind daughter Rebecca. What they dont realize is that there is somebody else in the castle--an abused child left to die in the basement who has now become the castle freak and is out to wreak havoc.", "6.3", ["Horror"]),
           22625 => Movie.new(22625, "Circle of Friends (1995)", "https://image.tmdb.org/t/p/w500/dmyEriE6TsnbgkNaFOvCcXaF0Nt.jpg", "Three girlhood friends now at college share first loves, first kisses and first betrayals. At the center of it all is the best-looking boy on campus. Can a self-conscious dreamer hook the biggest fish in the pond?", "6.5", ["Drama", "Romance"]),
           2292 => Movie.new(2292, "Clerks (1994)", "https://image.tmdb.org/t/p/w500/zeFhNF0SXlYIvWXpaOLuXVQ3jB4.jpg", "Convenience and video store clerks Dante and Randal are sharp-witted, potty-mouthed and bored out of their minds. So in between needling customers, the counter jockeys play hockey on the roof, visit a funeral home and deal with their love lives.", "7.4", ["Comedy"]),
           1909 => Movie.new(1909, "Don Juan DeMarco (1995)", "https://image.tmdb.org/t/p/w500/fe0TuYz9jCKUba2Omj48K8bWJ8z.jpg", "John Arnold DeMarco is a man who believes he is Don Juan, the greatest lover in the world. Clad in a cape and mask, DeMarco undergoes psychiatric treatment with Dr. Jack Mickler to cure him of his apparent delusion. But the psychiatric sessions have an unexpected effect on the psychiatric staff and, most profoundly, Dr Mickler, who rekindles the romance in his complacent marriage.", "6.6", ["Comedy", "Drama", "Romance"]),
           8984 => Movie.new(8984, "Disclosure (1994)", "https://image.tmdb.org/t/p/w500/dnA4QkIZZCF9wRtF8HHxWwUXVMf.jpg", "A computer specialist is sued for sexual harassment by a former lover turned boss who initiated the act forcefully, which threatens both his career and his personal life.", "6.2", ["Drama", "Thriller"]),
           4954 => Movie.new(4954, "Drop Zone (1994)", "https://image.tmdb.org/t/p/w500/bbveyfmq6pGrzKL0l4waeA2WHHp.jpg", "A team of skydiving crooks led by rogue DEA agent Ty Moncrief specialize in landing on police roofs and breaking in so they can steal undercover agents files and sell them to drug lords. Federal Marshal Pete Nessip lost a brother to this crew and learns skydiving with the help of the tough instructor Jessie Crossmann so he can track them down.", "5.6", ["Action", "Thriller"]),
           62488 => Movie.new(62488, "Destiny Turns on the Radio (1995)", "https://image.tmdb.org/t/p/w500/jN26Tc7aMt6oY9WbcMULi7oNGH1.jpg", "Johnny Destiny burns into Las Vegas in his hot Plymouth RoadRunner, stopping only to pick up a stranger stranded in the desert. But then, things arent always as they seem. Anything can happen in that town of many possibilities...especially since theres been some weird electrical disturbances. As the stranger, fresh out of prison, tries to put his life back together--to recover his money from an old bank heist and the girl he lost in doing the job--something keeps interfering with his plans. Is it fate...or just Destiny?", "5.1", ["Comedy"]),
           10531 => Movie.new(10531, "Death and the Maiden (1994)", "https://image.tmdb.org/t/p/w500/tt9svTxy7I9NFFVtm8cwEWYzuc8.jpg", "A political activist is convinced that her guest is a man who once tortured her for the government.", "7.1", ["Drama", "Thriller"]),
           11929 => Movie.new(11929, "Dolores Claiborne (1995)", "https://image.tmdb.org/t/p/w500/gfCh3TEQNEoro8lq21y4zYIic4D.jpg", "Dolores Claiborne was accused of killing her abusive husband twenty years ago, but the courts findings were inconclusive and she was allowed to walk free. Now she has been accused of killing her employer, Vera Donovan, and this time there is a witness who can place her at the scene of the crime. Things look bad for Dolores when her daughter Selena, a successful Manhattan magazine writer, returns to cover the story.", "7.2", ["Drama", "Thriller"]),
           8467 => Movie.new(8467, "Dumb & Dumber (Dumb and Dumber) (1994)", "https://image.tmdb.org/t/p/w500/4LdpBXiCyGKkR8FGHgjKlphrfUc.jpg", 'Lloyd and Harry are two men whose stupidity is really indescribable. When Mary, a beautiful woman, loses an important suitcase with money before she leaves for Aspen, the two friends (who have found the suitcase) decide to return it to her. After some "adventures" they finally get to Aspen where, using the lost money they live it up and fight for Marys heart.', "6.6", ["Adventure", "Comedy"]),
           10451 => Movie.new(10451, "Eat Drink Man Woman (Yin shi nan nu) (1994)", "https://image.tmdb.org/t/p/w500/gQt7pI7GzCiJr6kS8iTsMyaSgbr.jpg", "A retired and widowed Chinese master chef Chu and his family live in modern day Taipei, Taiwan. He lives with his three attractive daughters, all of whom are unattached. Soon, each of the daughters encounter new men in their lives. When these new relationships blossom, stereotypes are broken and the living situation within the family changes. Since the family has difficulty expressing their love for each other, the intricate preparation of banquet quality dishes for their Sunday dinners is the surrogate for their familial feelings.", "7.5", ["Comedy", "Drama", "Romance"]),
           20156 => Movie.new(20156, "Exotica (1994)", "https://image.tmdb.org/t/p/w500/pWcJdcIHjL3P6NaEJKeV6ONfAMV.jpg", "In the upscale Toronto strip club Exotica, dancer Christina is visited nightly by the obsessive Francis, a depressed tax auditor. Her ex-boyfriend, the clubs MC, Eric, still jealously pines for her even as he introduces her onstage, but Eric is having his own relationship problems with the clubs female owner. Thomas, a mysterious pet-shop owner, is about to become unexpectedly involved in their lives.", "6.7", ["Drama"]),
           18395 => Movie.new(18395, "Exit to Eden (1994)", "https://image.tmdb.org/t/p/w500/dUtpplO9K03uYCA71Vqj9ZRkVyA.jpg", "Elliot is going to the island of Eden to live out his submissive fantasies, but inadvertently photographs diamond smugglers at work. Smugglers, and detectives, follow him to the island, where they try to retrieve the film. Elliot begins falling in love with Lisa, the head mistress of the island, and Lisa must evaluate her feelings about Elliot and her own motivations.", "4.0", ["Comedy"]),
           522 => Movie.new(522, "Ed Wood (1994)", "https://image.tmdb.org/t/p/w500/A5NCOebgzXe0jPzh0mbXRWLZNr5.jpg", 'The mostly true story of the legendary "worst director of all time", who, with the help of his strange friends, filmed countless B-movies without ever becoming famous or successful.', "7.5", ["Comedy", "Drama"]),
           397 => Movie.new(397, "French Kiss (1995)", "https://image.tmdb.org/t/p/w500/phNRL2E2fa8k0NyP39T4QCIAHgt.jpg", "After her fiancee admits to infidelity while on a business trip in France, a woman attempts to get her lover back and marry him by traveling to Paris despite her crippling fear of flying.  On the way she unwittingly smuggles something of value that has a charming crook chasing her across France as she chases after her future husband.", "6.4", ["Action", "Comedy", "Romance"]),
           10525 => Movie.new(10525, "Forget Paris (1995)", "https://image.tmdb.org/t/p/w500/c2RwGHqWwvh7nmRKpdIyYUWMEvP.jpg", "Mickey Gordon is a basketball referee who travels to France to bury his father. Ellen Andrews is an American living in Paris who works for the airline he flies on. They meet and fall in love, but their relationship goes through many difficult patches.", "6.0", ["Comedy", "Romance"]),
           27985 => Movie.new(27985, "Far From Home: The Adventures of Yellow Dog (1995)", "https://image.tmdb.org/t/p/w500/bGSXHkITArICNipXJHdRZRFhmmA.jpg", "Teenager Angus adopts a stray dog and names him Yellow. Several days later, while travelling along the coast of British Columbia with Anguss father, John, the boy and dog become stranded when turbulent waters capsize their boat. Anguss parents relentlessly badger rescue teams. Angus, schooled by his father in wilderness survival skills, and assisted by the intelligent Yellow Dog, tries to attract rescuers.", "5.8", ["Adventure", "Children"]),
           15789 => Movie.new(15789, "Goofy Movie, A (1995)", "https://image.tmdb.org/t/p/w500/bycmMhO3iIoEDzP768sUjq2RV4T.jpg", "Though Goofy always means well, his amiable cluelessness and klutzy pratfalls regularly embarrass his awkward adolescent son, Max. When Maxs lighthearted prank on his high-school principal finally gets his longtime crush, Roxanne, to notice him, he asks her on a date. Maxs trouble at school convinces Goofy that he and the boy need to bond over a cross-country fishing trip like the one he took with his dad when he was Maxs age, which throws a kink in his sons plans to impress Roxanne.", "6.9", ["Animation", "Children", "Comedy", "Romance"]),
           27303 => Movie.new(27303, "Hideaway (1995)", "https://image.tmdb.org/t/p/w500/cYWjgxgIJrak0BTemkij3gOCbMa.jpg", "Hatch Harrison, his wife, Lindsey, and their daughter, Regina, are enjoying a pleasant drive when a car crash leaves wife and daughter unharmed but kills Hatch. However, an ingenious doctor, Jonas Nyebern, manages to revive Hatch after two lifeless hours. But Hatch does not come back unchanged. He begins to suffer horrible visions of murder -- only to find out the visions are the sights of a serial killer.", "5.1", ["Thriller"]),
           21183 => Movie.new(21183, "Fluke (1995)", "https://image.tmdb.org/t/p/w500/k7BHqoTWJPpoSpfCzzUjAduuIbX.jpg", "Workaholic Thomas Johnson dies in an auto accident and comes back to life as a dog. Remembering some of who he was, he returns to his wife and son to protect them from the man who caused his accident. But, as time goes by, he remembers more of his life, and realizes he wasnt such a good husband and father.", "7.2", ["Children", "Drama"]),
           10954 => Movie.new(10954, "Farinelli: il castrato (1994)", "https://image.tmdb.org/t/p/w500/i5h0ZjYobco5HRPaAU6QTlrMYw0.jpg", "Farinelli is a 1994 biopic film about the life and career of Italian opera singer Farinelli, considered one of the greatest castrato singers of all time.", "6.6", ["Drama", "Musical"]),
           47867 => Movie.new(47867, "Gordy (1995)", "https://image.tmdb.org/t/p/w500/eQEyTkUBXOvvTlScjLqoFgB0zsN.jpg", "A talking pig named Gordy becomes involved in a quest to save his family from the slaughterhouse.", "5.3", ["Children", "Comedy", "Fantasy"]),
           14275 => Movie.new(14275, "Hoop Dreams (1994)", "https://image.tmdb.org/t/p/w500/7qHwh3mFJs7ldwzGSWsBLmgecfj.jpg", "Every school day, African-American teenagers William Gates and Arthur Agee travel 90 minutes each way from inner-city Chicago to St. Joseph High School in Westchester, Illinois, a predominately white suburban school well-known for the excellence of its basketball program. Gates and Agee dream of NBA stardom, and with the support of their close-knit families, they battle the social and physical obstacles that stand in their way. This acclaimed documentary was shot over the course of five years.", "7.7", ["Documentary"]),
           1024 => Movie.new(1024, "Heavenly Creatures (1994)", "https://image.tmdb.org/t/p/w500/uvb86wVCIqD3Rlbr0GTNgWDF7Zo.jpg", "Wealthy and precocious teenager Juliet transfers from England to New Zealand with her family, and soon befriends the quiet, brooding Pauline through their shared love of fantasy and literature. When their parents begin to suspect that their increasingly intense and obsessive bond is becoming unhealthy, the girls hatch a dark plan for those who threaten to keep them apart.", "7.0", ["Crime", "Drama"]),
           17207 => Movie.new(17207, "Houseguest (1994)", "https://image.tmdb.org/t/p/w500/cdiHlZho11EEqD3aPanYe1rEYRB.jpg", "In hot water with the mob over an unpaid debt, a con man poses as a family friend in an affluent Pennsylvania suburb.", "5.5", ["Comedy"]),
           13701 => Movie.new(13701, "Immortal Beloved (1994)", "https://image.tmdb.org/t/p/w500/meRFVzGpBJiObWfdtOoNr0UPsP4.jpg", 'A chronicle of the life of infamous classical composer Ludwig van Beethoven and his painful struggle with hearing loss. Following Beethovens death in 1827, his assistant, Schindler, searches for an elusive woman referred to in the composers love letters as "immortal beloved." As Schindler solves the mystery, a series of flashbacks reveal Beethovens transformation from passionate young man to troubled musical genius.', "7.1", ["Drama", "Romance"]),
           14819 => Movie.new(14819, "Heavyweights (Heavy Weights) (1995)", "https://image.tmdb.org/t/p/w500/uN65XQzyPknLZs2R6koZ2Cu6eGC.jpg", 'Camp Hope is a summer retreat for overweight boys run by a kindly couple who make the campers feel comfortable with their extra pounds. But when tyrannical fitness guru Tony buys the camp, he puts the kids on a cruel regimen that goes too far. Sick of the endless weeks of "all work and no play," the kids stage a coup and reclaim their summer of fun.', "6.2", ["Children", "Comedy"]),
           32631 => Movie.new(32631, "Hunted, The (1995)", "https://image.tmdb.org/t/p/w500/luCVuKiRBcQjr9MuY9mRCTehjpY.jpg", "Paul Racine, a high-powered American business executive in Japan, is catapulted into a maze of danger and intrigue after he and his sexy companion are the targets of assassins hired by the ruthless Kinjo.  To survive, Racine must join forces with a powerful samurai and together they will fight the force of evil in an awesome battle rooted in centuries of brutal conflict.", "6.1", ["Action"]),
           11777 => Movie.new(11777, "I.Q. (1994)", "https://image.tmdb.org/t/p/w500/1dLR9LX4O8DSyaU5OR3N0472IR.jpg", "Albert Einstein helps a young man whos in love with Einsteins niece to catch her attention by pretending temporarily to be a great physicist.", "6.0", ["Comedy", "Romance"]),
           628 => Movie.new(628, "Interview with the Vampire: The Vampire Chronicles (1994)", "https://image.tmdb.org/t/p/w500/2162lAT2MP36MyJd2sttmj5du5T.jpg", "A vampire relates his epic life story of love, betrayal, loneliness, and dark hunger to an over-curious reporter.", "7.4", ["Drama", "Horror"]),
           87729 => Movie.new(87729, "Jefferson in Paris (1995)", "https://image.tmdb.org/t/p/w500/5rbb3tJTPM86cSALPCZz0yx9IxC.jpg", "His wife having recently died, Thomas Jefferson accepts the post of United States ambassador to pre-revolutionary France, though he finds it difficult to adjust to life in a country where the aristocracy subjugates an increasingly restless peasantry. In Paris, he becomes smitten with cultured artist Maria Cosway, but, when his daughter visits from Virginia accompanied by her attractive slave, Sally Hemings, Jeffersons attentions are diverted.", "5.1", ["Drama"]),
           18713 => Movie.new(18713, "Jerky Boys, The (1995)", "https://image.tmdb.org/t/p/w500/yUbdqyZaeaoNKBQmnmtim1IIAf1.jpg", 'When two unemployed telephone pranksters decide to use their vocal "talents" to impersonate a Chicago mob boss and curry favor with organized crime in New York, the trouble begins. It isnt long before Johnny and Kamal (the "Jerky Boys" of crank call fame) are wanted by the local mafia, the police, and their neighbor.', "4.3", ["Comedy"]),
           6280 => Movie.new(6280, "Junior (1994)", "https://image.tmdb.org/t/p/w500/eQmgPrXf7c7daRdl3Zwgm65lw3o.jpg", "As part of a fertility research project, a male scientist agrees to carry a pregnancy in his own body.", "5.1", ["Comedy", "Sci-Fi"]),
           9061 => Movie.new(9061, "Just Cause (1995)", "https://image.tmdb.org/t/p/w500/z8WqDIUC00TPX6U24ah0C7IMEKf.jpg", "A Harvard professor is lured back into the courtroom after twenty-five years to take the case of a young black man condemned to death for the horrific murder of a child.", "6.2", ["Mystery", "Thriller"]),
           37108 => Movie.new(37108, "Kid in King Arthurs Court, A (1995)", "https://image.tmdb.org/t/p/w500/y269Xj4nOi4YHOKT241c4xubgGv.jpg", "A Southern California kid named Calvin Fuller is magically transported to the medieval kingdom of Camelot through a crack in the ground caused by an earthquake. Once there, he learns he was summoned by the wizard Merlin, who needs Calvin to save Camelot. Using dazzling modern inventions, can Calvin help King Arthur retain his crown and thwart the evil Lord Belasco?", "4.8", ["Adventure", "Children", "Comedy", "Fantasy", "Romance"]),
           6071 => Movie.new(6071, "Kiss of Death (1995)", "https://image.tmdb.org/t/p/w500/uPZZRMeaXYcCXofAaYx5BAzXMYk.jpg", "Jimmy Kilmartin is an ex-con trying to stay clean and raise a family. When his cousin Ronnie causes him to take a fall for driving an illegal transport of stolen cars, Detective Calvin Hart is injured and Jimmy lands back in prison. In exchange for an early release, he is asked to help bring down a local crime boss named Little Junior Brown. However, hes also sent undercover by Detective Hart to work with Little Junior and infiltrate his operations. As soon as Little Junior kills an undercover Federal agent with Jimmy watching, the unscrupulous DA and the Feds further complicate his life.", "5.6", ["Crime", "Drama", "Thriller"]),
           11 => Movie.new(11, "Star Wars: Episode IV - A New Hope (1977)", "https://image.tmdb.org/t/p/w500/6FfCtAuVAW8XJjZ7eWeLibRLWTw.jpg", "Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.", "8.2", ["Action", "Adventure", "Sci-Fi"]),
           9587 => Movie.new(9587, "Little Women (1994)", "https://image.tmdb.org/t/p/w500/1ZzH1XMcKAe5NdrKL5MfcqZHHsZ.jpg", "With their father away as a chaplain in the Civil War, Jo, Meg, Beth and Amy grow up with their mother in somewhat reduced circumstances. They are a close family who inevitably have their squabbles and tragedies. But the bond holds even when, later, male friends start to become a part of the household.", "7.3", ["Drama"]),
           19101 => Movie.new(19101, "Little Princess, A (1995)", "https://image.tmdb.org/t/p/w500/9V4bAVEskSNbEqjVI0YmeuB0n8I.jpg", "When her father enlists to fight for the British in WWI, young Sara Crewe goes to New York to attend the same boarding school her late mother attended. She soon clashes with the severe headmistress, Miss Minchin, who attempts to stifle Saras creativity and sense of self- worth.", "7.6", ["Children", "Drama"]),
           49980 => Movie.new(49980, "Ladybird Ladybird (1994)", "https://image.tmdb.org/t/p/w500/91KSK1xKdVEIDASKRo9ahBFCtM2.jpg", "Maggie has had four children, by four different fathers, removed by social services because of a previous violent relationship. When she meets Jorge, a gentle Latin American refugee, she gradually sees her chance for happiness, but her history still haunts her.", "7.1", ["Drama"]),
           18183 => Movie.new(18183, "Like Water for Chocolate (Como agua para chocolate) (1992)", "https://image.tmdb.org/t/p/w500/itwUdMqLmPfhtGJ44hiDxkqZhiq.jpg", "Tita is passionately in love with Pedro, but her controlling mother forbids her from marrying him. When Pedro marries her sister, Tita throws herself into her cooking and discovers she can transfer her emotions through the food she prepares, infecting all who eat it with her intense heartbreak.", "7.2", ["Drama", "Fantasy", "Romance"]),
           4476 => Movie.new(4476, "Legends of the Fall (1994)", "https://image.tmdb.org/t/p/w500/t1KPGlW0UGd0m515LPQmk2F4nu1.jpg", "An epic tale of three brothers and their father living in the remote wilderness of 1900s USA and how their lives are affected by nature, history, war, and love.", "7.4", ["Drama", "Romance", "War", "Western"]),
           11008 => Movie.new(11008, "Major Payne (1995)", "https://image.tmdb.org/t/p/w500/kWHx5eq7PELkF3If7LrrhuBskRG.jpg", "Major Benson Winifred Payne is being discharged from the Marines. Payne is a killin machine, but the wars of the world are no longer fought on the battlefield. A career Marine, he has no idea what to do as a civilian, so his commander finds him a job - commanding officer of a local schools JROTC program, a bunch of ragtag losers with no hope.", "6.3", ["Comedy"]),
           32325 => Movie.new(32325, "My Crazy Life (Mi vida loca) (1993)", "https://image.tmdb.org/t/p/w500/cSCV25dOBMtQMixsUJYTLB7YjCK.jpg", "Mousie and Sad Girl are childhood best friends in a contemporary Los Angeles poor Hispanic neighborhood. But when Sad Girl becomes pregnant by Mousies boyfriend, a drug dealer named Ernesto, the two become bitter enemies. While their dispute escalates towards violence, the violence of the world around them soon also impacts their lives.", "7.1", ["Drama"]),
           43742 => Movie.new(43742, "Love Affair (1994)", "https://image.tmdb.org/t/p/w500/mQMCPf0GUaOjKYFTdmL8w8udnJX.jpg", "Ex-football star Mike Gambril meets Terry McKay on a flight to Sydney, which is forced to land on a small atoll. They become romantic on board a ship sent to take them to a larger island. They agree to meet in New York three months later to see if the attraction is real. One shows up but the other doesnt. However, a chance meeting brings them together again.", "5.4", ["Drama", "Romance"]),
           28313 => Movie.new(28313, "Losing Isaiah (1995)", "https://image.tmdb.org/t/p/w500/oHALKuPewtqIn2BcluZsGvcEG1P.jpg", "Khaila Richards, a crack-addicted single mother, accidentally leaves her baby in a dumpster while high and returns the next day in a panic to find he is missing. In reality, the baby has been adopted by a warm-hearted social worker, Margaret Lewin, and her husband, Charles. Years later, Khaila has gone through rehab and holds a steady job. After learning that her child is still alive, she challenges Margaret for the custody.", "6.4", ["Drama"]),
           11318 => Movie.new(11318, "Madness of King George, The (1994)", "https://image.tmdb.org/t/p/w500/baOVRhPWe0e3K6J2QA0ZWqb4MZe.jpg", "Aging King George III of England is exhibiting signs of madness, a problem little understood in 1788. As the monarch alternates between bouts of confusion and near-violent outbursts of temper, his hapless doctors attempt the ineffectual cures of the day. Meanwhile, Queen Charlotte and Prime Minister William Pitt the Younger attempt to prevent the kings political enemies, led by the Prince of Wales, from usurping the throne.", "6.8", ["Comedy", "Drama"]),
           3036 => Movie.new(3036, "Mary Shelleys Frankenstein (Frankenstein) (1994)", "https://image.tmdb.org/t/p/w500/bOwCAQsZlEKrwhPi1ejY6BS8jpL.jpg", 'Based on Mary Shelleys novel, "Frankenstein" tells the story of Victor Frankenstein, a promising young doctor who, devastated by the death of his mother during childbirth, becomes obsessed with bringing the dead back to life. His experiments lead to the creation of a monster, which Frankenstein has put together with the remains of corpses. Its not long before Frankenstein regrets his actions.', "6.4", ["Drama", "Horror", "Sci-Fi"]),
           40490 => Movie.new(40490, "Man of the House (1995)", "https://image.tmdb.org/t/p/w500/6bnOhhrrrq6RZhMgz4aGyqbJ9Wf.jpg", 'Ben Archer is not happy. His mother, Sandy, has just met a man, and it looks like things are pretty serious. Driven by a fear of abandonment, Ben tries anything and everything to ruin the "love bubble" which surrounds his mom. However, after Ben and Jacks experiences in the Indian Guides, the two become much closer.', "5.2", ["Comedy"]),
           24070 => Movie.new(24070, "Mixed Nuts (1994)", "https://image.tmdb.org/t/p/w500/rI5oZR0ov3ki72Gy1QDM8XJ43mo.jpg", "The events of a crisis hotline business on one crazy night during the Christmas holidays.", "5.4", ["Comedy"]),
           8986 => Movie.new(8986, "Milk Money (1994)", "https://image.tmdb.org/t/p/w500/od8SCOMLDq4iRYaHNqihQVn1SNE.jpg", "Three young boys pool their money and pay V, a kindhearted prostitute, to strip for them. Afterward, she drives them home to the suburbs -- but then her car breaks down. Its just as well, though, because a mobster named Waltzer is after her, and V realizes the suburbs are the perfect place to hide. But things get a lot more complicated when V falls in love with Tom, a single father who is unaware of her real profession.", "6.3", ["Comedy", "Romance"]),
           10510 => Movie.new(10510, "Miracle on 34th Street (1994)", "https://image.tmdb.org/t/p/w500/sWjL1zD0XjQrOTP9jLiAbzvBKEW.jpg", "Six-year-old Susan Walker has doubts about childhoods most enduring miracle�Santa Claus. Her mother told her the secret about Santa a long time ago, but, after meeting a special department store Santa whos convinced hes the real thing, Susan is given the most precious gift of all�something to believe in.", "6.7", ["Drama"]),
           17402 => Movie.new(17402, "Miami Rhapsody (1995)", "https://image.tmdb.org/t/p/w500/h7I2DgoxdkVMiPx4usFNkfvSoBs.jpg", "Gwyn Marcus has always wanted a marriage like her parents. She has just accepted the proposal of her boyfriend Matt, but she has misgivings about their future together. Her fear of commitment grows as she learns of the various affairs that her family is having. With her sister getting married and her brother already married, her mother is growing concerned about Gwyns being the last single person in the family. But the more she thinks about marriage, the more she must search for the balance between career, marriage and family.", "5.4", ["Comedy"]),
           38722 => Movie.new(38722, "My Family (1995)", "https://image.tmdb.org/t/p/w500/xHqmWBuFoQVKvGKiSgyYyU1AK1V.jpg", "Traces over three generations an immigrant familys trials, tribulations, tragedies, and triumphs. Maria and Jose, the first generation, come to Los Angeles, meet, marry, face deportation all in the 1930s. They establish their family in East L.A., and their children Chucho, Paco, Memo, Irene, Toni, and Jimmy deal with youth culture and the L.A. police in the 50s. As the second generation become adults in the 60s, the focus shifts to Jimmy, his marriage to Isabel (a Salvadorian refugee), their son, and Jimmys journey to becoming a responsible parent.", "7.6", ["Drama"]),
           8438 => Movie.new(8438, "Murder in the First (1995)", "https://image.tmdb.org/t/p/w500/sU37ONoL9qUyYXUhubJSYH9tEoc.jpg", "Inspired by a true story. A petty criminal sent to Alcatraz in the 1930s is caught attempting to make an escape. As punishment he is put in solitary confinement. The maximum stay is supposed to be 19 days, but Henri spends years alone, cold and in complete darkness, only to emerge a madman and soon to be a murderer. The story follows a rookie lawyer attempting to prove that Alcatraz was to blame.", "7.2", ["Drama", "Thriller"]),
           11593 => Movie.new(11593, "Nobodys Fool (1994)", "https://image.tmdb.org/t/p/w500/yTpm5R28mDWYS3tSvYdU5wNenC8.jpg", "Sully is a rascally neer-do-well approaching retirement age. While he is pressing a workers compensation suit for a bad knee, he secretly works for his nemesis, Carl, and flirts with Carls young wife Toby. Sullys long- forgotten son and family have moved back to town, so Sully faces unfamiliar family responsibilities. Meanwhile, Sullys landladys banker son plots to push through a new development and evict Sully from his mothers life.", "6.9", ["Comedy", "Drama", "Romance"]),
           1945 => Movie.new(1945, "Nell (1994)", "https://image.tmdb.org/t/p/w500/6WZFYXMFFwNS0AmTd3deCLXjt10.jpg", "In a remote woodland cabin, a small town doctor discovers Nell � a beautiful young hermit woman with many secrets.", "6.6", ["Drama"]),
           39310 => Movie.new(39310, "New Jersey Drive (1995)", "https://image.tmdb.org/t/p/w500/7JDGvBFLkU1PQnvandozqe5qyhs.jpg", 'New Jersey Drive is a 1995 film about black youths in Newark, New Jersey, the unofficial "car theft capital of the world". Their favorite pastime is that of everybody in their neighborhood: stealing cars and joyriding. The trouble starts when they steal a police car and the cops launch a violent offensive that involves beating and even shooting suspects.', "6.1", ["Crime", "Drama"]),
           109560 => Movie.new(109560, "New York Cop (Nyû Yôku no koppu) (1993)", "https://image.tmdb.org/t/p/w500/5kXO783UrTaKZE3wn0KZv3RubZc.jpg", "Allegedly based on a true story, this film follows the life of Toshi, a Japanese man living in America and working with the New York City police. After being recommended for undercover work, Toshi decides to go after a gang lead by Hawk. Hawk and Toshi soon become friends, although Hawks second-in-command, Tito, is suspicious of the newcomer. Will Toshi be able to bring the gang down, or will his cover be blown before he can finish the assignment?", "3.2", ["Action", "Crime"]),
           56428 => Movie.new(56428, "Beyond Bedlam (1993)", "https://image.tmdb.org/t/p/w500/rqArVCgag2ng179rb3OXeEnS4Lo.jpg", "An experiment gone awry places a neurologist (Elizabeth Hurley) and a homicide detective (Craig Fairbrass) in a psychopaths (Keith Allen) nightmarish world.", "3.3", ["Drama", "Horror"]),
           131957 => Movie.new(131957, "Nina Takes a Lover (1994)", "https://image.tmdb.org/t/p/w500/mSPoA8exUsNThCfBjjTug7V7wGJ.jpg", "Laura San Giacomo stars in this sexy comedy about adultery. When Ninas (San Giacomo) husband goes out of town for several weeks on a business trip, Nina hooks up with a photographer. Told from a reporters point of view, his interviews with Nina and the photographer provide comic insights. Stars Laura San Giacomo, Paul Rhys, Michael OKeefe, Fisher Stevens and more.", "5.2", ["Comedy", "Romance"]),
           241 => Movie.new(241, "Natural Born Killers (1994)", "https://image.tmdb.org/t/p/w500/fEKZwT91gxvkAoyPgpNXo8W5fu0.jpg", "Two victims of traumatized childhoods become lovers and psychopathic serial murderers irresponsibly glorified by the mass media.", "7.1", ["Action", "Crime", "Thriller"]),
           9058 => Movie.new(9058, "Only You (1994)", "https://image.tmdb.org/t/p/w500/7mLLANXgUg3bibTiUitDlB0NZcU.jpg", 'A childhood incident has convinced Faith Corvatch that her true love is a guy named "Damon Bradley," but she has yet to meet him. Preparing to settle down and marry a foot doctor, Faith impulsively flies to Venice when it seems that she may be able to finally encounter the man of her dreams. Instead, she meets the charming Peter Wright. But can they fall in love if she still believes that she is intended to be with someone else?', "6.8", ["Comedy", "Romance"]),
           527 => Movie.new(527, "Once Were Warriors (1994)", "https://image.tmdb.org/t/p/w500/1nd4SsytVc96hy92g8NNVPD3mzf.jpg", "A drama about a Maori family living in Auckland, New Zealand. Lee Tamahori tells the story of Beth Heke�s strong will to keep her family together during times of unemployment and abuse from her violent and alcoholic husband.", "7.4", ["Crime", "Drama"]),
           18220 => Movie.new(18220, "Poison Ivy II (1996)", "https://image.tmdb.org/t/p/w500/jXLuQYRwWNuwW8dkx3zo5bWon2r.jpg", "A young and naive college art student becomes obsessed with assuming the identity and personality of a departed coed who used to live in her room, and in so doing causes complications that result in two men, a student and her art professor, lusting after her.", "4.8", ["Drama", "Thriller"]),
           6950 => Movie.new(6950, "Outbreak (1995)", "https://image.tmdb.org/t/p/w500/nzlNS14XavvJzIEm5lPdT35XWoT.jpg", "A deadly airborne virus finds its way into the USA and starts killing off people at an epidemic rate. Col Sam Daniels job is to stop the virus spreading from a small town, which must be quarantined, and to prevent an over reaction by the White House.", "6.5", ["Action", "Drama", "Sci-Fi", "Thriller"]),
           101 => Movie.new(101, "Léon: The Professional (a.k.a. The Professional) (Léon) (1994)", "https://image.tmdb.org/t/p/w500/yI6X2cCM5YPJtxMhUd3dPGqDAhw.jpg", 'L�on, the top hit man in New York, has earned a rep as an effective "cleaner". But when his next-door neighbors are wiped out by a loose-cannon DEA agent, he becomes the unwilling custodian of 12-year-old Mathilda. Before long, Mathildas thoughts turn to revenge, and she considers following in L�ons footsteps.', "8.3", ["Action", "Crime", "Drama", "Thriller"]),
           63020 => Movie.new(63020, "Perez Family, The (1995)", "https://image.tmdb.org/t/p/w500/jxi3UDHf86kDk5hqJxnpEMzVch2.jpg", "In the midst of the Mariel boat lift -- a hurried exodus of refugees from Cuba going to America -- an immigration clerk accidentally presumes that dissident Juan Raul Perez and Dorita Evita Perez are married. United by their last name and a mutual resolve to emigrate, Dorita and Juan agree to play along. But it gets complicated when the two begin falling for each other just as Juan reunites with his wife, Carmela, whom he hasnt seen in decades.", "6.4", ["Comedy", "Romance"]),
           2307 => Movie.new(2307, "Pyromaniacs Love Story, A (1995)", "https://image.tmdb.org/t/p/w500/9pU8aNS1wEXVGNR9WnsX2O3w9qF.jpg", "A pastry boy and the son of a hair-piece mogul become involved in an arson scandal. Sergio is offered a bribe in exchange for taking the blame for the fire that destroys his workplace. Garet, the real arsonist, is apalled that someone else would try to take credit for his act of love. Before long, Sergio and Garet become entangled in a zany love-quadrangle involving Hattie and Stephanie. Written by Brian Whiting", "5.0", ["Comedy", "Romance"]),
           680 => Movie.new(680, "Pulp Fiction (1994)", "https://image.tmdb.org/t/p/w500/fIE3lAGcZDV1G6XM5KmuWnNsPp1.jpg", "A burger-loving hit man, his philosophical partner, a drug-addled gangsters moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.", "8.5", ["Comedy", "Crime", "Drama", "Thriller"]),
           25296 => Movie.new(25296, "Pushing Hands (Tui shou) (1992)", "https://image.tmdb.org/t/p/w500/pSFjbqSNadc6vhQp5JCzg7SGv4A.jpg", "Mr. Chu is an elderly widower who teaches tai chi chuan in Beijing. He moves to America to live with his sons family, but finds the cultural adjustment difficult. Since his daughter-in-law is a white woman who does not speak Chinese, Mr. Chus son, Alex, must mediate.", "7.1", ["Drama"]),
           40156 => Movie.new(40156, "Priest (1994)", "https://image.tmdb.org/t/p/w500/bQ7yx2cvkOZGp2Cr0bNCZEtNbtu.jpg", "Father Greg Pilkington is torn between his call as a conservative Catholic priest and his secret life as a homosexual with a gay lover, frowned upon by the Church. Upon hearing the confession of a young girl of her incestuous father, Greg enters an intensely emotional spiritual struggle deciding between choosing morals over religion and one life over another.", "6.5", ["Drama"]),
           11450 => Movie.new(11450, "Quiz Show (1994)", "https://image.tmdb.org/t/p/w500/yoGJo1h3Hl2exXPVcG9UXWDENtX.jpg", "Lawyer Richard Goodwin discovers that Twenty-One, a successful TV quiz show, is rigged and decides to expose the team behind the show.", "7.3", ["Drama"]),
           30304 => Movie.new(30304, "Picture Bride (Bijo photo) (1994)", "https://image.tmdb.org/t/p/w500/cmgPvzCXehBYwCadX8zORKu80OA.jpg", "Riyo, an orphaned 17-year old, sails from Yokohama to Hawaii in 1918 to marry Matsuji, a man she has never met. Hoping to escape a troubled past and start anew, Riyo is bitterly disappointed upon her arrival: her husband is twice her age. The miserable girl finds solace with her new friend Kana, a young mother who helps Riyo accept her new life.", "6.1", ["Drama", "Romance"]),
           10452 => Movie.new(10452, "Queen Margot (Reine Margot, La) (1994)", "https://image.tmdb.org/t/p/w500/8uGkhBLiJMIkwohGPo3iB9AuwDg.jpg", "Paris, Kingdom of France, August 18, 1572. To avoid the outbreak of a religious war, the Catholic princess Marguerite de Valois, sister of the feeble King Charles IX, marries the Huguenot King Henry III of Navarre.", "7.2", ["Drama", "Romance"]),
           12106 => Movie.new(12106, "Quick and the Dead, The (1995)", "https://image.tmdb.org/t/p/w500/fQk89YaQdeBcS7AmlKODKOxIAPU.jpg", "A mysterious woman comes to compete in a quick-draw elimination tournament, in a town taken over by a notorious gunman.", "6.5", ["Action", "Thriller", "Western"]),
           161495 => Movie.new(161495, "Roommates (1995)", "https://image.tmdb.org/t/p/w500/6ul4lqY6uvv6rwvoLscYJSQhAxj.jpg", "An elderly, yet young-at-heart man, moves in with his grandson, and both their lives turn upside-down.", "6.4", ["Comedy", "Drama"]),
           3586 => Movie.new(3586, "Ready to Wear (Pret-A-Porter) (1994)", "https://image.tmdb.org/t/p/w500/ehg1dTxsqx2eMZpd5Tio9JifwqB.jpg", "Paris Fashion Week draws the usual bunch of people; designers, reporters, models, magazine editors, photographers. Follows the various storylines of these characters, centering around a murder investigation of a prominent fashion figure. Features an all-star cast.", "5.3", ["Comedy"]),
           110 => Movie.new(110, "Three Colors: Red (Trois couleurs: Rouge) (1994)", "https://image.tmdb.org/t/p/w500/5YIzZaQlwYJY5ZEqHRs9dG9DduB.jpg", "Valentine, a student model in Geneva, struggles with a possessive boyfriend and a troubled family. When she runs over a dog, she discovers that its owner, a retired judge, is illegally wiretapping and eavesdropping on his neighbors phone calls. Although Valentine is outraged, she develops a strange bond with the judge � and as the two become closer, she finds herself caught in the middle of events that could change her life.", "8.0", ["Drama"]),
           108 => Movie.new(108, "Three Colors: Blue (Trois couleurs: Bleu) (1993)", "https://image.tmdb.org/t/p/w500/ayKRZejiarjY4R3UE1JKlSYcyHk.jpg", "Julie is haunted by her grief after living through a tragic auto wreck that claimed the life of her composer husband and young daughter. Her initial reaction is to withdraw from her relationships, lock herself in her apartment and suppress her pain. But avoiding human interactions on the bustling streets of Paris proves impossible, and she eventually meets up with Olivier, an old friend who harbors a secret love for her, and who could draw her back to reality.", "7.7", ["Drama"]),
           109 => Movie.new(109, "Three Colors: White (Trzy kolory: Bialy) (1994)", "https://image.tmdb.org/t/p/w500/4jDSCLCWxHutCAZRve8Kkso2UfA.jpg", "Polish immigrant Karol Karol finds himself out of a marriage, a job and a country when his French wife, Dominique, divorces him after six months due to his impotence. Forced to leave France after losing the business they jointly owned, Karol enlists fellow Polish expatriate Mikolah to smuggle him back to their homeland.", "7.5", ["Comedy", "Drama"]),
           36357 => Movie.new(36357, "Rent-a-Kid (1995)", "https://image.tmdb.org/t/p/w500/4QreoTC6jfpC0DiQ0NTagL4qUTP.jpg", "Harry Habert, owner of a rent office has an original idea: To rent babies from a nearby orphanage to the local families. He rents the Ward brothers to his first customers...", "5.6", ["Comedy"]),
           92769 => Movie.new(92769, "Relative Fear (1994)", "", "Linda and Peter Pratmans son Adam is autistic, but they still love him and hope that hell at least start talking some day. However hes teased and abused by the kids of the neighborhood and his grandpa . When several people around Adam die an unexpected death, his parents start to suspect Adam - is he just simulating to be so ignorant about his environment?", "4.7", ["Horror", "Thriller"]),
           28033 => Movie.new(28033, "Stuart Saves His Family (1995)", "https://image.tmdb.org/t/p/w500/80YaWpUokDoPynsJi0ittpts3J0.jpg", "Stuart Smalley, the Saturday Night Live character, comes to the big screen. Stuart, the disciple of the 12 step program, is challenged by lifes injustices.", "4.6", ["Comedy"]),
           22586 => Movie.new(22586, "Swan Princess, The (1994)", "https://image.tmdb.org/t/p/w500/f5YvIPrkJ9HCsNbgzWJJyxXVNhj.jpg", "The beautiful princess Odette is transformed into a swan by an evil sorcerers spell. Held captive at an enchanted lake, she befriends Jean-Bob the frog, Speed the turtle and Puffin the bird. Despite their struggle to keep the princess safe, these good-natured creatures can do nothing about the sorcerers spell, which can only be broken by a vow of everlasting love.", "6.6", ["Animation", "Children"]),
           14334 => Movie.new(14334, "Secret of Roan Inish, The (1994)", "https://image.tmdb.org/t/p/w500/knrhzhfMKgTqrDrCy3nBWL5sypa.jpg", "10-year-old Fiona is sent to live with her grandparents in a small fishing village in Donegal, Ireland. She soon learns the local legend that an ancestor of hers married a Selkie - a seal who can turn into a human. Years earlier, her baby brother was washed out to sea and never seen again, so when Fiona spies a naked little boy on the abandoned Isle of Roan Inish, she is compelled to investigate..", "6.6", ["Children", "Drama", "Fantasy", "Mystery"]),
           2636 => Movie.new(2636, "Specialist, The (1994)", "https://image.tmdb.org/t/p/w500/ifqrivWPQ0ZpwnIXBjgN261SQ1S.jpg", "May Munro is a woman obsessed with getting revenge on the people who murdered her parents when she was still a girl. She hires Ray Quick, a retired explosives expert to kill her parents killers. When Ned Trent, embittered ex-partner of Quicks is assigned to protect one of Quicks potential victims, a deadly game of cat and mouse ensues.", "5.8", ["Action", "Drama", "Thriller"]),
           2164 => Movie.new(2164, "Stargate (1994)", "https://image.tmdb.org/t/p/w500/5TE3obJopSD9lWCa6rqF2E4Oda7.jpg", "An interstellar teleportation device, found in Egypt, leads to a planet with humans resembling ancient Egyptians who worship the god Ra.", "7.0", ["Action", "Adventure", "Sci-Fi"]),
           11395 => Movie.new(11395, "Santa Clause, The (1994)", "https://image.tmdb.org/t/p/w500/tBHDVtEcMl06FbCURRLGVg3TpXp.jpg", "Scott Calvin is an ordinary man, who accidentally causes Santa Claus to fall from his roof on Christmas Eve and is knocked unconscious. When he and his young son finish Santas trip and deliveries, they go to the North Pole, where Scott learns he must become the new Santa and convince those he loves that he is indeed, Father Christmas.", "6.4", ["Comedy", "Drama", "Fantasy"]),
           278 => Movie.new(278, "Shawshank Redemption, The (1994)", "https://image.tmdb.org/t/p/w500/q6y0Go1tsGEsmtFryDOJo3dEmqu.jpg", "Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.", "8.7", ["Crime", "Drama"]),
           9905 => Movie.new(9905, "Shallow Grave (1994)", "https://image.tmdb.org/t/p/w500/sFNb6W6V3VYJRHQE8xYQEOcu8QT.jpg", "When accountant David, doctor Juliet and journalist Alex are searching for a fourth roommate for their trendy flat, they settle on the aloof Hugo. However, they soon find Hugo dead of a drug overdose, beside a large sum of cash. After some deliberation, the three others decide to keep the money and to dismember and bury Hugos body. Soon, each roommate starts thinking about keeping all the money by scamming the others.", "7.0", ["Comedy", "Drama", "Thriller"]),
           87078 => Movie.new(87078, "Suture (1993)", "https://image.tmdb.org/t/p/w500/89jGoGPFqOl6JR144iEOxeciggM.jpg", "Brothers Vincent (rich) and Clay (poor) meet up for the first time after their fathers funeral and remark on how similar they look. But unknown to Clay, who thinks his life is taking a turn for the better, Vince is actually plotting to kill him with a car bomb and pass the corpse off as his own, planning to start a new life elsewhere with his fathers inheritance. But Clay survives the blast and has his face, memory and identity restored in hospital... but are they the right ones?", "6.3", ["Film-Noir", "Thriller"]),
           12527 => Movie.new(12527, "Strawberry and Chocolate (Fresa y chocolate) (1993)", "https://image.tmdb.org/t/p/w500/tMwUsu080E4kS4rkHPffy1ugvaJ.jpg", "Havana, Cuba, 1979. Flamboyantly gay artist Diego (Jorge Perugorr�a) attempts to seduce the straight and strait-laced David, an idealistic young communist, and fails dismally. But David conspires to become friends with Diego so he can monitor the artists subversive life for the state. As Diego and David discuss politics, individuality and personal expression in Castros Cuba, a genuine friendship develops between the two. But can it last? Strawberry and Chocolate became an instant hit when it was released, and has become a classic of Cuban cinema due to its charming and authentic exploration of a connection between two people under historical circumstances that seem levelled against them.", "7.1", ["Drama"]),
           20306 => Movie.new(20306, "Swimming with Sharks (1995)", "https://image.tmdb.org/t/p/w500/vRkIYMpxVUicUfubRaL4R1gMnh8.jpg", "Guy is a young film executive whos willing to do whatever it takes to make it in Hollywood. He begins working for famed producer Buddy Ackerman, a domineering, manipulative, coldhearted boss. When Guy also finds out that his cynical girlfriend, Dawn, has been using sex as a career move, he reaches his limit. Guy decides to exact revenge on Buddy by kidnapping him and subjecting him to cruel and unusual punishment.", "6.6", ["Comedy", "Drama"]),
           36614 => Movie.new(36614, "Sum of Us, The (1994)", "https://image.tmdb.org/t/p/w500/piKBAyxYxSP14uVzK4BH9wjfPlY.jpg", 'A widowed father has to deal with two complex issues: while he is searching for "Miss Right," his son, who is in his 20s and gay, is searching for "Mr. Right."', "6.9", ["Comedy", "Drama"]),
           27993 => Movie.new(27993, "National Lampoons Senior Trip (1995)", "https://image.tmdb.org/t/p/w500/qfMbFIGNIQ76FEu7Wg48aEbxFh1.jpg", "While on detention, a group of misfits and slackers have to write a letter to the President explaining what is wrong with the education system. There is only one problem, the President loves it! Hence, the group must travel to Washington to meet the Main Man.", "5.6", ["Comedy"]),
           31439 => Movie.new(31439, "To Live (Huozhe) (1994)", "https://image.tmdb.org/t/p/w500/hjcISgegtvGmtpztYTseDRcsr85.jpg", "Fugui and Jiazhen endure tumultuous events in China as their personal fortunes move from wealthy landownership to peasantry.", "7.9", ["Drama"]),
           9067 => Movie.new(9067, "Tank Girl (1995)", "https://image.tmdb.org/t/p/w500/dpX63vJd6k5fMTudLaEOw9ffX8h.jpg", "Based on the British cult comic-strip, our tank-riding anti-heroine fights a mega-corporation, which controls the worlds water supply.", "5.4", ["Action", "Comedy", "Sci-Fi"]),
           9059 => Movie.new(9059, "Tales from the Crypt Presents: Demon Knight (1995)", "https://image.tmdb.org/t/p/w500/1TekTWa1htkb554KDplTXskQupo.jpg", "A man on the run is hunted by a demon known as the Collector.", "6.8", ["Horror", "Thriller"]),
           193 => Movie.new(193, "Star Trek: Generations (1994)", "https://image.tmdb.org/t/p/w500/rHsCYDGHFUarGh5k987b0EFU6kC.jpg", "Captain Jean-Luc Picard and the crew of the Enterprise-D find themselves at odds with the renegade scientist Soran who is destroying entire star systems. Only one man can help Picard stop Sorans scheme...and hes been dead for seventy-eight years.", "6.5", ["Adventure", "Drama", "Sci-Fi"]),
           25066 => Movie.new(25066, "Tales from the Hood (1995)", "https://image.tmdb.org/t/p/w500/8z78cFRulp03wUq32kOQpmvbhCI.jpg", "A strange funeral director tells four strange tales of horror with an African American focus to three drug dealers he traps in his place of business.", "6.1", ["Action", "Crime", "Horror"]),
           46797 => Movie.new(46797, "Tom & Viv (1994)", "https://image.tmdb.org/t/p/w500/iw4ofGbX2AbJ4p17CixwnMjuoJ0.jpg", "The story of the marriage of the poet T. S. Eliot to socialite Vivienne Haigh-Wood, which had to cope with her gynaecological and emotional problems and his growing fame.", "5.8", ["Drama"]),
           12122 => Movie.new(12122, "Village of the Damned (1995)", "https://image.tmdb.org/t/p/w500/1Iezq745huWW3xB5xQMPDdyyWx7.jpg", 'An American village is visited by some unknown life form which leaves the women of the village pregnant. Nine months later, the babies are born, and they all look normal, but it doesnt take the "parents" long to realize that the kids are not human or humane.', "6.0", ["Horror", "Sci-Fi"]),
           11381 => Movie.new(11381, "Tommy Boy (1995)", "https://image.tmdb.org/t/p/w500/cUvdzCbhLyYUAwbIkBjT3tC28cK.jpg", "To save the family business, two ne�er-do-well traveling salesmen hit the road with disastrously funny consequences.", "6.8", ["Comedy"]),
           32636 => Movie.new(32636, "Vanya on 42nd Street (1994)", "https://image.tmdb.org/t/p/w500/sYkkHsqXyUcFoLbXt4WNwnRRpT1.jpg", 'An uninterrupted rehersal of Chekhovs "Uncle Vanya" played out by a company of actors. The setting is their run down theater with an unusable stage and crumbling ceiling. The play is shown act by act with the briefest of breaks to move props or for refreshments. The lack of costumes, real props and scenery is soon forgotten.', "6.8", ["Drama"]),
           36141 => Movie.new(36141, "Underneath (1995)", "https://image.tmdb.org/t/p/w500/61yu1ejOBWUrrMRplRbjpvxgxVc.jpg", "Michael Chambers has come home to Austin, Texas to his mother whos starting a new life, to his brother whose driven by old jealousies, and to Rachel�the woman he married and then betrayed with his passion for gambling. Now shes together with Tommy, so Michael devises a plan to get Rachel out from under Tommys control.", "5.8", ["Mystery", "Thriller"]),
           95963 => Movie.new(95963, "Walking Dead, The (1995)", "https://image.tmdb.org/t/p/w500/c0RtcIN4oSzSZoNs0nJMevfGYS4.jpg", "Five young marines on a suicide mission in Vietnam, struggle for survival in a jungle minefield. The mean streets of home did not prepare them for this.", "6.8", ["Drama", "War"]),
           1587 => Movie.new(1587, "Whats Eating Gilbert Grape (1993)", "https://image.tmdb.org/t/p/w500/8FxWgsfDNosewo7H65oE4QkOb7g.jpg", "Gilbert Grape is a small-town young man with a lot of responsibility. Chief among his concerns are his mother, who is so overweight that she cant leave the house, and his mentally impaired younger brother, Arnie, who has a knack for finding trouble. Settled into a job at a grocery store and an ongoing affair with local woman Betty Carver, Gilbert finally has his life shaken up by the free-spirited Becky.", "7.7", ["Drama"]),
           9271 => Movie.new(9271, "Virtuosity (1995)", "https://image.tmdb.org/t/p/w500/5emgnXYrXjqyiup2JsvtuENseiV.jpg", "The Law Enforcement Technology Advancement Centre (LETAC) has developed SID version 6.7: a Sadistic, Intelligent, and Dangerous virtual reality entity which is synthesized from the personalities of more than 150 serial killers, and only one man can stop him.", "5.4", ["Action", "Sci-Fi", "Thriller"]),
           2064 => Movie.new(2064, "While You Were Sleeping (1995)", "https://image.tmdb.org/t/p/w500/qNGO3ETcNwlWqK2kNRpbJSJRlos.jpg", "A transit worker pulls commuter Peter off railway tracks after hes mugged, but�while hes in a coma�his family mistakenly thinks shes Peters fianc�e, and she doesnt correct them. Things get more complicated when she falls for his brother, whos not quite sure that shes who she claims to be.", "6.9", ["Comedy", "Romance"]),
           19855 => Movie.new(19855, "War, The (1994)", "https://image.tmdb.org/t/p/w500/eMJYqr5zs7rz54oZhiX4ez1BI5E.jpg", "The son of a Vietnam War Veteran must deal with neighborhood bullies as well as his dads post-traumatic stress disorder while growing up in the deep south in the 1970s.", "6.7", ["Adventure", "Drama", "War"]),
           60855 => Movie.new(60855, "Double Happiness (1994)", "https://image.tmdb.org/t/p/w500/woRZTcrRbvcW24zbNcCbVi4QfEF.jpg", "Jade Li is a feisty, 20-something Chinese Canadian, trying to achieve that happy medium between giving in to her parents wishes and fulfilling her own needs and desires - double happiness. Naturally, somethings got to give and when love beckons in the shape of Mark, a white university student, the facade of the perfect Chinese daughter begins to slip.", "6.1", ["Drama"]),
           236 => Movie.new(236, "Muriels Wedding (1994)", "https://image.tmdb.org/t/p/w500/zJyTr8Fo412a2OIfJGXTRAm4IwX.jpg", "A young social outcast in Australia steals money from her parents to finance a vacation where she hopes to find happiness, and perhaps love.", "7.0", ["Comedy"]),
           48287 => Movie.new(48287, "Baby-Sitters Club, The (1995)", "https://image.tmdb.org/t/p/w500/juT5eKRDhmluaiVhymjViyXArCq.jpg", "Seven junior-high-school girls organize a daycare camp for children while at the same time experiencing classic adolescent growing pains.", "5.4", ["Children"]),
           3049 => Movie.new(3049, "Ace Ventura: Pet Detective (1994)", "https://image.tmdb.org/t/p/w500/pqiRuETmuSybfnVZ7qyeoXhQyN1.jpg", "Hes Ace Ventura: Pet Detective. Jim Carrey is on the case to find the Miami Dolphins missing mascot and quarterback Dan Marino. He goes eyeball to eyeball with a man-eating shark, stakes out the Miami Dolphins and woos and wows the ladies. Whether hes undercover, under fire or underwater, he always gets his man� or beast!", "6.5", ["Comedy"]),
           2759 => Movie.new(2759, "Adventures of Priscilla, Queen of the Desert, The (1994)", "https://image.tmdb.org/t/p/w500/4XZGeeGUKHlzO5lnGQLdwmjmJVZ.jpg", "Two drag queens and a transgender woman contract to perform a drag show at a resort in Alice Springs, a town in the remote Australian desert. As they head west from Sydney aboard their lavender bus, Priscilla, the three friends come to the forefront of a comedy of errors, encountering a number of strange characters, as well as incidents of homophobia, whilst widening comfort zones and finding new horizons.", "7.3", ["Comedy", "Drama"]),
           12635 => Movie.new(12635, "Backbeat (1993)", "https://image.tmdb.org/t/p/w500/zhu0d2vqMdmVZ0QAFADtg4UOrTY.jpg", "Chronicles the early days of The Beatles in Hamburg, Germany. The film focuses primarily on the relationship between Stuart Sutcliffe, John Lennon, and Sutcliffes girlfriend Astrid Kirchherr.", "6.0", ["Drama", "Musical"]),
           10497 => Movie.new(10497, "Bitter Moon (1992)", "https://image.tmdb.org/t/p/w500/qU9hqUSGyQfbkEdqluX21nWVcp9.jpg", "A passenger on a cruise ship develops an irresistible infatuation with an eccentric paraplegics wife.", "7.0", ["Drama", "Film-Noir", "Romance"]),
           11382 => Movie.new(11382, "Bullets Over Broadway (1994)", "https://image.tmdb.org/t/p/w500/fUYSGHM5I7mOrErNPY0CGMu0ld0.jpg", "After young playwright, David Shayne obtains funding for his play from gangster Nick Valenti, Nicks girlfriend Olive miraculously lands the role of a psychiatrist�but not only is she a bimbo who could never pass for a psychiatrist�shes a dreadful actress. David puts up with the leading man who is a compulsive eater, the grand dame who wants her part jazzed up, and Olives interfering hitman/bodyguard�but, eventually he must decide whether art or life is more important.", "7.1", ["Comedy"]),
           9331 => Movie.new(9331, "Clear and Present Danger (1994)", "https://image.tmdb.org/t/p/w500/6xTM8FPxrLRYwz6I3fqtwh7xybs.jpg", "CIA Analyst Jack Ryan is drawn into an illegal war fought by the US government against a Colombian drug cartel.", "6.6", ["Action", "Crime", "Drama", "Thriller"]),
           10731 => Movie.new(10731, "Client, The (1994)", "https://image.tmdb.org/t/p/w500/oLdkJ4ZjxPtFSUChdjDQvHM9l75.jpg", "A street-wise kid, Mark Sway, sees the suicide of Jerome Clifford, a prominent Louisiana lawyer, whose current client is Barry The Blade Muldano, a Mafia hit-man. Before Jerome shoots himself, he tells Mark where the body of a Senator is buried. Clifford shoots himself and Mark is found at the scene, and both the FBI and the Mafia quickly realize that Mark probably knows more than he says.", "6.7", ["Drama", "Mystery", "Thriller"]),
           10464 => Movie.new(10464, "Corrina, Corrina (1994)", "https://image.tmdb.org/t/p/w500/xuEubxRGut2Yh118RyNa6ruXXCp.jpg", "When Manny Singers wife dies, his young daughter Molly becomes mute and withdrawn. To help cope with looking after Molly, he hires sassy housekeeper Corrina Washington, who coaxes Molly out of her shell and shows father and daughter a whole new way of life. Manny and Corrinas friendship delights Molly and enrages the other townspeople.", "6.7", ["Comedy", "Drama", "Romance"]),
           34152 => Movie.new(34152, "Crooklyn (1994)", "https://image.tmdb.org/t/p/w500/iFqe07F78SO0SIBzWcK4I5MwNvP.jpg", "From Spike Lee comes this vibrant semi-autobiographical portrait of a school-teacher, her stubborn jazz-musician husband and their five kids living in 70s Brooklyn.", "6.8", ["Comedy", "Drama"]),
           9495 => Movie.new(9495, "Crow, The (1994)", "https://image.tmdb.org/t/p/w500/wF2Tnf0bdYrzCKVbWh0mFwPJS6k.jpg", "Exactly one year after young rock guitarist Eric Draven and his fianc�e are brutally killed by a ruthless gang of criminals, Draven�watched over by a hypnotic crow�returns from the grave to exact revenge.", "7.5", ["Action", "Crime", "Fantasy", "Thriller"]),
           29973 => Movie.new(29973, "Cobb (1994)", "https://image.tmdb.org/t/p/w500/mMBZVyEVTscAzJYSusvg0u304Nu.jpg", "Al Stump is a famous sports-writer chosen by Ty Cobb to co-write his official, authorized autobiography before his death. Cobb, widely feared and despised, feels misunderstood and wants to set the record straight about the greatest ball-player ever, in his words.", "6.1", ["Drama"]),
           888 => Movie.new(888, "Flintstones, The (1994)", "https://image.tmdb.org/t/p/w500/ocsb0qiGlcn6UlcDRHa3xxSCc8Y.jpg", "Modern Stone Age family the Flintstones hit the big screen in this live-action version of the classic cartoon. Fred helps Barney adopt a child. Barney sees an opportunity to repay him when Slate Mining tests its employees to find a new executive. But no good deed goes unpunished.", "5.3", ["Children", "Comedy", "Fantasy"]),
           13 => Movie.new(13, "Forrest Gump (1994)", "https://image.tmdb.org/t/p/w500/saHP97rTPS5eLmrLQEcANmKrsFl.jpg", "A man with a low IQ has accomplished great things in his life and been present during significant historic events�in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.", "8.5", ["Comedy", "Drama", "Romance", "War"]),
           712 => Movie.new(712, "Four Weddings and a Funeral (1994)", "https://image.tmdb.org/t/p/w500/qa72G2VS0bpxms6yo0tI9vsHm2e.jpg", "Over the course of five social occasions, a committed bachelor must consider the notion that he may have discovered love.", "6.8", ["Comedy", "Romance"]),
           16295 => Movie.new(16295, "Higher Learning (1995)", "https://image.tmdb.org/t/p/w500/anLJOkvjwY31NiRoEuZ23yBAZEK.jpg", 'Malik is an African-American student attending on a track scholarship; academics are not his strong suit, and he goes in thinking that his athletic abilities will earn him a free ride through college. Fudge, a "professional student" who has been at Columbus for six years so far, becomes friendly with Malik and challenges his views about race and politics in America.', "6.3", ["Drama"]),
           48992 => Movie.new(48992, "I Like It Like That (1994)", "https://image.tmdb.org/t/p/w500/5KYvQJGgrvceGhsRe8ydSpU7A8a.jpg", "Lisette and husband Chino face marital difficulties. She is fed up with the kids, while he has job troubles. His mother Rosaria hates Lisette and the neighborhood tramp has designs on Chino. Things get even worse when Chino goes to jail and Lisette gets a good job uptown. Can this marriage be saved?", "6.6", ["Comedy", "Drama", "Romance"]),
           10879 => Movie.new(10879, "I Love Trouble (1994)", "https://image.tmdb.org/t/p/w500/lXpbYJQJ7tvYZ8S29Nwpzsh07PN.jpg", "Rival Chicago reporters Sabrina Peterson and Peter Brackett join forces to uncover a train wreck conspiracy.", "5.5", ["Action", "Comedy"]),
           10660 => Movie.new(10660, "It Could Happen to You (1994)", "https://image.tmdb.org/t/p/w500/6UOaeLDOdwwTMQtbl5YL6EGjqy0.jpg", "Charlie Lang is a simple, kindhearted New York City cop. When he realizes he has no money to tip waitress Yvonne Biasi, Lang offers her half the winnings of his lottery ticket. Amazingly, the ticket happens to be a winner, in the sum of $4 million. True to his word, Lang proceeds to share the prize money with Biasi, which infuriates his greedy wife, Muriel. Not content with the arrangement, Muriel begins scheming to take all the money.", "6.5", ["Comedy", "Drama", "Romance"]),
           10714 => Movie.new(10714, "Jungle Book, The (1994)", "https://image.tmdb.org/t/p/w500/rYoE6cuup9Ofam6AuYaiJLxF9OO.jpg", "Raised by wild animals since childhood, Mowgli is drawn away from the jungle by the beautiful Kitty. But Mowgli must eventually face corrupt Capt. Boone, who wants both Kittys hand and the treasures of Monkey City � a place only Mowgli can find.", "5.9", ["Adventure", "Children", "Romance"]),
           41647 => Movie.new(41647, "Wonderful, Horrible Life of Leni Riefenstahl, The (Macht der Bilder: Leni Riefenstahl, Die) (1993)", "https://image.tmdb.org/t/p/w500/aRmw4NFnLHJSmUKqsMJyr6XXLNI.jpg", "This documentary recounts the life and work of one of most famous, and yet reviled, German film directors in history, Leni Riefenstahl. The film recounts the rise of her career from a dancer, to a movie actor to the most important film director in Nazi Germany who directed such famous propaganda films as Triumph of the Will and Olympiad. The film also explores her later activities after Nazi Germanys defeat in 1945 and her disgrace for being so associated with it which includes her amazingly active life over the age of 90.", "7.1", ["Documentary"]),
           8587 => Movie.new(8587, "Lion King, The (1994)", "https://image.tmdb.org/t/p/w500/sKCr78MXSLixwmZ8DyJLrpMsd15.jpg", "A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?", "8.3", ["Adventure", "Animation", "Children", "Drama", "Musical", "IMAX"]),
           1689 => Movie.new(1689, "Little Buddha (1993)", "https://image.tmdb.org/t/p/w500/xy70xtdoKZ3PxlKkakwdhL3UFDQ.jpg", "After the death of Lama Dorje, Tibetan Buddhist monks find three children � one American and two Nepalese � who may be the rebirth of their great teacher.", "6.3", ["Drama"]),
           11596 => Movie.new(11596, "Wes Cravens New Nightmare (Nightmare on Elm Street Part 7: Freddys Finale, A) (1994)", "https://image.tmdb.org/t/p/w500/eN3UZUYapJ2CJCD9dN0LUZLouKa.jpg", "As Heather Langenkamp considers making another Nightmare on Elm Street film with Wes Craven, her son, Dylan, falls under the spell of the iconic disfigured villain Freddy Krueger. Eventually, Langenkamp must confront Freddys demonic spirit to save the soul of Dylan.", "6.4", ["Drama", "Horror", "Mystery", "Thriller"]),
           854 => Movie.new(854, "Mask, The (1994)", "https://image.tmdb.org/t/p/w500/zJUvFtaGPQkcQYE8nmhU66ESpWe.jpg", "When timid bank clerk Stanley Ipkiss discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle. Unfortunately, under the masks influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell, whose goons get blamed for the heist.", "6.9", ["Action", "Comedy", "Crime", "Fantasy"]),
           9359 => Movie.new(9359, "Maverick (1994)", "https://image.tmdb.org/t/p/w500/cf4L3VW5nEHIaU3pOMZSIoBQmDP.jpg", "Maverick is a gambler who would rather con someone than fight them, and needs an additional three thousand dollars in order to enter a winner-takes-all poker game that begins in a few days, so he joins forces with a woman gambler with a marvellous southern accent, and the two try and enter the game.", "6.8", ["Adventure", "Comedy", "Western"]),
           23333 => Movie.new(23333, "Mrs. Parker and the Vicious Circle (1994)", "https://image.tmdb.org/t/p/w500/vBfvtwMWiYMS6FmvHaALDYRJPLJ.jpg", "Dorothy Parker remembers the heyday of the Algonquin Round Table, a circle of friends whose barbed wit, like hers, was fueled by alcohol and flirted with despair.", "6.2", ["Drama"]),
           36593 => Movie.new(36593, "Naked Gun 33 1/3: The Final Insult (1994)", "https://image.tmdb.org/t/p/w500/p0AYsdgkudR9P5fNV5AjzbwQt8W.jpg", "Frank Drebin is persuaded out of retirement to go undercover in a state prison. There he has to find out what top terrorist, Rocco, has planned for when he escapes. Adding to his problems, Franks wife, Jane, is desperate for a baby.", "6.5", ["Action", "Comedy"]),
           12280 => Movie.new(12280, "Paper, The (1994)", "https://image.tmdb.org/t/p/w500/pGPrFbucRLwVtCKCeinwAklAl0l.jpg", "Henry Hackett is the workaholic editor of a New York City tabloid. He loves his job, but the long hours and low pay are leading to discontent. Also, publisher Bernie White faces financial straits, and has hatchet-man Alicia Clark�Henrys nemesis�impose unpopular cutbacks.", "6.6", ["Comedy", "Drama"]),
           2788 => Movie.new(2788, "Reality Bites (1994)", "https://image.tmdb.org/t/p/w500/qGDhodtpkpxkrFqokenGNJlzt6w.jpg", "A small circle of friends suffering from post-collegiate blues must confront the hard truth about life, love and the pursuit of gainful employment. As they struggle to map out survival guides for the future, the Gen-X quartet soon begins to realize that reality isnt all its cracked up to be.", "6.6", ["Comedy", "Drama", "Romance"]),
           10427 => Movie.new(10427, "Red Rock West (1992)", "https://image.tmdb.org/t/p/w500/ewofUEqU3Gpr7WSgSz3TEVPIfBg.jpg", "When a promised job for Texan Michael fails to materialise in Wyoming, Mike is mistaken by Wayne to be the hitman he hired to kill his unfaithful wife, Suzanne. Mike takes full advantage of the situation, collects the money and runs. During his getaway, things go wrong, and soon get worse when he runs into the real hitman, Lyle.", "6.6", ["Thriller"]),
           11011 => Movie.new(11011, "Richie Rich (1994)", "https://image.tmdb.org/t/p/w500/qgGh5d0IHAZRlHIdFS3XWVygumR.jpg", "Billionaire heir Richie Rich has it all, including Reggie Jackson as a batting coach and Claudia Schiffer as a personal trainer -- but no playmates. Whats more, scoundrel Laurence Van Dough is scheming to take over the family empire. Uh-oh! Enter faithful butler Cadbury to save the day.", "5.9", ["Children", "Comedy"]),
           8987 => Movie.new(8987, "River Wild, The (1994)", "https://image.tmdb.org/t/p/w500/mlFa4nZpx5Cxe0K4dhRXpx5LsbJ.jpg", "While on a family vacation,  rafting expert Gail takes on a pair of armed killers while navigating a spectacularly violent river.", "6.4", ["Action", "Thriller"]),
           1637 => Movie.new(1637, "Speed (1994)", "https://image.tmdb.org/t/p/w500/o1Zs7VaS9y2GYH9CLeWxaVLWd3x.jpg", "Los Angeles SWAT cop Jack Traven is up against bomb expert Howard Payne, whos after major ransom money. First its a rigged elevator in a very tall building. Then its a rigged bus--if it slows, it will blow, bad enough any day, but a nightmare in LA traffic. And thats still not the end.", "7.1", ["Action", "Romance", "Thriller"]),
           15128 => Movie.new(15128, "Speechless (1994)", "https://image.tmdb.org/t/p/w500/yqTG4PFZjNxIjuBtQBSr1Einl23.jpg", "In the midst of election season in New Mexico, political speechwriters Julia Mann and Kevin Vallick begin a romance, unaware they are working for candidates on opposite sides.", "5.8", ["Comedy", "Romance"]),
           8831 => Movie.new(8831, "Timecop (1994)", "https://image.tmdb.org/t/p/w500/qDjne2UffjOpZAg9cFmzteWqhd3.jpg", "An officer for a security agency that regulates time travel, must fend for his life against a shady politician who has a tie to his past.", "6.0", ["Action", "Sci-Fi", "Thriller"]),
           36955 => Movie.new(36955, "True Lies (1994)", "https://image.tmdb.org/t/p/w500/pweFTnzzTfGK68woSVkiTgjLzWm.jpg", "A fearless, globe-trotting, terrorist-battling secret agent has his life turned upside down when he discovers his wife might be having an affair with a used car salesman while terrorists smuggle nuclear war heads into the United States.", "7.0", ["Action", "Adventure", "Comedy", "Romance", "Thriller"]),
           10449 => Movie.new(10449, "When a Man Loves a Woman (1994)", "https://image.tmdb.org/t/p/w500/cA1uMNX3sdWAWfMZbsgm1VIJYSY.jpg", "An airline pilot and his wife are forced to face the consequences of her alcoholism when her addictions threaten her life and their daughters safety. While the woman enters detox, her husband must face the truth of his enabling behavior.", "6.5", ["Drama", "Romance"]),
           10395 => Movie.new(10395, "Wolf (1994)", "https://image.tmdb.org/t/p/w500/8ocZb9x6rN82i8ZzZ05j1vWKVOC.jpg", "Publisher Will Randall becomes a werewolf and has to fight to keep his job.", "6.1", ["Drama", "Horror", "Romance", "Thriller"]),
           12160 => Movie.new(12160, "Wyatt Earp (1994)", "https://image.tmdb.org/t/p/w500/51LItgyecu2KMAtIchYogEykCIu.jpg", "Covering the life and times of one of the Wests most iconic heroes Wyatt Earp weaves an intricate tale of Earp and his friends and family. With a star studded cast, sweeping cinematography and authentic costumes Wyatt Earp led the way during the Western revival in the 90s.", "6.7", ["Western"]),
           40480 => Movie.new(40480, "Bad Company (1995)", "https://image.tmdb.org/t/p/w500/5q5r3cpaTDByz4qko9ZWHlK3gMF.jpg", "Nelson Crowe is a CIA operative under the thumb of the Company for a disputed delivery of $50,000 in gold. They blackmail him into working for the Grimes Organization, which is set up as a private company for hire, to blackmail prominent individuals. Crowe, working with Margaret Wells (another former Covert Operations operative), blackmails and bribes a State Supreme Court judge, but the deal sours. One of Crowes co-workers, Tod Stapp, discovers Crowes current CIA involvement in a plot to overthrow Grimes, and blackmails him to be cut in on the deal. More blackmail occurs as Wells manipulates Crowe to kill Grimes, then the CIA uses that discovery to blackmail Wells into killing Crowe. Who can you trust???", "4.7", ["Action", "Crime", "Drama"]),
           52038 => Movie.new(52038, "Man of No Importance, A (1994)", "https://image.tmdb.org/t/p/w500/nSBeudgK6eFA1kzSAR4b8ndZked.jpg", 'Alfie Byrne is a middle-aged bus conductor in Dublin in 1963. He would appear to live a life of quiet desperation: hes gay, but firmly closeted, and his sister is always trying to find him "the right girl". His passion is Oscar Wilde, his hobby is putting on amateur theatre productions in the local church hall. We follow him as he struggles with temptation, friendship, disapproval, and the conservative yet oddly lyrical world of Ireland in the early 1960s.', "6.1", ["Drama"]),
           29444 => Movie.new(29444, "S.F.W. (1994)", "https://image.tmdb.org/t/p/w500/3bq91jWCReRrqlPn81alSoxeXoP.jpg", "An alienated and misanthropic teenager gains sudden and unwanted celebrity status after hes taken hostage by terrorists where his indifference to their threats to kill him makes news headlines.", "5.6", ["Drama"]),
           26352 => Movie.new(26352, "Low Down Dirty Shame, A (1994)", "https://image.tmdb.org/t/p/w500/v5XUfLrdoGfatObGXhqckYTNqFT.jpg", "A black detective becomes embroiled in a web of danger while searching for a fortune in missing drug money. During the course of his investigation, he encounters various old connections, ultimately confronting the criminal responsible for Shames expulsion from the force. He must also deal with two women, Angela, a beautiful old flame, and Peaches, his energetic but annoying sidekick.", "5.8", ["Action", "Comedy"]),
           39953 => Movie.new(39953, "Boys Life (1995)", "https://image.tmdb.org/t/p/w500/jXKecGbSp36C486myi1pbe6EKAI.jpg", 'Each of the three short films in this collection presents a young gay man at the threshold of adulthood. In "Pool Days," Justin is a 17-year old Bethesda lad, hired as the evening life guard at a fitness center. In the course of the summer, he realizes and embraces that hes gay. In "A Friend of Dorothy," Winston arrives from upstate for his freshman year at NYU. He has to figure out, with some help from Anne, a hometown friend, how to build a social life as a young gay man in the city. In "The Disco Years," Tom looks back on 1978, the year in high school that he came out of the closet after one joyful and several painful encounters', "4.5", ["Drama"]),
           41580 => Movie.new(41580, "Colonel Chabert, Le (1994)", "https://image.tmdb.org/t/p/w500/duOTjp26TrGoGo2JsvZWYiqGLwX.jpg", 'Colonel Chabert has been severely wounded in the French-Russian Napoleonic war to the point that the medical examiner has signed his death certificate. When he regains his health and memory, he goes back to Paris, where his "widow", Anne has married the Count Ferraud and is financing his rise to power using Chaberts money. Chabert hires a lawyer to help him get back his money and his honor.', "6.3", ["Drama", "Romance", "War"]),
           315 => Movie.new(315, "Faster Pussycat! Kill! Kill! (1965)", "https://image.tmdb.org/t/p/w500/4mld2L1vWqgqFQmKa7KU4HzLKPi.jpg", "Three strippers seeking thrills encounter a young couple in the desert. After dispatching the boyfriend, they take the girl hostage and begin scheming on a crippled old man living with his two sons in the desert, reputedly hiding a tidy sum of cash. They become house guests of the old man and try and seduce the sons in an attempt to locate the money, not realizing that the old man has a few sinister intentions of his own.", "6.5", ["Action", "Crime", "Drama"]),
           22067 => Movie.new(22067, "Jasons Lyric (1994)", "https://image.tmdb.org/t/p/w500/y3ZZJFdTYd4SezXv1gjRv19Jy32.jpg", "The story of a young man who must confront his own fears about love as well as his relationships with family and friends.", "6.7", ["Crime", "Drama"]),
           11667 => Movie.new(11667, "Street Fighter (1994)", "https://image.tmdb.org/t/p/w500/4ZJY8OSYtSQ5E0isMgjEesGN0re.jpg", "Col. Guile and various other martial arts heroes fight against the tyranny of Dictator M. Bison and his cohorts.", "4.5", ["Action", "Adventure", "Fantasy"]),
           8011 => Movie.new(8011, "Highlander III: The Sorcerer (a.k.a. Highlander: The Final Dimension) (1994)", "https://image.tmdb.org/t/p/w500/o4GKLReSGRR0rulOBS9SrfFAXOz.jpg", "Starts off in the 15th century, with Connor McLeod training with another immortal swordsman, the Japanese sorcerer Nakano. When an evil immortal named Kane kills the old wizard, the resulting battle leaves him buried in an underground cave. When Kane resurfaces in the 20th century to create havoc, its up to McLeod to stop him.", "4.7", ["Action", "Fantasy"]),
           171857 => Movie.new(171857, "Federal Hill (1994)", "https://image.tmdb.org/t/p/w500/qChLfULhgAhWHG9LbcBIv80r32i.jpg", "In Providences Italian neighborhood, Federal Hill, five young are immersed in drugs, crime and violence. Everything changes when one of the guys in the band know love.", "5.0", ["Drama"]),
           2654 => Movie.new(2654, "In the Mouth of Madness (1995)", "https://image.tmdb.org/t/p/w500/tvGoySYpR0ZBXeqsS7nT9peFsrn.jpg", "An insurance investigator begins discovering that the impact a horror writers books have on his fans is more than inspirational.", "7.2", ["Horror", "Thriller"]),
           18069 => Movie.new(18069, "8 Seconds (1994)", "https://image.tmdb.org/t/p/w500/wqKVkOveZrK6zwfrptGLVPmnMpR.jpg", "This film chronicles the life of Lane Frost, 1987 PRCA Bull Riding World Champion, his marriage and his friendships with Tuff Hedeman (three-time World Champion) and Cody Lambert.", "7.5", ["Drama"]),
           19092 => Movie.new(19092, "Above the Rim (1994)", "https://image.tmdb.org/t/p/w500/q7CCx8aj8uME1fBa4KzTMdeWxXu.jpg", "Story of a promising high school basketball star and his relationships with two brothers, one a drug dealer and the other a former basketball star fallen on hard times and now employed as a security guard.", "6.9", ["Crime", "Drama"]),
           2758 => Movie.new(2758, "Addams Family Values (1993)", "https://image.tmdb.org/t/p/w500/8znyj20O3EYLD2EzWnZQMnkE4zH.jpg", 'Siblings Wednesday and Pugsley Addams will stop at nothing to get rid of Pubert, the new baby boy adored by parents Gomez and Morticia. Things go from bad to worse when the new "black widow" nanny, Debbie Jellinsky, launches her plan to add Fester to her collection of dead husbands.', "6.9", ["Children", "Comedy", "Fantasy"]),
           10436 => Movie.new(10436, "Age of Innocence, The (1993)", "https://image.tmdb.org/t/p/w500/L4SPzBfJtvpNRZsuF30Mm607X6.jpg", "Tale of 19th century New York high society in which a young lawyer falls in love with a woman separated from her husband, while he is engaged to the womans cousin.", "7.0", ["Drama"]),
           13595 => Movie.new(13595, "Airheads (1994)", "https://image.tmdb.org/t/p/w500/4xPG8pPMyeoec48gKWbbC85EC8j.jpg", "The Lone Rangers have heavy-metal dreams and a single demo tape they cant get anyone to play. The solution: Hijack an AM rock station and hold the deejays hostage until they agree to broadcast the bands tape.", "6.0", ["Comedy"]),
           46094 => Movie.new(46094, "Air Up There, The (1994)", "https://image.tmdb.org/t/p/w500/lY1yhtg0DRaMTzclYCXo0sP1kAV.jpg", "Jimmy Dolan is a college basketball coach who wants a big promotion. To get it, he needs to make a dramatic find. He ends up deep in Africa, hoping to recruit Saleh, a huge basketball prodigy Jimmy glimpsed in a home movie. But Saleh is the chiefs son and has responsibilities at home, since the tribes land is threatened by a mining company with its own hotshot basketball team.", "6.2", ["Comedy"]),
           9409 => Movie.new(9409, "Another Stakeout (1993)", "https://image.tmdb.org/t/p/w500/sBBDKCx8mBqDkYkPCiyKcqKpJbh.jpg", "Chris and Bill are called upon for their excellent surveillance record to stakeout a lakeside home where a Mafia trial witness is believed to be heading or already hiding.", "5.5", ["Comedy", "Thriller"]),
           11853 => Movie.new(11853, "Bad Girls (1994)", "https://image.tmdb.org/t/p/w500/cXY79luLXt2dzUP2Tx601zpZFzK.jpg", "Four former harlots try to leave the wild west (Colorado, to be exact) and head north to make a better life for themselves. Unfortunately someone from Codys past wont let it happen that easily.", "5.4", ["Western"]),
           16771 => Movie.new(16771, "Barcelona (1994)", "https://image.tmdb.org/t/p/w500/7dgX3naR9EsFMvQhwHY8My6r5FR.jpg", "During the 1980s, uptight Ted Boynton is a salesman working in the Barcelona office of a Chicago-based company. He receives an unexpected visit from his cousin Fred, a naval officer who has come to Spain on a public relations mission for a U.S. fleet. Not exactly friends in the past, Ted and Fred strike up relationships with women in the Spanish city and experience conflicts -- Ted with his employer, and Fred with the Barcelona community.", "6.3", ["Comedy", "Romance"]),
           46924 => Movie.new(46924, "Being Human (1993)", "https://image.tmdb.org/t/p/w500/uKk1WFT9iRWj8zy4Q8SWB8FTU26.jpg", "One man must learn the meaning of courage across four lifetimes centuries apart.", "5.1", ["Drama"]),
           11041 => Movie.new(11041, "Beverly Hillbillies, The (1993)", "https://image.tmdb.org/t/p/w500/refYLEQvzkY63i2IHronCPQODex.jpg", "Jed Clampett and kin move from Arkansas to Beverly Hills when he becomes a billionaire, after an oil strike. The country folk are very naive with regard to life in the big city, so when Jed starts a search for a new wife there are inevitably plenty of takers and con artists ready to make a fast buck", "6.2", ["Comedy"]),
           306 => Movie.new(306, "Beverly Hills Cop III (1994)", "https://image.tmdb.org/t/p/w500/7vIpCkgGEfk5LZwm78nMxswLJRH.jpg", "Back in sunny southern California and on the trail of two murderers, Axel Foley again teams up with LA cop Billy Rosewood. Soon, they discover that an amusement park is being used as a front for a massive counterfeiting ring � and its run by the same gang that shot Billys boss.", "5.9", ["Action", "Comedy", "Crime", "Thriller"]),
           14522 => Movie.new(14522, "Black Beauty (1994)", "https://image.tmdb.org/t/p/w500/5uH60FBDPQoyAnc4uvU0fIB8JXv.jpg", "The fates of horses, and the people who own and command them, are revealed as Black Beauty narrates the circle of his life.", "6.7", ["Adventure", "Children", "Drama"]),
           26203 => Movie.new(26203, "Blink (1994)", "https://image.tmdb.org/t/p/w500/yNlatJk6C2zYTqAUkaxtBJQKQSf.jpg", 'Emma is an attractive girl in her 20s who has been blind for 20 years. A new type of eye operation partially restores her sight, but she is having problems: sometimes she doesnt "remember" what shes seen until later. One night she is awakened by a commotion upstairs. Peering out of her door, she sees a shadowy figure descending the stairs. Convinced that her neighbour has been murdered she approaches the police, only to find that she is unsure if it was just her new eyes playing tricks on her.', "6.1", ["Thriller"]),
           178 => Movie.new(178, "Blown Away (1994)", "https://image.tmdb.org/t/p/w500/kiV3KcjE0bVgfMwRG9HhRFG8Ggq.jpg", "Blown Away tells the story of Jimmy Dove who works for the Boston bomb squad. Shortly after Dove leaves the force his partner is killed by a bomb that Dove thinks might have been made by someone he knows.", "6.1", ["Action", "Thriller"]),
           19819 => Movie.new(19819, "Blue Chips (1994)", "https://image.tmdb.org/t/p/w500/tO71i4Ob64tchCRBB5MoqonPKAF.jpg", "Pete Bell, a college basketball coach is under a lot of pressure. His team isnt winning and he cannot attract new players. The stars of the future are secretly being paid by boosters. This practice is forbidden in the college game, but Pete is desperate and has pressures from all around.", "6.0", ["Drama"]),
           57834 => Movie.new(57834, "Blue Sky (1994)", "https://image.tmdb.org/t/p/w500/zG40OnO4Y98lo1iDHyFo5TaZyP1.jpg", "Hank Marshall is a tough, square-jawed, straitlaced Army engineer and nuclear science expert, assigned to help conduct weapons-testing in 1950s America. Hank has become a thorn in the side of the Army, though, for a couple of very different reasons. He is an outspoken opponent of atmospheric testing, though his superiors hold contrary views and want to squelch his concerns...and his reports. The other problem is his wife, Carly. She is voluptuous and volatile, wreaking havoc in his personal life and stirring up intrigue at each new Army base.", "6.1", ["Drama", "Romance"]),
           4722 => Movie.new(4722, "Body Snatchers (1993)", "https://image.tmdb.org/t/p/w500/s8WdtuOBvfEsuPtbQVpNfEgd5aR.jpg", "When Environmental Protection Agency inspector Steve Malone travels to a remote military base in order to check for toxic materials, he brings his family along for the ride. After arriving at the base, his teenage daughter Marti befriends Jean Platt, daughter of the bases commander, General Platt. When people at the base begin acting strangely, Marti becomes convinced that they are slowly being replaced by plant-like aliens.", "6.1", ["Horror", "Sci-Fi", "Thriller"]),
           18215 => Movie.new(18215, "Boxing Helena (1993)", "https://image.tmdb.org/t/p/w500/fL8b32TY3Cxe661kztmzz5AlIM0.jpg", "A top surgeon is besotted with a beautiful woman who once rebuffed him. Unable to come to terms with life without her, he tries to convince her that they need each other. She has other ideas, but a horrific accident leaves her at his mercy.", "5.3", ["Drama", "Mystery", "Romance", "Thriller"]),
           1607 => Movie.new(1607, "Bronx Tale, A (1993)", "https://image.tmdb.org/t/p/w500/sDbO6LmLYtyqAoFTPpRcMgPSCEO.jpg", "Set in the Bronx during the tumultuous 1960s, an adolescent boy is torn between his honest, working-class father and a violent yet charismatic crime boss. Complicating matters is the youngsters growing attraction - forbidden in his neighborhood - for a beautiful black girl.", "7.8", ["Drama"]),
           26391 => Movie.new(26391, "Cabin Boy (1994)", "https://image.tmdb.org/t/p/w500/xy2BzE3siqU67VQCQ2k4xideNNM.jpg", "A foul-mouthed finishing school graduate mistakenly winds up on an ill-fated fishing boat, and faces the wrath of a crew that considers him bad luck.", "5.0", ["Comedy"]),
           117553 => Movie.new(117553, "Calendar Girl (1993)", "https://image.tmdb.org/t/p/w500/ljSqZTl5oophHsH1Qtyv7AF2BW6.jpg", "Three young men go on an end of the summer trip to Hollywood, California. Their quest: to fulfill the fantasy of meeting Marilyn Monroe.", "5.0", ["Comedy", "Drama"]),
           6075 => Movie.new(6075, "Carlitos Way (1993)", "https://image.tmdb.org/t/p/w500/gFmTr2OJ8RCNAbWQh6maL00PY75.jpg", "A Puerto-Rican ex-con, just released from prison, pledges to stay away from drugs and violence despite the pressure around him, and lead a better life outside NYC.", "7.8", ["Crime", "Drama"]),
           11310 => Movie.new(11310, "City Slickers II: The Legend of Curlys Gold (1994)", "https://image.tmdb.org/t/p/w500/gh0lsyJARglhpbKmnY8i8M7V5bI.jpg", "Mitch Robbins 40th birthday begins quite well until he returns home and finds his brother Glen, the black sheep of the family, in his sofa. Nevertheless he is about to have a wonderful birthday-night with his wife when he discovers a treasure map of Curly by chance. Together with Phil and unfortunately Glen he tries to find the hidden gold of Curlys father in the desert of Arizona.", "5.2", ["Adventure", "Comedy", "Western"]),
           18658 => Movie.new(18658, "Clean Slate (1994)", "https://image.tmdb.org/t/p/w500/kAYsvQvBVshLHGTIDGHcj9jTJq0.jpg", "Pogue is a private eye with a problem: every morning when he wakes up, he has total amnesia, waking up with a blank slate. Since he is in the middle of a hot investigation and has a developing romance, this is less than convenient.", "5.6", ["Comedy"]),
           9350 => Movie.new(9350, "Cliffhanger (1993)", "https://image.tmdb.org/t/p/w500/8v2nPPLvhEVlfXu08UZ0djK31be.jpg", "A year after losing his friend in a tragic 4,000-foot fall, former ranger Gabe Walker and his partner, Hal, are called to return to the same peak to rescue a group of stranded climbers, only to learn the climbers are actually thieving hijackers who are looking for boxes full of money.", "6.4", ["Action", "Adventure", "Thriller"]),
           9612 => Movie.new(9612, "Coneheads (1993)", "https://image.tmdb.org/t/p/w500/kmD0llGIO4LXSkIqCIlswWQ2Hy3.jpg", "A pair of aliens arrive on Earth to prepare for invasion, but crash instead. With enormous cone-shaped heads, robotlike walks and an appetite for toilet paper, aliens Beldar and Prymatt dont exactly blend in with the population of Paramus, N.J. But for some reason, everyone believes them when they say theyre from France.", "5.3", ["Comedy", "Sci-Fi"]),
           2124 => Movie.new(2124, "Color of Night (1994)", "https://image.tmdb.org/t/p/w500/w1OBPkf3BxeC7543YzFwiKIwBFJ.jpg", "When New York psychiatrist Bill Capa visits Los Angeles to take over his murdered colleagues therapy group, he finds himself embroiled in the thick of a mystery when he bumps into Rose and begins a torrid affair.", "5.7", ["Drama", "Thriller"]),
           26261 => Movie.new(26261, "Cops and Robbersons (1994)", "https://image.tmdb.org/t/p/w500/wnkWgFU5UcLwbExCp1YtCg5Ox4E.jpg", "Hard-as-nails cop, Jake Stone moves in with the Robbersons so he can watch a hitman who has moved in next door. The Hitman is one thing�but can you survive the Robberson family.", "5.2", ["Comedy"]),
           19176 => Movie.new(19176, "Cowboy Way, The (1994)", "https://image.tmdb.org/t/p/w500/r7sckMs1xy4fXYGzzs6anofu10F.jpg", "Two championship rodeo partners travel to New York to find their missing friend, Nacho Salazar who went missing there.", "5.5", ["Action", "Comedy", "Drama"]),
           11566 => Movie.new(11566, "Dave (1993)", "https://image.tmdb.org/t/p/w500/wIUuf1NFchdCJe833JBTiSMzqfv.jpg", "A sweet-natured Temp Agency operator and amateur Presidential look-alike is recruited by the Secret Service to become a temporary stand-in for the President of the United States.", "6.6", ["Comedy", "Romance"]),
           9571 => Movie.new(9571, "Dazed and Confused (1993)", "https://image.tmdb.org/t/p/w500/msG9awbLhVZwv1Eh9Ge7SofMexW.jpg", 'The adventures of a group of Texas teens on their last day of school in 1976, centering on student Randall Floyd, who moves easily among stoners, jocks and geeks. Floyd is a star athlete, but he also likes smoking weed, which presents a conundrum when his football coach demands he sign a "no drugs" pledge.', "7.4", ["Comedy"]),
           9739 => Movie.new(9739, "Demolition Man (1993)", "https://image.tmdb.org/t/p/w500/49GjSZn9FnSnrRFmsA4x5WAj8oB.jpg", "Simon Phoenix, a violent criminal cryogenically frozen in 1996, escapes during a parole hearing in 2032 in the utopia of San Angeles. Police are incapable of dealing with his violent ways and turn to his captor, who had also been cryogenically frozen after being wrongfully accused of killing 30 innocent people while apprehending Phoenix.", "6.6", ["Action", "Adventure", "Sci-Fi"]),
           34444 => Movie.new(34444, "Even Cowgirls Get the Blues (1993)", "https://image.tmdb.org/t/p/w500/o8DkDcsLd8H38hj46HLmT81swgZ.jpg", "Sissy Hankshaw is born with enormous thumbs that help her hitchhiking through the US from a young age.  She becomes a model in advertising and her NY agent the Countess sends her to his ranch in CA to shoot a commercial, set against the background of mating whooping cranes.  There, she befriends Bonanza Jellybean, one of the cowgirls at the beauty- ranch.", "4.2", ["Comedy", "Romance"]),
           26141 => Movie.new(26141, "Fatal Instinct (1993)", "https://image.tmdb.org/t/p/w500/syewFnehGbbya5BdxoHLzrcm5Ne.jpg", "A spoof of the late 80s and early 90s suspense thrillers and murder mysteries, including Basic Instinct, Sleeping With The Enemy, Cape Fear and others. A cop/attorney (yes hes both) is seduced by a woman while his wife is having an affair with a mechanic. Lots of other sublots and visual gags in the style of Naked Gun.", "5.5", ["Comedy"]),
           10997 => Movie.new(10997, "Farewell My Concubine (Ba wang bie ji) (1993)", "https://image.tmdb.org/t/p/w500/f54hNIiHNINw3JiUJB2XaQl5wCN.jpg", 'Abandoned by his prostitute mother in 1920, Douzi was raised by a theater troupe. There he meets Shitou and over the following years the two develop an act entitled "Farewell My Concubine" that brings them fame and fortune. When Shitou marries Juxian, Douzi becomes jealous, the beginnings of the acting duos explosive breakup and tragic fall take root.', "7.9", ["Drama", "Romance"]),
           10443 => Movie.new(10443, "Fearless (1993)", "https://image.tmdb.org/t/p/w500/yiCAa85nJJDFiq0LmZ2Fgvu4RgY.jpg", "After a terrible air disaster, survivor Max Klein emerges a changed person. Unable to connect to his former life or to wife Laura, he feels godlike and invulnerable. When psychologist Bill Perlman is unable to help Max, he has Max meet another survivor, Carla Rodrigo, who is wracked with grief and guilt since her baby died in the crash which she and Max survived.", "6.9", ["Drama"]),
           20239 => Movie.new(20239, "Fear of a Black Hat (1994)", "https://image.tmdb.org/t/p/w500/llfg13wnc91BK366qDm5ZebQLTp.jpg", "Chronicling the controversial career of bad boys N.W.H. (Niggaz With Hats), this uproarious mockumentary lampoons all of hardcore raps hot-button issues. This underground laugh riot recounts the rise, fall and resurrection of a clueless bunch of would-be rappers, Ice Cold, Tone-Def &amp; Tasty Taste performing as N.W.H.", "5.7", ["Comedy"]),
           16297 => Movie.new(16297, "With Honors (1994)", "https://image.tmdb.org/t/p/w500/4THzM8Ng0FXOkWtQCZEaHC5fMu3.jpg", "Convinced hell graduate with honors because of his thesis paper, a stuffy Harvard student finds his paper being held hostage by a homeless man, who might be the guy to school the young man in life.", "6.8", ["Comedy", "Drama"]),
           18551 => Movie.new(18551, "Flesh and Bone (1993)", "https://image.tmdb.org/t/p/w500/gNaZSODlVRiQltGWjS8vQZEYJTq.jpg", "Some thirty years after Arlis witnesses his father murdering a family, he runs into Kay, who happens to be the familys baby who was spared. Kay and Arlis suspect nothing about each other, but when his father returns, old wounds are reopened.", "6.1", ["Drama", "Mystery", "Romance"]),
           25440 => Movie.new(25440, "Widows Peak (1994)", "https://image.tmdb.org/t/p/w500/xXyVUwvJesJJChzpvn7xj5cAOfm.jpg", "Scandal and mystery reign following the arrival of Edwina in a small Irish town populated entirely by widows. Edwina quickly falls out with the locals while also falling in with the son of the communitys leader", "6.5", ["Drama"]),
           9024 => Movie.new(9024, "For Love or Money (1993)", "https://image.tmdb.org/t/p/w500/x1twBUsthHeA7FwOxPpQWtJb9zy.jpg", "New York concierge Doug Ireland wants to go into business for himself and refurbish a hotel on Roosevelt Island, N.Y., but he needs an investor. With a few weeks left before his option on the site runs out, Doug agrees to help wealthy Christian Hanover conceal his affair with salesgirl Andy Hart from his wife. Despite his own attraction to Andy, Doug tries to stay focused on getting Christian to invest $3 million in his project.", "6.2", ["Comedy", "Romance"]),
           37233 => Movie.new(37233, "Firm, The (1993)", "https://image.tmdb.org/t/p/w500/kFexXCzidkm4LwlgZqxsJsDQB5v.jpg", "Mitch McDeere is a young man with a promising future in Law. About to sit his Bar exam, he is approached by The Firm and made an offer he doesnt refuse. Seduced by the money and gifts showered on him, he is totally oblivious to the more sinister side of his company. Then, two Associates are murdered. The FBI contact him, asking him for information and suddenly his life is ruined. He has a choice - work with the FBI, or stay with the Firm. Either way he will lose his life as he knows it. Mitch figures the only way out is to follow his own plan...", "6.7", ["Drama", "Thriller"]),
           1634 => Movie.new(1634, "Free Willy (1993)", "https://image.tmdb.org/t/p/w500/9iBgd9gi9ztWiVcYSG6zl8wDFBN.jpg", "When maladjusted orphan Jesse vandalizes a theme park, he is placed with foster parents and must work at the park to make amends. There he meets Willy, a young Orca whale who has been separated from his family. Sensing kinship, they form a bond and, with the help of kindly whale trainer Rae Lindley, develop a routine of tricks. However, greedy park owner Dial soon catches wind of the duo and makes plans to profit from them.", "6.2", ["Adventure", "Children", "Drama"]),
           13815 => Movie.new(13815, "Fresh (1994)", "https://image.tmdb.org/t/p/w500/uXRIIUzjDZZdWR2cUzPJ9eAqaHv.jpg", "Michael is a 12-year-old drug pusher who lives in a crowded house with his cousins and aunt. His father has become a street bum, but still meets with Fresh on occasion to play chess. Fresh is rather quiet in a crazy world. Freshs sister is a junkie who sleeps with the dealers that Fresh sells for. As the story progresses Fresh realizes that he doesnt want to sell drugs anymore, he wants revenge.", "7.2", ["Crime", "Drama", "Thriller"]),
           5503 => Movie.new(5503, "Fugitive, The (1993)", "https://image.tmdb.org/t/p/w500/b3rEtLKyOnF89mcK75GXDXdmOEf.jpg", "Wrongfully convicted of murdering his wife and sentenced to death, Richard Kimble escapes from the law in an attempt to find the real killer and clear his name.", "7.4", ["Thriller"]),
           35588 => Movie.new(35588, "Geronimo: An American Legend (1993)", "https://image.tmdb.org/t/p/w500/rmbeg5wHVjC68G00SKQ0xZQpZru.jpg", "The Apache Indians have reluctantly agreed to settle on a US Government approved reservation. Not all the Apaches are able to adapt to the life of corn farmers. One in particular, Geronimo, is restless. Pushed over the edge by broken promises and necessary actions by the government, Geronimo and thirty or so other warriors form an attack team which humiliates the government by evading capture, while reclaiming what is rightfully theirs.", "6.3", ["Drama", "Western"]),
           2087 => Movie.new(2087, "Getaway, The (1994)", "https://image.tmdb.org/t/p/w500/4tWvZ4BQu3ICmtUL8lXHa9OgkoF.jpg", 'Doc McCoy is put in prison because his partners chickened out and flew off without him after exchanging a prisoner with a lot of money. Doc knows Jack Benyon, a rich "business"-man, is up to something big, so he tells his wife (Carol McCoy) to tell him that hes for sale if Benyon can get him out of prison. Benyon pulls some strings and Doc McCoy is released again. Unfortunately he has to cooperate with the same person that got him to prison.', "5.6", ["Action", "Adventure", "Crime", "Drama", "Romance", "Thriller"]),
           41579 => Movie.new(41579, "Getting Even with Dad (1994)", "https://image.tmdb.org/t/p/w500/yZLcdtT8UVlj6j3H8Rl51PxIdza.jpg", "Ray, an ex-con and widower, is planning a coin heist with two accomplices to help him to buy his own bakery. However, he doesnt expect his son Timmy, who was living with Rays sister, to show up at the house right in the middle of planning. Timmy is ignored and Ray and his buddies pull off the heist. Timmy gets his fathers attention by stealing the coins and hiding them. To get them back, his father must take him to a number of different places and treat him like he enjoys his presence. They grow fond of each other but Timmy wont stay with his dad unless he gives up the coins.", "5.1", ["Comedy"]),
           18620 => Movie.new(18620, "Go Fish (1994)", "https://image.tmdb.org/t/p/w500/4hczdEX2RmQTOmiIKygoOYCy0bI.jpg", "Max is a trendy, pretty, young lesbian, who is having trouble finding love. A friend sets her up with Ely, whom Max likes, but Ely is frumpy, homely, and older. Nor do they have much in common. Can Max learn to look past the packaging?", "4.4", ["Drama", "Romance"]),
           2019 => Movie.new(2019, "Hard Target (1993)", "https://image.tmdb.org/t/p/w500/kufvuQYWdl82sYzmhy2naBLyMui.jpg", "When a womans father goes missing, she enlists a local to aid in her search.  The pair soon discover that her father has died at the hands of a wealthy sportsman who hunts homeless men as a form of recreation.", "6.3", ["Action", "Adventure", "Crime", "Thriller"]),
           9255 => Movie.new(9255, "Hot Shots! Part Deux (1993)", "https://image.tmdb.org/t/p/w500/zh9EGK970GHo10ETclWBOjZVUOK.jpg", "Topper Harley is found to be working as an odd-job-man in a monastery. The CIA want him to lead a rescue mission into Iraq, to rescue the last rescue team, who went in to rescue the last rescue team�who went in to rescue hostages left behind after Desert Storm.", "6.5", ["Action", "Comedy", "War"]),
           26271 => Movie.new(26271, "Live Nude Girls (1995)", "https://image.tmdb.org/t/p/w500/vg9piYFtCTHep2V5EmLjwsYMzn2.jpg", "A group of old friends at a Hens Night discuss their issues, uncertainties, fears and fantasies.", "4.5", ["Comedy"]),
           10612 => Movie.new(10612, "Englishman Who Went Up a Hill But Came Down a Mountain, The (1995)", "https://image.tmdb.org/t/p/w500/dnatrgiXFf6BLfb2IKHVmg9tCi7.jpg", "When an English cartographer arrives in Wales to tell the residents of the Welsh village of Ffynnon Garw  that their mountain is only a hill, the offended community sets out to remedy the situation.", "6.3", ["Comedy", "Romance"]),
           2259 => Movie.new(2259, "House of the Spirits, The (1993)", "https://image.tmdb.org/t/p/w500/q0YyNTvooXI9ZF71dAYKcRwqlGn.jpg", "A rancher, his clairvoyant wife and their family face turbulent years in South America.", "6.8", ["Drama", "Romance"]),
           16097 => Movie.new(16097, "House Party 3 (1994)", "https://image.tmdb.org/t/p/w500/jLUgvHO3vVLkzKs3OcYksGPbLnA.jpg", 'Hip Hop duo Kid & Play return in the second follow-up to their 1990 screen debut House Party. Kid (Christopher "Kid" Reid) is taking the plunge and marrying his girlfriend Veda (Angela Means), while his friend Play (Christopher Martin) is dipping his toes into the music business, managing a roughneck female rap act called Sex as a Weapon. Play books the ladies for a concert with heavy-hitting pr', "5.4", ["Comedy"]),
           11934 => Movie.new(11934, "Hudsucker Proxy, The (1994)", "https://image.tmdb.org/t/p/w500/yWKm4yzRU4hokkbYCJ34vwVwb9R.jpg", "A naive business graduate is installed as president of a manufacturing company as part of a stock scam.", "7.1", ["Comedy"]),
           106143 => Movie.new(106143, "Ill Do Anything (1994)", "https://image.tmdb.org/t/p/w500/dnAQ1FmvEt8bQdir8aepW0paIeq.jpg", "Matt Hobbs is a talented but unsuccessful actor. When estranged (and strange) ex-wife Beth dumps their daughter Jeannie on Matt, father and daughter have a lot of adjusting to do. His budding relationship with attractive production assistant Cathy Breslow is made complicated, while the precocious child is overly accustomed to getting her own way. Matt eventually faces the choice of family vs career in a particularly difficult way.", "5.6", ["Comedy", "Drama"]),
           12475 => Movie.new(12475, "In the Army Now (1994)", "https://image.tmdb.org/t/p/w500/cNIIDaJM9nsDP9tTmAN6sjKpeiN.jpg", "Bones Conway and Jack Kaufman didnt really know what they were in for when they enlisted in the U.S. Army; they just wanted to get a job and make some money. But these new recruits are so hapless, they run the risk of getting kicked out before their military careers even begin. Soon, though, theyre sent to the Middle East to fight for their country -- which they manage to do in their own wacky ways.", "5.1", ["Comedy", "War"]),
           9386 => Movie.new(9386, "In the Line of Fire (1993)", "https://image.tmdb.org/t/p/w500/3NvOFpmyECI3DNExYMtFIRcGMsu.jpg", 'Veteran Secret Service agent Frank Horrigan is a man haunted by his failure to save President Kennedy while serving protection detail in Dallas. Thirty years later, a man calling himself "Booth" threatens the life of the current President, forcing Horrigan to come back to protection detail to confront the ghosts from his past.', "7.0", ["Action", "Thriller"]),
           7984 => Movie.new(7984, "In the Name of the Father (1993)", "https://image.tmdb.org/t/p/w500/kUTImWLPIr6U4xhLsHrgky5vgJt.jpg", "A small time thief from Belfast, Gerry Conlon, is falsely implicated in the IRA bombing of a pub that kills several people while he is in London. He and his four friends are coerced by British police into confessing their guilt. Gerrys father and other relatives in London are also implicated in the crime. He spends fifteen years in prison with his father trying to prove his innocence.", "7.9", ["Drama"]),
           59930 => Movie.new(59930, "Inkwell, The (1994)", "https://image.tmdb.org/t/p/w500/b5qUq9l6ci9KzzAqYhpdxzjY7qi.jpg", "The Inkwell is about a 16-year-old boy coming of age on Marthas Vineyard in the summer of 1976.", "5.6", ["Comedy", "Drama"]),
           15765 => Movie.new(15765, "Whats Love Got to Do with It? (1993)", "https://image.tmdb.org/t/p/w500/oFAgqsmjPmwRP4dZqbe51HlpPIi.jpg", 'Whats Love Got to Do with It is a 1993 American biographical film directed by Brian Gibson, based on the life of Tina Turner. The film stars Angela Bassett as Tina Turner and Laurence Fishburne as Ike Turner.  The screenplay was adapted by Kate Lanier from the book I, Tina co-written by Turner with Kurt Loder. Both Ike and Tina assigned rights to Lanier for their lives to be dramatized in the film. The films soundtrack featured the hit song "I Dont Wanna Fight", which went to number one in seven countries.', "7.0", ["Drama", "Musical"]),
           31643 => Movie.new(31643, "Jimmy Hollywood (1994)", "https://image.tmdb.org/t/p/w500/sTLLLD6shSp6lrbIKa4v5N4wDso.jpg", "Jimmy Alto is an actor wannabe who stumbles into the role of a lifetime. He becomes a vigilante crime-fighter, aided by his sidekick William, who has suffered a head wound and has problems with short-term memory. Jimmys vigilante alter ego soon becomes a media wonder--but Jimmy remains a total unknown and his long-suffering girl friend Lorraine is getting fed up with the whole situation.", "5.2", ["Comedy", "Crime", "Drama"]),
           6 => Movie.new(6, "Judgment Night (1993)", "https://image.tmdb.org/t/p/w500/rYFAvSPlQUCebayLcxyK79yvtvV.jpg", "While racing to a boxing match, Frank, Mike, John and Rey get more than they bargained for. A wrong turn lands them directly in the path of Fallon, a vicious, wise-cracking drug lord. After accidentally witnessing Fallon murder a disloyal henchman, the four become his unwilling prey in a savage game of cat and mouse as they are mercilessly stalked through the urban jungle in this taut suspense drama.", "6.6", ["Action", "Crime", "Thriller"]),
           329 => Movie.new(329, "Jurassic Park (1993)", "https://image.tmdb.org/t/p/w500/oU7Oq2kFAAlGqbU4VoAE36g4hoI.jpg", "A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. However, the park is anything but amusing as the security systems go off-line and the dinosaurs escape.", "7.9", ["Action", "Adventure", "Sci-Fi", "Thriller"]),
           10909 => Movie.new(10909, "Kalifornia (1993)", "https://image.tmdb.org/t/p/w500/4E39RrmgXspAqGro2poDEdjvAnh.jpg", "A journalist duo go on a tour of serial killer murder sites with two companions, unaware that one of them is a serial killer himself.", "6.6", ["Drama", "Thriller"]),
           507 => Movie.new(507, "Killing Zoe (1994)", "https://image.tmdb.org/t/p/w500/2eEP5BJafrVaMUYLhvyKbB8ctXT.jpg", "Zed is an American vault-cracker who travels to Paris to meet up with his old friend Eric. Eric and his gang have planned to raid the only bank in the city which is open on Bastille day. After offering his services, Zed soon finds himself trapped in a situation beyond his control when heroin abuse, poor planning and a call-girl named Zoe all conspire to turn the robbery into a very bloody siege.", "6.3", ["Crime", "Drama", "Thriller"]),
           29918 => Movie.new(29918, "Lassie (1994)", "https://image.tmdb.org/t/p/w500/5Tz2rzFivQKmMBz5T8Cj7M7CdnI.jpg", "On their way to start a new life at a sheep farm in rural Virginia, the Turner family are halted by a wreck on the highway that has claimed the life of a truck driver. Spotting the truckers now-abandoned collie on the side of the road, they take pity on the dog and adopt her. As the city family copes with the change to rural life, including a feud with a neighboring farm family who resent the city interlopers, the ever-loyal Lassie helps them adjust to their new surroundings.", "6.1", ["Adventure", "Children"]),
           9593 => Movie.new(9593, "Last Action Hero (1993)", "https://image.tmdb.org/t/p/w500/8B4aFGBHWmj2F4jkDNHjzSX2GOw.jpg", "Danny is obsessed with a fictional movie character action hero Jack Slater. When a magical ticket transports him into Jacks latest adventure, Danny finds himself in a world where movie magic and reality collide. Now its up to Danny to save the life of his hero and new friend.", "6.4", ["Action", "Adventure", "Comedy", "Fantasy"]),
           42580 => Movie.new(42580, "Life with Mikey (1993)", "https://image.tmdb.org/t/p/w500/dKsvF5t5xsm17HG3GJzQQGJpJzP.jpg", "Michael Chapman, a former child TV star, runs a struggling talent agency specilizing in child acts. When a young girl off the street puts on a real performance after he catches her picking his pocket, he may have just found the next big thing.", "5.6", ["Comedy"]),
           22317 => Movie.new(22317, "Lightning Jack (1994)", "https://image.tmdb.org/t/p/w500/4YoRERjKWO2442ezcvgEjAZuxWP.jpg", "Lightning Jack Kane is an Australian outlaw in the wild west. During a bungled bank robbery he picks up mute Ben Doyle as a hostage. The two become good friends, with Jack teaching Ben how to rob banks, while they plan Jacks last heist.", "5.6", ["Comedy", "Western"]),
           1413 => Movie.new(1413, "M. Butterfly (1993)", "https://image.tmdb.org/t/p/w500/8NzP5uDtTS8u3LjtKeBVnHr4SNF.jpg", "In 1960s China, French diplomat Rene Gallimard falls in love with an opera singer, Song Liling - but Song is not at all who Gallimard thinks.", "6.6", ["Drama", "Romance"]),
           12121 => Movie.new(12121, "Made in America (1993)", "https://image.tmdb.org/t/p/w500/2frB553lKEm1q4dds5PUqLNQA3z.jpg", "A young black woman discovers that her father was a sperm donor, and if that wasnt bad enough, hes white.", "5.5", ["Comedy"]),
           2246 => Movie.new(2246, "Malice (1993)", "https://image.tmdb.org/t/p/w500/oQoe4eIzDjQSSqGvLgJFjXtEkNv.jpg", 'A tale about a happily married couple who would like to have children. Tracy teaches infants, Andys a college professor. Things are never the same after she is taken to hospital and operated upon by Jed, a "know all" doctor.', "6.2", ["Thriller"]),
           10502 => Movie.new(10502, "Man Without a Face, The (1993)", "https://image.tmdb.org/t/p/w500/9dmH2jc6jwlZo90JQTFOx4XaBWt.jpg", "Justin McLeod is a former teacher who lives as a recluse on the edge of town after his face is disfigured from an automobile accident ten years earlier, in which a boy was incinerated�and for which he was convicted of involuntary manslaughter.", "6.5", ["Drama"]),
           10440 => Movie.new(10440, "Manhattan Murder Mystery (1993)", "https://image.tmdb.org/t/p/w500/zrzBIlMyAP7Ac9W5qAy5ssAUdK4.jpg", "A middle-aged couple suspects foul play when their neighbors wife suddenly drops dead.", "7.3", ["Comedy", "Mystery"]),
           9516 => Movie.new(9516, "Menace II Society (1993)", "https://image.tmdb.org/t/p/w500/rpG5cx9TKMtfUzmTUJdVtruNIXU.jpg", "Sobering and incisive, this cautionary drama centers on a street tough 18-year-old facing a moral quandary while trying to turn his life around.", "7.5", ["Action", "Crime", "Drama"]),
           2320 => Movie.new(2320, "Executive Decision (1996)", "https://image.tmdb.org/t/p/w500/hLjXkFr9fHlWzRVwu1T31QSVHRq.jpg", "Terrorists hijack a 747 inbound to Washington D.C., demanding the release of their imprisoned leader. Intelligence expert David Grant (Kurt Russell) suspects another reason and he is soon the reluctant member of a special assault team that is assigned to intercept the plane and hijackers.", "6.2", ["Action", "Adventure", "Thriller"]),
           5879 => Movie.new(5879, "In the Realm of the Senses (Ai no corrida) (1976)", "https://image.tmdb.org/t/p/w500/3bTaZIuBqYiTnHAt4iWZKEzMnRd.jpg", "A passionate telling of the story of Sada Abe, a woman whose affair with her master led to an obsessive and ultimately destructive sexual relationship.", "6.5", ["Drama"]),
           83718 => Movie.new(83718, "What Happened Was... (1994)", "https://image.tmdb.org/t/p/w500/mke5aNX5cT6JIWk2ER4ng9dGNNL.jpg", "Jackie and Michael are coworkers at a large law firm. They decide to meet at Jackies for dinner one night.", "7.1", ["Comedy", "Drama", "Romance", "Thriller"]),
           11971 => Movie.new(11971, "Much Ado About Nothing (1993)", "https://image.tmdb.org/t/p/w500/fA5mOQuevh4q18AAfy1xQWToVpp.jpg", "In this Shakespearean farce, Hero and her groom-to-be, Claudio, team up with Claudios commanding officer, Don Pedro, the week before their wedding to hatch a matchmaking scheme. Their targets are sharp-witted duo Benedick and Beatrice -- a tough task indeed, considering their corresponding distaste for love and each other. Meanwhile, meddling Don John plots to ruin the wedding.", "7.0", ["Comedy", "Romance"]),
           31911 => Movie.new(31911, "Mr. Wonderful (1993)", "https://image.tmdb.org/t/p/w500/AtUjyMEXPR41JWZzGfHEzgmrrHq.jpg", "Electrician Gus gets the chance to fulfil a childhood dream by buying an old bowling-alley with some of his friends, but first he must find his ex-wife a new husband so he can stop paying alimony.", "5.8", ["Comedy", "Romance"]),
           788 => Movie.new(788, "Mrs. Doubtfire (1993)", "https://image.tmdb.org/t/p/w500/szvidvi0Fo4j2gmMtk1sNe1rkzw.jpg", "Loving but irresponsible dad Daniel Hillard, estranged from his exasperated spouse, is crushed by a court order allowing only weekly visits with his kids. When Daniel learns his ex needs a housekeeper, he gets the job -- disguised as an English nanny. Soon he becomes not only his childrens best pal but the kind of parent he should have been from the start.", "7.2", ["Comedy", "Drama"]),
           21450 => Movie.new(21450, "Naked (1993)", "https://image.tmdb.org/t/p/w500/aX5cf2cdHjvcD1Be5drNHYYp4gX.jpg", "An unemployed Brit vents his rage on unsuspecting strangers as he embarks on a nocturnal London odyssey.", "7.4", ["Drama"]),
           11231 => Movie.new(11231, "Next Karate Kid, The (1994)", "https://image.tmdb.org/t/p/w500/9asnrgm2oloHsTKj8NW0Tl7FKG5.jpg", "Mr. Miyagi decides to take Julie, a troubled teenager, under his wing after he learns that she blames herself for her parents demise and struggles to adjust with her grandmother and fellow pupils.", "5.3", ["Action", "Children", "Romance"]),
           10447 => Movie.new(10447, "No Escape (1994)", "https://image.tmdb.org/t/p/w500/jBVyUBqaMf66WJ7bsJrzmCz8QmW.jpg", "In the year 2022, a ruthless prison warden has created the ultimate solution for his most troublesome and violent inmates: Absolom, a secret jungle island where prisoners are abandoned and left to die. But Marine Captain John Robbins, convicted of murdering a commanding officer, is determined to escape the island in order to reveal the truth behind his murderous actions and clear his name.", "6.3", ["Action", "Drama", "Sci-Fi"]),
           31586 => Movie.new(31586, "North (1994)", "https://image.tmdb.org/t/p/w500/e4JEG7dstmurXMUPOW9Jy6UDR9F.jpg", "Eleven-year-old North has had it with his parents. They are always busy with their careers and dont give North the attention he needs, so he files a lawsuit against them. The judge rules that North should either find new parents or return to his own parents within two months. Thus North starts off on a journey around the world to find parents that really care about him.", "5.1", ["Comedy"]),
           9300 => Movie.new(9300, "Orlando (1992)", "https://image.tmdb.org/t/p/w500/nTJNWBDhqucCYA3I0eeSyaZoag8.jpg", "England, 1600. Queen Elizabeth I promises Orlando, a young nobleman obsessed with poetry, that she will grant him land and fortune if he agrees to satisfy a very particular request.", "6.9", ["Drama", "Fantasy", "Romance"]),
           9559 => Movie.new(9559, "Perfect World, A (1993)", "https://image.tmdb.org/t/p/w500/1II9kMjOuho3pnEvxkpx7e3ozOO.jpg", "A kidnapped boy strikes up a friendship with his captor: an escaped convict on the run from the law, headed by an honorable U.S. Marshal.", "7.5", ["Crime", "Drama", "Thriller"]),
           9800 => Movie.new(9800, "Philadelphia (1993)", "https://image.tmdb.org/t/p/w500/tFe5Yoo5zT495okA49bq1vPPkiV.jpg", "Two competing lawyers join forces to sue a prestigious law firm for AIDS discrimination. As their unlikely friendship develops their courage overcomes the prejudice and corruption of their powerful adversaries.", "7.7", ["Drama"]),
           713 => Movie.new(713, "Piano, The (1993)", "https://image.tmdb.org/t/p/w500/dUxjG6baSzGIgP7R8BQI5rpMuET.jpg", "After a long voyage from Scotland, pianist Ada McGrath and her young daughter, Flora, are left with all their belongings, including a piano, on a New Zealand beach. Ada, who has been mute since childhood, has been sold into marriage to a local man named Alisdair Stewart. Making little attempt to warm up to Alisdair, Ada soon becomes intrigued by his Maori-friendly acquaintance, George Baines, leading to tense, life-altering conflicts.", "7.4", ["Drama", "Romance"]),
           8291 => Movie.new(8291, "Poetic Justice (1993)", "https://image.tmdb.org/t/p/w500/6jE7Vzh3edBQtbbDcF4AC5gMX2g.jpg", "Still grieving after the murder of her boyfriend, hairdresser Justice writes poetry to deal with the pain of her loss. Unable to get to Oakland to attend a convention because of her broken-down car, Justice gets a lift with her friend, Iesha and Ieshas postal worker boyfriend, Chicago. Along for the ride is Chicagos co-worker, Lucky, to whom Justice grows close after some initial problems. But is she ready to open her heart again?", "6.8", ["Drama"]),
           18133 => Movie.new(18133, "Program, The (1993)", "https://image.tmdb.org/t/p/w500/4pdbutHc9SLEPmdLKtlVffiLByP.jpg", "Several players from different backgrounds try to cope with the pressures of playing football at a major university. Each deals with the pressure differently, some turn to drinking, others to drugs, and some to studying.", "6.2", ["Action", "Drama"]),
           25557 => Movie.new(25557, "Puppet Masters, The (1994)", "https://image.tmdb.org/t/p/w500/8xJGom6fUqmVhJ7EWprZEHygUis.jpg", "The Earth is invaded by alien parasites�aka slugs�that ride on peoples backs and control their minds", "5.7", ["Horror", "Sci-Fi"]),
           22588 => Movie.new(22588, "Radioland Murders (1994)", "https://image.tmdb.org/t/p/w500/l9pvl3AH4UsUvLn4yUP0RR4pltx.jpg", "In 1939, WBN, a fourth radio network, is about to take to Americas airwaves. As if the confusion of the premiere night wasnt enough, Penny Henderson, the owners secretary, must deal with an unhappy sponsor, an overbearing boss and a soon-to-be ex-husband who desperately wants her back. As the broadcast begins, a mysterious voice breaks the broadcast and suddenly members of the cast turn up dead. Its up to her husband Roger, to find out whodunit as the police chase him through the halls of WBN.", "5.9", ["Comedy", "Mystery", "Romance"]),
           10872 => Movie.new(10872, "Ref, The (1994)", "https://image.tmdb.org/t/p/w500/bxMjOeECQxHPf6QvkBChdxaOxVh.jpg", "Caroline and Lloyd are a married couple constantly at each others throats, masters at crafting acid-tongued barbs at the others expense. Indeed, they are so obsessed with belittling each other that they never stop -- not even at gunpoint. The gunman is Gus, a thief on the run from the police, who kidnaps the couple as an insurance policy, planning to use their home as a hideout. But their incessant bickering proves more than Gus bargained for, forcing him -- for the sake of his own sanity -- into the unenviable role of peacemaker. To make things even worse for Gus, he discovers that he has taken the couple hostage the night of their big Christmas party, and the guests are already on the way. Not wanting to leave Lloyd and Caroline unattended, Gus opts to attend the party, pretending to be the couples marriage counselor. This naturally leads to a series of comic confusions, as the hostage crisis and marital tensions head towards their inevitable conclusion.", "6.5", ["Comedy"]),
           1245 => Movie.new(1245, "Remains of the Day, The (1993)", "https://image.tmdb.org/t/p/w500/qtwipjmSypSQuSvz5BNirSxZqbg.jpg", "A rule bound head butlers world of manners and decorum in the household he maintains is tested by the arrival of a housekeeper who falls in love with him in post-WWI Britain. The possibility of romance and his masters cultivation of ties with the Nazi cause challenge his carefully maintained veneer of servitude.", "7.4", ["Drama", "Romance"]),
           11858 => Movie.new(11858, "Renaissance Man (1994)", "https://image.tmdb.org/t/p/w500/iPRtaSfN8gNWFclgrcg5oD3V41i.jpg", "An advertising man is slowly sliding downhill. When he is fired from his job in Detroit, he signs up for unemployment. One day they find him a job: teaching thinking skills to Army recruits. He arrives on base to find that there is no structure set up for the class.", "6.1", ["Comedy", "Drama"]),
           7007 => Movie.new(7007, "Rising Sun (1993)", "https://image.tmdb.org/t/p/w500/jVWEeZ383peKxwE284AdyHqq6GH.jpg", "When a prostitute is found dead in a Los Angeles skyscraper occupied by a large Japanese corporation, detectives John Conner and Web Smith are called in to investigate. Although Conner has previous experience working in Japan, cultural differences make their progress difficult until a security disc showing the murder turns up. Close scrutiny proves the disc has been doctored, and the detectives realize theyre dealing with a cover-up as well.", "6.1", ["Action", "Drama", "Mystery"]),
           10467 => Movie.new(10467, "Road to Wellville, The (1994)", "https://image.tmdb.org/t/p/w500/zh7OVdFMpqpZ027z9RgVIwzxYjZ.jpg", "An unhappy young couple visit the infamous Kellogg spa in Battle Creek, Michigan while a young hustler tries get into the breakfast-cereal business and compete against John Kelloggs corn flakes.", "5.6", ["Comedy"]),
           5550 => Movie.new(5550, "RoboCop 3 (1993)", "https://image.tmdb.org/t/p/w500/ppLSSwCuC5ERRWbu9H3R8SPL9AM.jpg", "The mega corporation Omni Consumer Products is still bent on creating their pet project, Delta City, to replace the rotting city of Detroit. Unfortunately, the inhabitants of the area have no intention of abandoning their homes simply for desires of the company. To this end, OCP have decided to force them to leave by employing a ruthless mercenary army to attack and harass them. An underground resistance begins and in this fight, Robocop must decide where his loyalties lie.", "4.7", ["Action", "Crime", "Drama", "Sci-Fi", "Thriller"]),
           8005 => Movie.new(8005, "Robin Hood: Men in Tights (1993)", "https://image.tmdb.org/t/p/w500/woexOLEkUlYsPLLuZRK6LjZaF38.jpg", "Robin Hood comes home after fighting in the Crusades to learn that the noble King Richard is in exile and that the despotic King John now rules England, with the help of the Sheriff of Rottingham. Robin Hood assembles a band of fellow patriots to do battle with King John and the Sheriff.", "6.6", ["Comedy"]),
           2088 => Movie.new(2088, "Romeo Is Bleeding (1993)", "https://image.tmdb.org/t/p/w500/mgCwAZBG0PCkZflC6nzsxwvG2vu.jpg", "A corrupt cop gets in over his head when he tries to assassinate a beautiful Russian hit-woman.", "6.1", ["Crime", "Thriller"]),
           10412 => Movie.new(10412, "Romper Stomper (1992)", "https://image.tmdb.org/t/p/w500/w5v1la4WQgh5c2faGUDRnMqKmhk.jpg", "Nazi skinheads in Melbourne take out their anger on local Vietnamese, who are seen as threatening racial purity. Finally the Vietnamese have had enough and confront the skinheads in an all-out confrontation, sending the skinheads running. A woman who is prone to epileptic seizures joins the skins merry band, and helps them on their run from justice, but is her affliction also a sign of impurity?", "6.6", ["Action", "Drama"]),
           47889 => Movie.new(47889, "Ruby in Paradise (1993)", "https://image.tmdb.org/t/p/w500/gk0vbIVYwpXxSf1wQbS2r9IsBoV.jpg", "Reeling from her mothers recent death, Ruby Lee Gissing relocates to Florida to start anew. After finding a job at a souvenir store, Ruby becomes friends with the shops owner, Mildred Chambers, and slowly acclimates to her new surroundings. Before long, shes juggling the affections of Mildreds Lothario son, Ricky, and the good-natured Mike. As she wavers between Ricky and Mike, Ruby also tries to come to terms with her past.", "6.0", ["Drama"]),
           14534 => Movie.new(14534, "Rudy (1993)", "https://image.tmdb.org/t/p/w500/fAbfTCRpjHe2rprXBly55KL1dL9.jpg", "Rudy grew up in a steel mill town where most people ended up working, but wanted to play football at Notre Dame instead. There were only a couple of problems. His grades were a little low, his athletic skills were poor, and he was only half the size of the other players. But he had the drive and the spirit of 5 people and has set his sights upon joining the team.", "7.4", ["Drama"]),
           41878 => Movie.new(41878, "Savage Nights (Nuits fauves, Les) (1992)", "https://image.tmdb.org/t/p/w500/5Onj1lmo28QklT5iiEdYlKygO7h.jpg", "Jean is young, gay, and promiscuous. Only after he meets one or two women, including Laura does he come to realize his bisexuality. Jean has to overcome a personal crisis and a tough choice between Laura and his male lover Samy.", "6.7", ["Drama"]),
           424 => Movie.new(424, "Schindlers List (1993)", "https://image.tmdb.org/t/p/w500/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg", "The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.", "8.6", ["Drama", "War"]),
           35233 => Movie.new(35233, "Scout, The (1994)", "https://image.tmdb.org/t/p/w500/8vEoAKpymSKhjdd7nuOpr2hhtcF.jpg", "When his star recruit botches a Major League Baseball debut, humiliated talent scout, Al Percolo gets banished to rural Mexico, where he finds a potential gold mine in the arm of young phenom Steve Nebraska. Soon, the Bronx Bombers put a $55 million contract on the table�provided a psychiatrist can affirm Nebraskas mental stability.", "5.2", ["Comedy", "Drama"]),
           14291 => Movie.new(14291, "Searching for Bobby Fischer (1993)", "https://image.tmdb.org/t/p/w500/8EFr1rsJ9sfayiM4D1cEbucOg7E.jpg", "A prepubescent chess prodigy refuses to harden himself in order to become a champion like the famous but unlikable Bobby Fischer.", "7.2", ["Drama"]),
           11236 => Movie.new(11236, "Secret Garden, The (1993)", "https://image.tmdb.org/t/p/w500/4QvQLpNMzprzjg4XwoDKjeqoYu0.jpg", "A young British girl born and reared in India loses her neglectful parents in an earthquake. She is returned to England to live at her uncles castle. Her uncle is very distant due to the loss of his wife ten years before. Neglected once again, she begins exploring the estate and discovers a garden that has been locked and neglected. Aided by one of the servants boys, she begins restoring the garden, and eventually discovers some other secrets of the manor.", "7.4", ["Children", "Drama"]),
           11592 => Movie.new(11592, "Serial Mom (1994)", "https://image.tmdb.org/t/p/w500/y3ep6gj6waV56koX3weuUfb13kz.jpg", "A picture perfect middle class family is shocked when they find out that one of their neighbors is receiving obscene phone calls. The mom takes slights against her family very personally, and it turns out she is indeed the one harassing the neighbor. As other slights befall her beloved family, the body count begins to increase.", "6.7", ["Comedy", "Crime", "Horror"]),
           8850 => Movie.new(8850, "Shadow, The (1994)", "https://image.tmdb.org/t/p/w500/xAbFJH3vQYZvUyzzGAtG4OLy492.jpg", 'Based on the 1930s comic strip, puts the hero up against his arch enemy, Shiwan Khan, who plans to take over the world by holding a city to ransom using an atom bomb. Using his powers of invisibility and "The power to cloud mens minds", the Shadow comes blazing to the citys rescue with explosive results.', "6.0", ["Action", "Adventure", "Fantasy", "Mystery"]),
           10445 => Movie.new(10445, "Shadowlands (1993)", "https://image.tmdb.org/t/p/w500/5jTWY1M2O4Zhid4rLOpftzazRGn.jpg", "C.S. Lewis, a world-renowned writer and professor, leads a passionless life until he meets spirited poet Joy Gresham", "6.9", ["Drama", "Romance"]),
           695 => Movie.new(695, "Short Cuts (1993)", "https://image.tmdb.org/t/p/w500/nAEBc3g9bHAcF9whKFMfIxHxVwn.jpg", "Many loosely connected characters cross paths in this film, based on the stories of Raymond Carver. Waitress Doreen Piggot accidentally runs into a boy with her car. Soon after walking away, the child lapses into a coma. While at the hospital, the boys grandfather tells his son, Howard, about his past affairs. Meanwhile, a baker starts harassing the family when they fail to pick up the boys birthday cake.", "7.2", ["Drama"]),
           43535 => Movie.new(43535, "Simple Twist of Fate, A (1994)", "https://image.tmdb.org/t/p/w500/2Jorj80Y4EVEAPDRVVdDXKSVUTw.jpg", "When Michael McCann is thrown over by the woman he loves, he becomes something of a misanthrope and a miser, spending all of his spare money on collectible gold coins. Living in the same town is an affluent family with two sons: John and Tanny. Tannys a wild boy, whom John cannot control, and one night he breaks into McCanns house, and steals the gold and disappears, which nearly confirms McCanns distrust of mankind. But then, a mysterious young woman dies in the snow outside McCanns house, and her small daughter makes her way to McCanns house and into McCanns life and heart.", "6.0", ["Drama"]),
           12519 => Movie.new(12519, "Sirens (1994)", "https://image.tmdb.org/t/p/w500/7qjsO2xOyq5GhXQTG7L24pDPRmu.jpg", "In 1930s Australia, Anglican clergyman Anthony Campion and his prim wife, Estella, are asked to visit noted painter Norman Lindsay, whose planned contribution to an international art exhibit is considered blasphemous. While Campion and Lindsay debate, Estella finds herself drawn to the three beautiful models sitting for the painters current work, freethinking Sheela, sensual Pru and virginal Giddy.", "5.7", ["Drama"]),
           23210 => Movie.new(23210, "Six Degrees of Separation (1993)", "https://image.tmdb.org/t/p/w500/gDufsnqEc1IKz86czkzn16RFAAD.jpg", "The story of a young, gay, black, con artist who, posing as the son of Sidney Poitier, cunningly maneuvers his way into the lives of a white, upper-class New York family.", "6.4", ["Drama"]),
           858 => Movie.new(858, "Sleepless in Seattle (1993)", "https://image.tmdb.org/t/p/w500/iLWsLVrfkFvOXOG9PbUAYg7AK3E.jpg", "Desperate to find his dad Sam a date, a young boy calls into a radio show and catches the attention of Annie, a journalist who wants to meet Sam atop the Empire State Building.", "6.7", ["Comedy", "Drama", "Romance"]),
           867 => Movie.new(867, "Sliver (1993)", "https://image.tmdb.org/t/p/w500/g7PC2e2KqDkIfOoJx9iXJJez99d.jpg", "A woman moves into an apartment in Manhattan and learns that the previous tenants life ended mysteriously after they fell from the balcony.", "5.4", ["Thriller"]),
           78 => Movie.new(78, "Blade Runner (1982)", "https://image.tmdb.org/t/p/w500/63N9uy8nd9j7Eog2axPQ8lbr3Wj.jpg", "In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.", "7.9", ["Action", "Sci-Fi", "Thriller"]),
           13203 => Movie.new(13203, "Son in Law (1993)", "https://image.tmdb.org/t/p/w500/dJ5FD1TEBgdfJUluMpELrWaUUl1.jpg", "Country girl Rebecca has spent most of her life on a farm in South Dakota, and, when she goes away to college in Los Angeles, Rebecca immediately feels out of place in the daunting urban setting. She is befriended by a savvy party animal named Crawl, who convinces the ambivalent Rebecca to stay in the city. When Thanksgiving break rolls around, Rebecca, no longer an innocent farm girl, invites Crawl back to South Dakota, where he pretends to be her fianc�.", "6.1", ["Comedy", "Drama", "Romance"]),
           10442 => Movie.new(10442, "So I Married an Axe Murderer (1993)", "https://image.tmdb.org/t/p/w500/wMr6ZjfOnCHOA9Qm3jvo0e7nzfx.jpg", 'Just after a bad breakup, Charlie MacKenzie falls for lovely butcher Harriet Michaels and introduces her to his parents. But, as voracious consumers of sensational tabloids, his parents soon come to suspect that Harriet is actually a notorious serial killer -- "Mrs. X" -- wanted in connection with a string of bizarre honeymoon killings. Thinking his parents foolish, Charlie proposes to Harriet. But while on his honeymoon with her, he begins to fear they were right.', "6.1", ["Comedy", "Romance", "Thriller"]),
           11074 => Movie.new(11074, "Striking Distance (1993)", "https://image.tmdb.org/t/p/w500/1bLazrQWJQhO6u58vJZXJZ3ZFDh.jpg", "Coming from a police family, Tom Hardy ends up fighting his uncle after the murder of his father. Tom believes the killer is another cop, and goes on the record with his allegations. Demoted to water-way duty Tom, along with new partner Jo Christman, navigate the three rivers looking for clues and discovering bodies. This time the victims are women Tom knows, he must find the killer to prove his innocence.", "5.8", ["Action", "Crime"]),
           9607 => Movie.new(9607, "Super Mario Bros. (1993)", "https://image.tmdb.org/t/p/w500/cudfWiiFDxj8rq1Myolzv6yY3ah.jpg", "Mario and Luigi, plumbers from Brooklyn, find themselves in an alternate universe where evolved dinosaurs live in hi-tech squalor. Theyre the only hope to save our universe from invasion by the dino dictator, Koopa.", "4.2", ["Action", "Adventure", "Children", "Comedy", "Fantasy", "Sci-Fi"]),
           17585 => Movie.new(17585, "Surviving the Game (1994)", "https://image.tmdb.org/t/p/w500/e7r2Q5o5efmgjBF8scxtjNzZvah.jpg", "A homeless man is hired as a survival guide for a group of wealthy businessmen on a hunting trip in the mountains, unaware that they are killers who hunt humans for sport, and that he is their new prey.", "6.1", ["Action", "Adventure", "Thriller"]),
           9057 => Movie.new(9057, "Terminal Velocity (1994)", "https://image.tmdb.org/t/p/w500/jmxE6kKhXaqD2ZKJQO8FYDaLgQ5.jpg", "A maverick skydiver and a former KGB agent team up to stop the Russian mafia from stealing gold.", "5.3", ["Action", "Mystery", "Thriller"]),
           20967 => Movie.new(20967, "Thirty-Two Short Films About Glenn Gould (1993)", "https://image.tmdb.org/t/p/w500/pv5lVS7tGkbM2MFufnBqnwVgaix.jpg", "A collection of vignettes highlighting different aspects of the life, work, and character of the acclaimed Canadian classical pianist.", "7.3", ["Drama", "Musical"]),
           10635 => Movie.new(10635, "Threesome (1994)", "https://image.tmdb.org/t/p/w500/gHXXhuGJKUjq5Pl9RNgfQbqLIxw.jpg", "At a sizable public college, high-minded student Eddy is forced to room with the slovenly Stuart, but the pair strike up a surprising friendship. When attractive co-ed Alex is assigned to live with the two male students because of her gender-neutral name, a roundabout love triangle ensues. Eddy secretly yearns for Stuart, who wants Alex, but she prefers Eddy. The complex situation leads to sexual experimentation and strained relationships.", "6.4", ["Comedy", "Romance"]),
           9479 => Movie.new(9479, "Nightmare Before Christmas, The (1993)", "https://image.tmdb.org/t/p/w500/oQffRNjK8e19rF7xVYEN8ew0j7b.jpg", "Tired of scaring humans every October 31 with the same old bag of tricks, Jack Skellington, the spindly king of Halloween Town, kidnaps Santa Claus and plans to deliver shrunken heads and other ghoulish gifts to children on Christmas morning. But as Christmas approaches, Jacks rag-doll girlfriend, Sally, tries to foil his misguided plans.", "7.8", ["Animation", "Children", "Fantasy", "Musical"]),
           10057 => Movie.new(10057, "Three Musketeers, The (1993)", "https://image.tmdb.org/t/p/w500/mk8UH7JRmK8adcqJJpB1ygP7B1C.jpg", "DArtagnan travels to Paris hoping to become a musketeer, one of the French kings elite bodyguards, only to discover that the corps has been disbanded by conniving Cardinal Richelieu, who secretly hopes to usurp the throne. Fortunately, Athos, Porthos and Aramis have refused to lay down their weapons and continue to protect their king. DArtagnan joins with the rogues to expose Richelieus plot against the crown.", "6.4", ["Action", "Adventure", "Comedy", "Romance"]),
           11969 => Movie.new(11969, "Tombstone (1993)", "https://image.tmdb.org/t/p/w500/f6Lb4bpUW2AJW42Hpnix2533RKU.jpg", "Legendary marshal Wyatt Earp, now a weary gunfighter, joins his brothers Morgan and Virgil to pursue their collective fortune in the thriving mining town of Tombstone. But Earp is forced to don a badge again and get help from his notorious pal Doc Holliday when a gang of renegade brigands and rustlers begins terrorizing the town.", "7.6", ["Action", "Drama", "Western"]),
           319 => Movie.new(319, "True Romance (1993)", "https://image.tmdb.org/t/p/w500/39lXk6ud6KiJgGbbWI2PUKS7y2.jpg", "Clarence marries hooker Alabama, steals cocaine from her pimp, and tries to sell it in Hollywood, while the owners of the coke try to reclaim it.", "7.5", ["Crime", "Thriller"]),
           26408 => Movie.new(26408, "War Room, The (1993)", "https://image.tmdb.org/t/p/w500/prfxsyG4SnlnqqulavCJ4RksFUA.jpg", "A behind-the-scenes documentary about the Clinton for President campaign, focusing on the adventures of spin doctors James Carville and George Stephanopoulos.", "7.3", ["Documentary"]),
           15139 => Movie.new(15139, "Pagemaster, The (1994)", "https://image.tmdb.org/t/p/w500/eH1elSNGetooPtK2aXHGuJblzkS.jpg", "Tyler knows a lot about accidents. So much so, he is scared to do anything that might endanger him, like riding his bike, or climbing into his treehouse. While in an old library, he is mystically transported into the unknown world of books, and he has to try and get home again.", "6.4", ["Action", "Adventure", "Animation", "Children", "Fantasy"]),
           11446 => Movie.new(11446, "Welcome to the Dollhouse (1995)", "https://image.tmdb.org/t/p/w500/yrbj1UCLH0oNqWuR9NHuNEdtDF8.jpg", "An unattractive 7th grader struggles to cope with suburban life as the middle child with inattentive parents and bullies at school.", "7.1", ["Comedy", "Drama"]),
           51980 => Movie.new(51980, "Germinal (1993)", "https://image.tmdb.org/t/p/w500/cizv23RUxcpTrQt4kcOz7Sv6YJl.jpg", "Its mid 19th century, north of France. The story of a coal miners town. They are exploited by the mines owner. One day the decide to go on strike, and then the authorities repress them", "6.7", ["Drama", "Romance"]),
           24405 => Movie.new(24405, "Chasers (1994)", "https://image.tmdb.org/t/p/w500/mEG6fTyTjsA1vzTTqCXsiJzjdQ5.jpg", "Military men Rock Reilly and Eddie Devane are tasked with taking a prisoner, blonde bombshell Toni Johnson, on what becomes an unforgettable road trip. Toni, an enlistee whos in trouble for deserting her unit, soon proves that shes craftier than most inmates.", "5.2", ["Comedy"]),
           8223 => Movie.new(8223, "Kika (1993)", "https://image.tmdb.org/t/p/w500/mCbjj5q3avgep0ptoJmLxaFG2Uy.jpg", "Kika, a happy-go-lucky, na�ve cosmetologist, is called to the mansion of Nicholas Pierce, an American writer, to make-up the corpse of his stepson, Ram�n, a fashion photographer with voyeuristic tendencies. He was however merely catatonic and suddenly awoke feeling he owns her his life regained. Ram�n eventually proposes to Kika and they might have lived happily ever after but first they have to cope with Kikas torrid affair with Nicholas, the traumatic and suspicious suicide of Ram�ns mother, and the intrusive gaze of a scarred exploitative tabloid-TV star (and Ram�ns former psychologist), Andrea Caracortada.", "6.7", ["Comedy", "Drama"]),
           14587 => Movie.new(14587, "Bhaji on the Beach (1993)", "https://image.tmdb.org/t/p/w500/3J5XZgf0NsvTumKMXMqPz5dNhfY.jpg", "A group of women of Indian descent take a trip together from their home in Birmingham, England to the beach resort of Blackpool.", "5.2", ["Comedy", "Drama"]),
           31504 => Movie.new(31504, "Little Big League (1994)", "https://image.tmdb.org/t/p/w500/dyZ6Agvh2yAFe91J8pJroAPCZgh.jpg", "When the owner of the Minnesota Twins passes away, he bequeaths the team to his preteen grandson. The newly minted head honcho quickly appoints himself manager, causing unrest in an organisation that struggles to take orders from a 12-year-old.", "5.8", ["Comedy", "Drama"]),
           23637 => Movie.new(23637, "Ciao, Professore! (Io speriamo che me la cavo) (1992)", "https://image.tmdb.org/t/p/w500/b4wZkB4FNUi7SK46Tw9kxT5oW8M.jpg", "A bureaucratic snafu sends Marco Tullio Sperelli, a portly, middle-aged northern Italian, to teach third grade in a poor town outside Naples", "7.2", ["Drama"]),
           17600 => Movie.new(17600, "Spanking the Monkey (1994)", "https://image.tmdb.org/t/p/w500/cXgBxiPn1GBVMZX7mPsMSMjpfmt.jpg", "Bright young student Raymond Aibelli is forced to sidetrack an important medical internship because his mother, Susan, is recovering from a broken leg. When he isnt tasked with the most mundane aspects of Susans recuperation, Raymond finds distraction in a neighborhood girl, Toni Peck. But, as Susan begins relying on her son for both physical and emotional needs, Raymond starts developing disturbing and unwanted new yearnings.", "5.6", ["Comedy", "Drama"]),
           10897 => Movie.new(10897, "Little Rascals, The (1994)", "https://image.tmdb.org/t/p/w500/qI7PKX2JSw4yD2iQm3pyHvKir28.jpg", 'When nine-year-old Alfalfa falls for Darla, his "He-Man-Woman-Hating" friends attempt to sabotage their relationship.', "6.7", ["Children", "Comedy"]),
           21352 => Movie.new(21352, "Andre (1994)", "https://image.tmdb.org/t/p/w500/uo5BozBpQfKXGLPUeUkwBGLG0XW.jpg", "The true story of how a marine seal named Andre befriended a little girl and her family, circa 1962.", "5.3", ["Adventure", "Children", "Drama"]),
           68806 => Movie.new(68806, "Escort, The (Scorta, La) (1993)", "https://image.tmdb.org/t/p/w500/g5dM6wGZvR9aBK55diFRfuFJrRR.jpg", "The film shows the difficulties of an honest, imperiled judge and his bodyguard of four men, trying to clean up a Sicilian town. Corrupt local politicians, working hand-in-hand with the Mafia, will stop at nothing to prevent exposure of their rackets.", "6.4", ["Crime", "Thriller"]),
           37345 => Movie.new(37345, "Princess Caraboo (1994)", "https://image.tmdb.org/t/p/w500/a3Fw33tSGdO2eV8SULQigOITzH4.jpg", "Bristol, England, early 19th century. A beautiful young stranger who speaks a weird language is tried for the crime of begging. But when a man claims that he can translate her dialect, it is understood that the woman is a princess from a far away land. She is then welcomed by a family of haughty aristocrats that only wants to heighten their prestige. However, the local reporter is not at all convinced she is what she claims to be and investigates. Is Caraboo really a princess?", "5.5", ["Drama"]),
           32562 => Movie.new(32562, "Celluloid Closet, The (1995)", "https://image.tmdb.org/t/p/w500/omnB5pI8uoExdIAhiOb5Awd1wym.jpg", "This documentary highlights the historical contexts that gay, lesbian, bisexual and transgender individuals have occupied in cinema history, and shows the evolution of the entertainment industrys role in shaping perceptions of LGBT figures. The issues addressed include secrecy � which initially defined homosexuality � as well as the demonization of the homosexual community with the advent of AIDS, and finally the shift toward acceptance and positivity in the modern era.", "7.2", ["Documentary"]),
           25403 => Movie.new(25403, "Dear Diary (Caro Diario) (1994)", "https://image.tmdb.org/t/p/w500/rAjbgSUvZDoy5jPbC5jD6pWvlyZ.jpg", "Nanni Moretti recalls in his diary three slice of life stories characterized by a sharply ironic look: in the first one he wanders through a deserted Rome, in the second he visits a reclusive friend on an island, and in the last he has to grapple with an unknown illness.", "7.5", ["Comedy", "Drama"]),
           9066 => Movie.new(9066, "Brady Bunch Movie, The (1995)", "https://image.tmdb.org/t/p/w500/qRXSJjhJTZdRSP6gQQEZMLF3d7g.jpg", "The original 70s TV family is now placed in the 1990s, where theyre even more square and out of place than ever.", "6.1", ["Comedy"]),
           771 => Movie.new(771, "Home Alone (1990)", "https://image.tmdb.org/t/p/w500/9wSbe4CwObACCQvaUVhWQyLR5Vz.jpg", "Eight-year-old Kevin McCallister makes the most of the situation after his family unwittingly leaves him behind when they go on Christmas vacation. But when a pair of bungling burglars set their sights on Kevins house, the plucky kid stands ready to defend his territory. By planting booby traps galore, adorably mischievous Kevin stands his ground as his frantic mother attempts to race home before Christmas Day.", "7.4", ["Children", "Comedy"]),
           251 => Movie.new(251, "Ghost (1990)", "https://image.tmdb.org/t/p/w500/yap1VxnhetYhzkAbxTxrUPztSbQ.jpg", "Sam Wheat is a banker, Molly Jensen is an artist, and the two are madly in love. However, when Sam is murdered by his friend and corrupt business partner Carl Bruner over a shady business deal, he is left to roam the earth as a powerless spirit. When he learns of Carls betrayal, Sam must seek the help of psychic Oda Mae Brown to set things right and protect Molly from Carl and his goons.", "7.2", ["Comedy", "Drama", "Fantasy", "Romance", "Thriller"]),
           812 => Movie.new(812, "Aladdin (1992)", "https://image.tmdb.org/t/p/w500/oakAd8syy7jNQ4ZoaAGCQkTqcOV.jpg", "Princess Jasmine grows tired of being forced to remain in the palace, so she sneaks out into the marketplace, in disguise, where she meets street-urchin Aladdin.  The couple falls in love, although Jasmine may only marry a prince.  After being thrown in jail, Aladdin becomes embroiled in a plot to find a mysterious lamp, with which the evil Jafar hopes to rule the land.", "7.6", ["Adventure", "Animation", "Children", "Comedy", "Musical"]),
           280 => Movie.new(280, "Terminator 2: Judgment Day (1991)", "https://image.tmdb.org/t/p/w500/weVXMD5QBGeQil4HEATZqAkXeEc.jpg", "Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.", "8.1", ["Action", "Sci-Fi"]),
           581 => Movie.new(581, "Dances with Wolves (1990)", "https://image.tmdb.org/t/p/w500/cvaBVpS0GzKqBd63pFT8f1E8OKv.jpg", "Wounded Civil War soldier, John Dunbar tries to commit suicide�and becomes a hero instead. As a reward, hes assigned to his dream post, a remote junction on the Western frontier, and soon makes unlikely friends with the local Sioux tribe.", "7.9", ["Adventure", "Drama", "Western"]),
           268 => Movie.new(268, "Batman (1989)", "https://image.tmdb.org/t/p/w500/kbeWnmnHNEnuVej6wcjUv0eY6IL.jpg", 'Batman must face his most ruthless nemesis when a deformed madman calling himself "The Joker" seizes control of Gothams criminal underworld.', "7.2", ["Action", "Crime", "Thriller"]),
           274 => Movie.new(274, "Silence of the Lambs, The (1991)", "https://image.tmdb.org/t/p/w500/rplLJ2hPcOQmkFhTqUte0MkEaO2.jpg", "Clarice Starling is a top student at the FBIs training academy. Jack Crawford wants Clarice to interview Dr. Hannibal Lecter, a brilliant psychiatrist who is also a violent psychopath, serving life behind bars for various acts of murder and cannibalism. Crawford believes that Lecter may have insight into a case and that Starling, as an attractive young woman, may be just the bait to draw him out.", "8.3", ["Crime", "Horror", "Thriller"]),
           408 => Movie.new(408, "Snow White and the Seven Dwarfs (1937)", "https://image.tmdb.org/t/p/w500/1P9eGGlT7eV7kAAvvSh9jfygr1C.jpg", 'A beautiful girl, Snow White, takes refuge in the forest in the house of seven dwarfs to hide from her stepmother, the wicked Queen. The Queen is jealous because she wants to be known as "the fairest in the land," and Snow Whites beauty surpasses her own.', "7.1", ["Animation", "Children", "Drama", "Fantasy", "Musical"]),
           10020 => Movie.new(10020, "Beauty and the Beast (1991)", "https://image.tmdb.org/t/p/w500/7oCAPOphDKpIaxTrnukmDrZ8XKD.jpg", "Follow the adventures of Belle, a bright young woman who finds herself in the castle of a prince whos been turned into a mysterious beast. With the help of the castles enchanted staff, Belle soon learns the most important lesson of all -- that true beauty comes from within.", "7.7", ["Animation", "Children", "Fantasy", "Musical", "Romance", "IMAX"]),
           10895 => Movie.new(10895, "Pinocchio (1940)", "https://image.tmdb.org/t/p/w500/ynkEEi296ofs9kCfRWcaWxOWN1n.jpg", "Lonely toymaker Geppetto has his wishes answered when the Blue Fairy arrives to bring his wooden puppet Pinocchio to life. Before becoming a real boy, however, Pinocchio must prove hes worthy as he sets off on an adventure with his whistling sidekick and conscience, Jiminy Cricket.", "7.1", ["Animation", "Children", "Fantasy", "Musical"]),
           114 => Movie.new(114, "Pretty Woman (1990)", "https://image.tmdb.org/t/p/w500/hMVMMy1yDUvdufpTl8J8KKNYaZX.jpg", "When a millionaire wheeler-dealer enters a business contract with a Hollywood hooker Vivian Ward, he loses his heart in the bargain.", "7.4", ["Comedy", "Romance"]),
           576 => Movie.new(576, "Wild Bunch, The (1969)", "https://image.tmdb.org/t/p/w500/zZhp7p8qvfVrSLKpOFHcKjpEj8f.jpg", "Aging outlaw Pike Bishop prepares to retire after one final robbery. Joined by his gang, Dutch Engstrom and brothers Lyle and Tector Gorch, Bishop discovers the heist is a setup orchestrated in part by a former partner, Deke Thornton. As the remaining gang takes refuge in Mexican territory, Thornton trails them�resulting in fierce gunfights with plenty of casualties.", "7.6", ["Adventure", "Western"]),
           15477 => Movie.new(15477, "Love and a .45 (1994)", "https://image.tmdb.org/t/p/w500/96a45owsQJiBMKw4Iw8zjRZu2AB.jpg", "Small-time criminal Watty Watts attempts to rob a convenience store with his drug-addict buddy, Billy Mack Black. The robbery, however, leads to murder, and soon Watty leaves Billy behind and goes on the run with his beloved girlfriend, Starlene. Heading toward Mexico, the fugitive couple gets plenty of media coverage, until there are even more people on their trail. Can Watty and Starlene make it south of the border without getting caught?", "5.9", ["Action", "Comedy", "Crime"]) }
